INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(1, 2, 'episode', 'Our Father', 2008, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter begins to question his blind loyalty to his father''s memory. In an act of spontaneity, he wonders whether The Code of Harry is a necessity anymore.', '\n      Sep. 28, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMxMTcyNTI4N15BMl5BanBnXkFtZTcwOTY5ODQ5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(2, 2, 'episode', 'Finding Freebo', 2008, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter catches up with Freebo, but once again the kill goes terribly wrong.', '\n      Oct. 5, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI2Njk4ODkwOF5BMl5BanBnXkFtZTcwMTYzMzc5MQ@@._V1_SY180_CR74,0,120,180_.jpg'),
(3, 2, 'episode', 'The Lion Sleeps Tonight', 2008, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Miguel continues to press his unwanted friendship on Dexter, who has other things to worry about - primarily a child molester who has his eye on Astor.', '\n      Oct. 12, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgyODk1Njc3NF5BMl5BanBnXkFtZTcwNjQ1Mzg5MQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(4, 2, 'episode', 'All in the Family', 2008, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter botches his first marriage proposal to Rita, but a shocked and grieving fiancée''s display of emotions provides him with clues on how to show the proper feelings himself.', '\n      Oct. 19, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk2OTY3NTQwOV5BMl5BanBnXkFtZTcwMzU1Mzg5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(5, 2, 'episode', 'Turning Biminese', 2008, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Through Miguel, Dexter learns of a wife-killer who has gone free - the perfect person for his next kill.', '\n      Oct. 26, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTU2NDg0NTI3NV5BMl5BanBnXkFtZTcwNzI4OTAwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(6, 2, 'episode', 'Sí se puede', 2008, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Miguel surprises Dexter by agreeing to his unreasonable request: access to a white supremacist already in custody.', '\n      Nov. 2, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY0MDMxNjkxMl5BMl5BanBnXkFtZTcwNDc4NzEwMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(7, 2, 'episode', 'Easy as Pie', 2008, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter, who once chose his own victims, is now receiving requests - one from Miguel and another from Camilla.', '\n      Nov. 9, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgzNjY1MjE4N15BMl5BanBnXkFtZTcwMDgzMTMwMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(8, 2, 'episode', 'The Damage a Man Can Do', 2008, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter''s friendship with Miguel grows closer - dangerously closer - when Miguel declares that he wants to make the next kill himself.', '\n      Nov. 16, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTIzMDI3NjUwOF5BMl5BanBnXkFtZTcwMjE4MzQwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(9, 2, 'episode', 'About Last Night', 2008, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter learns that Miguel has struck out on his own and performed his own killing.', '\n      Nov. 23, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY4ODM5ODQ2OV5BMl5BanBnXkFtZTcwMzE0MjcwMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(10, 2, 'episode', 'Go Your Own Way', 2008, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Dexter needs leverage against Miguel and goes looking for it - specifically the ring Miguel took from Ellen Wolf as a trophy.', '\n      Nov. 30, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUxMjQ4MTQ3Nl5BMl5BanBnXkFtZTcwNDM4NDUxMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(11, 2, 'episode', 'I Had a Dream', 2008, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'Maria suspects Miguel of Ellen Wolf''s murder, and Dexter knows she suspects it. Dexter will have to make his move before Miguel goes after Maria.', '\n      Dec. 7, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjcyODc0NzU3OV5BMl5BanBnXkFtZTcwOTM4NDUxMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(12, 2, 'episode', 'Do You Take Dexter Morgan?', 2008, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2008&ref_=tt_eps_yr_2008', 'As the wedding day approaches, Dexter still has Ramon to deal with. Meanwhile, the Skinner is still loose, and Dexter is his next intended victim.', '\n      Dec. 14, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTMyNTAwOTE2Ml5BMl5BanBnXkFtZTcwMjE0NjkxMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(13, 2, 'episode', 'My Bad', 2010, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'In the aftermath of last season''s chilling finale, Rita''s death has left Dexter feeling responsible, possibly even...guilty. Unable to deal with the trauma, Dexter makes a drastic decision that will impact everyone around him. Quinn stirs up trouble at the station when he notes that Rita''s murder, which is being pinned on the Trinity Killer, doesn''t fit his normal murder profile. Things get even more heated when Quinn suggests to LaGuerta that they look at the husband: Dexter Morgan. Meanwhile, Quinn offers Debra much needed support, causing her to see Quinn in a new ...', '\n      Sep. 26, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc3MDI4NzM4Ml5BMl5BanBnXkFtZTcwNjc4MDk2Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(14, 2, 'episode', 'Hello, Bandit', 2010, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Dexter''s interview with the FBI goes well he''s told they don''t suspect him of murder since he was at Trinity''s house at the time Rita was killed. He''s having trouble being a single parent however. Astor and Cody want to move back into their house - they''re all living temporarily with Debra in what is now a very overcrowded apartment - and when they skip school one day to go there, Dexter realizes something has to be done. Meanwhile, Debra is also a bit fed up with the situation and goes over to Quinn''s for a decent night''s sleep. Dexter focuses on a new serial killer ...', '\n      Oct. 3, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMyMTkwNzM5MV5BMl5BanBnXkFtZTcwOTc4MDk2Mw@@._V1_SY180_CR75,0,120,180_.jpg'),
(15, 2, 'episode', 'Practically Perfect', 2010, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Dexter is still off duty recovering from recent events. He enlists Debra''s help to find a nanny for 10-month old Harrison and finds the perfect candidate. Having childcare in place allows him to focus on getting rid of serial killer Boyd Fowler, the dead animal sanitation worker. His first attempt doesn''t quite go as planned. He''s also in for a major surprise. Angel Batista''s bar fight with a fellow officer who made disparaging remarks about Maria Laguerta takes a life-threatening turn. Brenda enlists the aid of a Spanish-speaking uniformed officer, Cira Manzon, in ...', '\n      Oct. 10, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIxODU3ODU3NF5BMl5BanBnXkFtZTcwOTU0Njc5Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(16, 2, 'episode', 'Beauty and the Beast', 2010, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Having disposed of serial killer Boyd Fowler, Dexter now has to figure out what to do with the young woman he found alive in Fowler''s house and who saw him get rid of her captor. He manages to identify her as Lumen Pierce from Minnesota but has to get her to trust him. Although still on leave, Dexter agrees to Debra''s request that he examine the crime scene where the most recent beheading took place. He finds evidence that gives them their first real lead in the killings. Quinn is convinced that Dexter is the Kyle Butler who had befriended the Trinity Killer and sets ...', '\n      Oct. 17, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAxNDkxOTg1NV5BMl5BanBnXkFtZTcwODQ0Njc5Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(17, 2, 'episode', 'First Blood', 2010, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Dexter tries to convince Lumen to return to Minnesota but isn''t having much success. She is intent on finding the other men who abused her and kill them and Dexter realizes that perhaps the only way to save her from herself is for him to do the killing for them. When he realizes she has a bead on Boyd Fowler''s former prison cell mate - a convicted rapist - he decides to do the deed himself. He quickly realizes however that the man could not have been one of her attackers. Debra meanwhile continues her investigation into the rash of be-headings which lead the police to...', '\n      Oct. 24, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM2MDQwNTc2OV5BMl5BanBnXkFtZTcwNDgxMDMwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(18, 2, 'episode', 'Everything Is Illumenated', 2010, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Dexter goes after his next victim, Lance Robinson, but before he can complete the deed receives a call from Lumen who hasn''t left Miami and has tracked down one of her attackers. She''s shot the man and now doesn''t know what to do. He goes to the site with Robinson unconscious in his car only to find that the man Lumen shot is alive and has now disappeared. When the police, in the form of his sister Debra, respond to a call at the site Dexter has to be quick on his feet. Still working on the Santa Muerte murderers, Debra sets up a sting for the Fuentes brothers at ...', '\n      Oct. 31, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIyNDAwNzIxNl5BMl5BanBnXkFtZTcwNDIyNzQwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(19, 2, 'episode', 'Circle Us', 2010, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Having decided to help Lumen find the other men who attacked her, Dexter is at a loss when he is called to the scene of a road accident. There he finds a pick-up truck that has disgorged its contents - several formaldehyde-laden barrels containing the bodies of dead women. Of course the women are Boyd Fowler''s victims Dexter had discovered in the swamp some time before. The truck is registered to a celebrity, motivational speaker Jordan Chase, who claims that his truck was stolen. Dexter is more interested in Chase''s head of security, Cole Harmon, who fits Lumen''s ...', '\n      Nov. 7, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ0MTkxMzA1MV5BMl5BanBnXkFtZTcwMTYzOTYwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(20, 2, 'episode', 'Take It!', 2010, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Having identified one of Lumen''s attackers, Cole Harmon, Dexter set out to do what he does best. He attends one of Jordan Chase''s seminars and the plan is to rent a hotel room next to Cole Harmon, who is Chase''s head of security, and eliminate him there. He shows Lumen how to prepare a killing room but events don''t quite unfold as planned. In the end, Dexter gets a vital clue that identifies another of the men who attacked her. Lumen also has to deal with her ex-fiancé who suddenly shows up in Miami. At the station, the fallout from the shootings at the night club ...', '\n      Nov. 14, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4NzM5MzM4Ml5BMl5BanBnXkFtZTcwMzM1NzkwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(21, 2, 'episode', 'Teenage Wasteland', 2010, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Dexter has now set his sights on self-help guru Jordan Chase and is spending some time with him getting to know him better. His life is turned upside down however with the sudden arrival of his step-daughter Astor and her friend Olivia. They''re drunk and have lied about where they are. Astor is rebellious, refusing to tell Dexter what she is up to or why she is acting this way. She is also convinced that Lumen is Dexter''s new girlfriend. Lumen has a conversation with Olivia that puts the girls escapade in an entirely new light. When the girls disappear from his house,...', '\n      Nov. 21, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA1NzM5MTQyNV5BMl5BanBnXkFtZTcwMzAzMjIxNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(22, 2, 'episode', 'In the Beginning', 2010, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Lt. Laguerta has decided to re-open the barrel girls murder case and assigns a reinstated Debra Morgan and Quinn to arrest Cole Harmon. Of course, they don''t know that Dexter has already taken care of things. They do find that the men made videos of their attacks. Debra begins putting the pieces together and concludes there is a vigilante killer getting rid of the men who attacked and killed the women. From the blood in the small vial Jordan Chase wears around his neck, Dexter is able to track it to Emily Birch who, to his surprise, is still alive. She''s not very ...', '\n      Nov. 28, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTUxMTI2MjM5MF5BMl5BanBnXkFtZTcwMjQyNDQxNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(23, 2, 'episode', 'Hop a Freighter', 2010, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Dexter and Lumen are trying to figure out how to get Jordan Chase but he catches on to the fact they have been under video surveillance. He manages to trace the equipment back to Joey Quinn, not realizing that Stan Liddy is behind it all. He and Lumen burglarize Quinn''s apartment and find some of the photos of them at the marina. Dexter learns soon enough just who is behind it. Debra meanwhile has pretty well figured out the case and tells her colleagues about her vigilante theory: that the killer is probably the 13th victim who escaped and that she is likely being ...', '\n      Dec. 5, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQxODc1NjMzM15BMl5BanBnXkFtZTcwMDM1ODYxNA@@._V1_SY180_CR75,0,120,180_.jpg'),
(24, 2, 'episode', 'The Big One', 2010, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2010&ref_=tt_eps_yr_2010', 'Just as Dexter is about to set off find Jordan Chase, his entire family arrives having decided to travel down from Orlando to celebrate Harrison''s birthday in Miami. Cody and Astor have something special to ask him. Having managed to extricate himself from any family obligations from the day, he arrives at the station to learn that Liddy''s body has been found and the entire squad is assigned to working on the case. Things quickly deteriorate for Joey Quinn who is taken into custody after they find Liddy''s phone and see that Quinn was frequently called on the day he ...', '\n      Dec. 12, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU4MDExOTcyNV5BMl5BanBnXkFtZTcwMjEzMDkxNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(25, 2, 'episode', 'Living the Dream', 2009, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter''s sleep deprivation puts both his day job and his nighttime hunting in jeopardy. Lundy is back in town to capture the Trinity Killer - someone he can''t even prove exists.', '\n      Sep. 27, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ5MTAwOTcwMl5BMl5BanBnXkFtZTcwNTM1ODA4Mg@@._V1_SY180_CR79,0,120,180_.jpg'),
(26, 2, 'episode', 'Remains to Be Seen', 2009, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'A sleep-deprived Dexter desperately tries to remember where he hid the body parts of his latest victim.', '\n      Oct. 4, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU1NTEyNjMwM15BMl5BanBnXkFtZTcwNDE4Nzk3Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(27, 2, 'episode', 'Blinded by the Light', 2009, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter is facing some marriage and parenting challenges. Rita is mothering him somewhat after the accident and is not allowing him to drive, as per the doctor''s orders. Step-daughter Astor is growing up and everything Dexter does seems to be the wrong thing. The neighborhood watch committee goes into action when someone vandalizes property. Dexter soon has a bead on the likely culprit and decides to put his own skills to work. The Trinity Killer strikes again but Debra and ex-Agent Lundy are the only ones who seem to think the death is part of the serial killer''s work...', '\n      Oct. 11, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgwOTI4ODMwOF5BMl5BanBnXkFtZTcwNDIxMjA5Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(28, 2, 'episode', 'Dex Takes a Holiday', 2009, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'With Rita away with the kids away attending a cousin''s wedding, Dexter finally has the freedom to find another victim. He focuses on Zoey Kruger, a police officer whose husband and child were killed in a house invasion. The blood evidence suggests that she may have actually planted evidence to incriminate a known thief and was in fact responsible herself for the killing. She hears of Dexter''s investigation and warns him off in no uncertain terms, but he decides to go ahead anyway. Debra is spending more and more time with ex-Agent Frank Lundy and helping in his ...', '\n      Oct. 18, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzI3ODQ1OTcwOF5BMl5BanBnXkFtZTcwNTA4ODA5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(29, 2, 'episode', 'Dirty Harry', 2009, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'With Debra recovering in the hospital, Dexter re-doubles his efforts to locate the Trinity Killer. Knowing that he is following the same pattern as his murders from 30 years ago, Dexter is sure he knows where he will strike next. Afterward, he follows the serial killer to his home and is shocked by what he finds. Dexter also has some explaining to do when Rita finds out that he never gave up his apartment and still keeps some of his possessions there. Sgt. Batista plants a news item about the suspected Vacation Murderer that bears fruit. Having told her superiors of ...', '\n      Oct. 25, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgwNjUxNzA2OV5BMl5BanBnXkFtZTcwMTkwNzM5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(30, 2, 'episode', 'If I Had a Hammer', 2009, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter knows it''s only a matter of time before Miami Metro discovers the Trinity Killer''s latest handiwork. Therefore, he has to work doubly hard to stay one step ahead of their investigation. Dexter has begun to realize that the closer he gets to Trinity, the more he stands to learn from this very different beast. Trinity hides behind a well-kept mask, and getting behind that facade will require some extra prodding on Dexter''s part. Meanwhile, Debra becomes frustrated when she finds herself shut out from her own case. She considers bending the rules in the name of ...', '\n      Nov. 1, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgwOTE2OTM4M15BMl5BanBnXkFtZTcwOTAwNDc5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(31, 2, 'episode', 'Slack Tide', 2009, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter is resting with his family in his boat not worried about the Trinity Killer that has completed his cycle of murders. Out of the blue, he is summoned by Miami Metro to analyze an arm that has been found in the stomach of an alligator. He discovers that it belonged to the illegal waitress and aspirant model Estrella Carazo that has vanished. After the investigation Sergeant Batista finds that the photographer Jonathan Farrow is the prime suspect, but he gets no search warrant to check Farrow''s studio. Farrow jumps to the top of Dexter''s list and he breaks in the ...', '\n      Nov. 8, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA5NzE2ODQ1MF5BMl5BanBnXkFtZTcwNzEwNDc5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(32, 2, 'episode', 'Road Kill', 2009, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter is uncomfortable for having killed an innocent. He visits Arthur Mitchell and his family and learns that Trinity is planning to travel to Tampa. Dexter plots a scheme to travel to a Convention of Meteorology in Tampa to kill the serial-killer. He forces Trinity to give a ride to him and they travel together. Dexter tells Trinity that he had killed a man by mistake in a hunting accident. Trinity brings Dexter to the house where he lived when he was a child and he accidentally killed his sister in the bathroom and Dexter concludes that this was the place where it...', '\n      Nov. 15, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(33, 2, 'episode', 'Hungry Man', 2009, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter stops by Arthur''s house for a visit and realizes that though Arthur is in appearance the happy family man, he is in fact terrorizing his family. According to Arthur''s son Jonah, they are all regularly beaten. Jonah is afraid to confront his father and invites Dexter for Thanksgiving dinner. The confrontation between Arthur and his family forces Dexter to take action. While Dexter is away for lunch with the Mitchells, neighbor Elliot kisses Rita and she clearly lets him, though she immediately regrets it. Meanwhile, LaGuerta and Batista finally admit to what has...', '\n      Nov. 22, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTM5OTQyMjI3OF5BMl5BanBnXkFtZTcwMDIwODAwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(34, 2, 'episode', 'Lost Boys', 2009, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'When Arthur kidnaps a young boy from a video arcade, Dexter realizes that his killing cycle has started again and that it includes four, not three, killings. The disappearance of the boy is headlines news in Miami and Dexter gets a clue as to Arthur''s whereabouts when his son Jonah tells him his Dad was recently looking at houses for sale. Debra finally sits down with reporter Christine Hill to give the interview she promised. Debra turns the tables on her by becoming the interviewer and questioning how she could have managed to get to site of the Lundy and her ...', '\n      Nov. 29, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2NjIzNzcwOV5BMl5BanBnXkFtZTcwMTY1OTMwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(35, 2, 'episode', 'Hello, Dexter Morgan', 2009, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter is determined to take care of the Trinity Killer/Arthur Mitchell himself, at least in part to atone for the mistake he made. When Dexter learns that Christine Hill is in custody, he realizes that the police will soon be onto Arthur, so he sets up an elaborate ruse to send them down the wrong path. It all backfires and ends in another death. Arthur also learns his real name and the work he does. Meanwhile, Rita finally tells Dexter about the kiss at Thanksgiving, but isn''t quite sure what to make of his nonplussed reaction. Also, Laguerta and Batista are caught ...', '\n      Dec. 6, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgwMDE0ODc3N15BMl5BanBnXkFtZTcwMjc1OTMwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(36, 2, 'episode', 'The Getaway', 2009, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2009&ref_=tt_eps_yr_2009', 'Dexter is obsessed with getting the Trinity Killer himself, especially after Arthur has tracked him to Metro Homicide and learns his real identity. Dexter realizes the threat to his family and with the older stepchildren off with their grandparents, he convinces Rita to take Harrison to the Keys where he will join them later for a weekend honeymoon. His first attempt to take care of Arthur goes awry when as a result of a traffic accident, he finds himself in jail for leaving the scene. His second attempt is more successful, but his obsession to kill Arthur comes with ...', '\n      Dec. 13, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI3OTYyODc5NV5BMl5BanBnXkFtZTcwMTQ5ODUwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(37, 2, 'episode', 'Those Kinds of Things', 2011, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Life for Dexter is returning to normal. He''s taking care of his son with the help of Angel Batista''s sister Jamie. He dispatches two EMTs who have been killing patients to harvest their organs and he''s looking forward to his high school 20th anniversary reunion. Not surprisingly, Dexter was something of an outsider in school but one girl, Janet, was at least nice to him. She dated and eventually married the schools star quarterback Joe Walker but committed suicide after they were married. Dexter is certain that Joe killed her and his main interest in the reunion ...', '\n      Oct. 2, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc0MDQzNzcxNF5BMl5BanBnXkFtZTcwNjY5MzMwNg@@._V1_SX120_CR0,0,120,180_.jpg'),
(38, 2, 'episode', 'Once Upon a Time...', 2011, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Dexter lines up his next victim, Brother Sam a criminal who claims to have found religion and while still running his body repair shop, gives other ex-cons a chance at rehabilitation. Dexter isn''t buying any of it and is certain that Sam will be his worthy next victim. Doesn''t quite turn out that way. The investigation into the dead man with the snakes put into his torso advances when one of the students finds heavy metals in their system. The two men responsible for that killing continue their preparations. Deb meanwhile has a day to remember. Still getting praise ...', '\n      Oct. 9, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTgzMDUyMjM3OV5BMl5BanBnXkFtZTcwMDYzNDg4Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(39, 2, 'episode', 'Smokey and the Bandit', 2011, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Deb faces her first day as the homicide squad''s Lieutenant. She isn''t sure she''s made the right decision given that she not used to the administrative side of the job and the fact that she is also supervising her now ex-boyfriend Quinn. She also has to deal with Captain LaGuerta who seems to want to do both her new and her old job. The police find another body on the shore. The dead woman may have been a prostitute but it''s her missing tooth that sends Dexter to an old scrap book. He finds a newspaper clipping for a serial killer from Oregon who the press labeled the ...', '\n      Oct. 16, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU5NTYzMjE4Nl5BMl5BanBnXkFtZTcwMTA4NjE5Ng@@._V1_SY180_CR76,0,120,180_.jpg'),
(40, 2, 'episode', 'A Horse of a Different Color', 2011, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Dexter is in awe of the latest display from the Doomsday killer: the Four Horsemen of the Apocalypse made up of mannequins and human body parts. Testing confirms that the human parts all came from the same body. Deb Morgan, in her capacity as the new Lieutenant in homicide, holds her first press conference which she concludes did not go well. She is certainly very blunt. Meanwhile, Geller is unhappy with Travis'' decision to go on a date with a pretty waitress. There''s a price to pay for that. Dexter has a family crisis when Harrison has a burst appendix. Back in the ...', '\n      Oct. 23, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjExNjY2NjUyNF5BMl5BanBnXkFtZTcwMTg5MzQ5Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(41, 2, 'episode', 'The Angel of Death', 2011, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Dexter runs background checks on Travis and discovers that he was a former student of Gellar. Batista and Quinn go to the university where Gellar used to teach.', '\n      Oct. 30, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYwNTkyOTI3N15BMl5BanBnXkFtZTcwMDg3MTEwNw@@._V1_SY180_CR76,0,120,180_.jpg'),
(42, 2, 'episode', 'Just Let Go', 2011, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'As Dexter is following Travis in the hope of finding Professor Geller, he learns of Brother Sam''s shooting. He races to the hospital to learn Sam is unconscious. He sets out to find the killer and is quite certain who the culprit might be. During a brief lucid period, Sam asks him not to avenge his death. Deb tells Batista to get Professor Porter down to Miami for further questioning but realizes the whole case is in jeopardy when she learns Quinn spent the night with her. At the police psychologists suggestion, Deb decides to throw a house warming party. Meanwhile, ...', '\n      Nov. 6, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3NjM0NzI0M15BMl5BanBnXkFtZTcwMTIxMTQwNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(43, 2, 'episode', 'Nebraska', 2011, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Having avenged Brother Sam''s death, Dexter gets some bad news from Deb - it appears the Trinity Killer has returned to kill his wife and daughter, leaving his son Jonah as the only survivor. Dexter knows that Trinity is lying in pieces at the bottom of the ocean and immediately suspects that Jonah may have taken over where his father left off. He sets off for Nebraska to confront Jonah accompanied by someone from his past. When he confirms Jonah''s role in the deaths, Dexter clearly has a choice to make. Back in Miami, the team gets a significant lead when they locate ...', '\n      Nov. 13, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk0MzM4NzUzNl5BMl5BanBnXkFtZTcwNjIwMTQwNw@@._V1_SY180_CR76,0,120,180_.jpg'),
(44, 2, 'episode', 'Sin of Omission', 2011, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Dexter returns to Miami after his road trip to Nebraska and get a frosty reception from Debra who has been under pressure to get results in the doomsday killer case. He does his best to make amends, but doesn''t share what he knows about Travis and Professor Gellar. Thanks to Masuka''s intern Louis, the police now have a list of 200 of Gellar''s former students living in the Miami area and the team fans out to interview them all. It doesn''t stop the Doomsday Killer from striking again with a new tableau: the Whore of Babylon. Meanwhile Capt. Laguerta takes a particular ...', '\n      Nov. 20, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(45, 2, 'episode', 'Get Gellar', 2011, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Having rescued Travis at the church, Dexter now tries to figure out what the next tableau will be. With Travis having agreed to help him, Dexter gets him a room in a hotel to keep him safe. A clue from one of the paintings eventually leads Dexter to a Professor Casey, an avowed atheist. He tries to warn Casey about what may happen but the professor brushes him off, claiming to get threats all of the time. Unfortunately, the doomsday killer strikes again. When Travis disappears, Dexter traces him to the church. Dexter finds him alive but also makes a startling ...', '\n      Nov. 27, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk4MjgxMDk0NV5BMl5BanBnXkFtZTcwMjM0MTkwNw@@._V1_SY180_CR76,0,120,180_.jpg'),
(46, 2, 'episode', 'Ricochet Rabbit', 2011, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Now realizing the error he has made, Dexter redoubles his efforts to track down the doomsday killer and eliminate him. He plants evidence in the church to keep the police off the scent and sets out to find DDK. He manages to track down Holly, the woman Travis freed, but too late. From the evidence at the crime scene, Dexter believes he knows what DDK will strike with next, though he has no idea where. With Quinn hung over and not at work, Batista sets off to interview a person of interest which may have major ramifications for him. Meanwhile, Deb goes through the ...', '\n      Dec. 4, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTM3MDEyNzQxNl5BMl5BanBnXkFtZTcwMDY3NzExNw@@._V1_SY180_CR76,0,120,180_.jpg'),
(47, 2, 'episode', 'Talk to the Hand', 2011, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Dexter finds himself at the yacht where Travis and his accomplices were preparing the next tableau, Wormwood". They quickly realize that Travis is planning a gas attack. Worried that Batista has not been seen since the previous day, Quinn sets off to find him. Travis meanwhile sends Beth Dorsey to Miami Metro homicide with a canister of deadly gas and orders her to meet with Lt. Morgan. Deb has dinner with Deputy Chief Matthews and discusses the case of the dead call girl. The next day Deb realizes that Laguerta is very adept at office politics.', '\n      Dec. 11, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5NDMzMDYxMl5BMl5BanBnXkFtZTcwMjU3NDQxNw@@._V1_SY180_CR76,0,120,180_.jpg'),
(48, 2, 'episode', 'This Is the Way the World Ends', 2011, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2011&ref_=tt_eps_yr_2011', 'Stuck in the ocean miles from shore, Dexter is rescued by an old boat carrying illegal immigrants to the US. He even manages to render them a service. Once ashore, he heads home hoping to figure out where and when Travis will stage his last tableau. Travis has holed up in a small house and has killed the occupants. While he''s away, the police show up and Dexter has something of a surprise waiting for him. Dexter makes it to son Harrison''s school recital only to have Travis take the child. Meanwhile, Debra has a plan to catch Travis and gets LaGuerta''s support for her ...', '\n      Dec. 18, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY5NTY0MTM1N15BMl5BanBnXkFtZTcwNDgwODYxNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(49, 2, 'episode', 'It''s Alive!', 2007, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Dexter becomes anxious and frustrated after more than a month without killing. When he finally gets his chance, he finds he is off his game.', '\n      Sep. 30, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(50, 2, 'episode', 'Waiting to Exhale', 2007, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Dexter, desperate to get his game back, seeks out Chino yet again; but the hulking gangster is waiting for him.', '\n      Oct. 7, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(51, 2, 'episode', 'An Inconvenient Lie', 2007, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Lying becomes the theme of Dexter''s life when his lie - or rather, half-truth - about being an addict leads to Rita insisting that he join a 12-step program.', '\n      Oct. 14, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(52, 2, 'episode', 'See-Through', 2007, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Rita feels threatened when she meets Dexter''s new NA sponsor, Lila. She also deals with a visit from her estranged mother. Elsewhere, Dexter continues to try to throw the persistent FBI Agent Lundy off his trail.', '\n      Oct. 21, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(53, 2, 'episode', 'The Dark Defender', 2007, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Dexter learns that one of the three men who murdered his mother is still alive and, thanks to the Witness Protection Program, running a pub in Naples, FA.', '\n      Oct. 28, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(54, 2, 'episode', 'Dex, Lies, and Videotape', 2007, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'The Bay Area Butcher now has a copycat, and Dexter must stop him before Agent Lundy puts the Butcher case entirely into the hands of the FBI.', '\n      Nov. 4, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(55, 2, 'episode', 'That Night, a Forest Grew', 2007, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Dexter sends the Miami Tribune a 32-page manifesto designed purely to baffle and mislead the police. His scheming continues as he finally fights back against Sgt. Doakes.', '\n      Nov. 11, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(56, 2, 'episode', 'Morning Comes', 2007, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Thanks to some deliberately bad blood work, Agent Lundy comes closer to uncovering the Bay Harbor Butcher.', '\n      Nov. 18, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(57, 2, 'episode', 'Resistance Is Futile', 2007, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Dexter is in shock when he realizes that his blood slides are gone. It seems that Agent Lundy really has him now; but there''s more going on than he knows.', '\n      Nov. 25, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(58, 2, 'episode', 'There''s Something About Harry', 2007, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'As Dexter keeps Doakes caged in Jimenez''s cabin, Doakes reveals that he knows something about the death of Dexter''s father. This clue leads Dexter to discover a shocking truth.', '\n      Dec. 2, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(59, 2, 'episode', 'Left Turn Ahead', 2007, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Dexter decides that he needs to turn himself in, but gives himself a day to get his life together. Meanwhile, he leaves Doakes in his cage.', '\n      Dec. 9, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(60, 2, 'episode', 'The British Invasion', 2007, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2007&ref_=tt_eps_yr_2007', 'Lila makes a shocking discovery about Dexter and takes advantage of it in a desperate ploy to win him back - or rather, force him back.', '\n      Dec. 16, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(61, 2, 'episode', 'Dexter', 2006, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'Dexter takes part in the investigation of a serial killer who drains his victims of blood. He also kills two criminals, and his romantic relationship may be going to the next level.', '\n      Oct. 1, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(62, 2, 'episode', 'Crocodile', 2006, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'Dexter''s world of police analyst by day, and serial killer by night, is rocked when he''s privately contacted by another serial killer, whom the department is investigating, who claims that the killer knows about Dexter''s double life. Meanwhile, Dexter''s sister, Debra begins investigating the mysterious killings with Dexter''s help, but who lets her take the credit. She then finds a stolen refrigerated truck which contains a gruesome message. Dexter also begins stalking his next victim, a wealthy businessman who gets acquitted of a drunk driving charge. Elsewhere, Sgt. ...', '\n      Oct. 8, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(63, 2, 'episode', 'Popping Cherry', 2006, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'After the dead body of another of victim of the so-called "Ice Truck Killer" is found on the ice rink at Miami''s Hockey Dome, Dexter helps out Debra, newly transfered to the homicide squad to investigate when Lt. Laguerta, ambitious for a promotion and the media spotlight, decides to have the department pursue a security guard whom they believe is the Ice Truck Killer. Meanwhile, Rita receives an unpleasant visit from her imprisoned ex-husband''s drug dealer who confiscates her car, leading Dexter to drive her to and from her hotel receptionist job, while at the same ...', '\n      Oct. 15, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(64, 2, 'episode', 'Let''s Give the Boy a Hand', 2006, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'The mysterious Ice Truck Killer escalates his killing spree by leaving body parts of his latest victim at sites that relate to memories from Dexter''s childhood, leading Dexter him to confront his dark personal history.', '\n      Oct. 22, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(65, 2, 'episode', 'Love American Style', 2006, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'Debra and the rest of the squad start to make headway when one of the Ice Truck Killer victims is found alive. Meanwhile, Dexter gets in over-his-head trouble when he begins stalking a murderous human-trafficker.', '\n      Oct. 29, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(66, 2, 'episode', 'Return to Sender', 2006, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'The Ice Truck Killer leaves a surprise dead body for Dexter at one of the crime scenes of Dexter''s most recent kill, which puts him in the cross hairs of his own Homicide Division of the Miami Metro Police.', '\n      Nov. 5, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(67, 2, 'episode', 'Circle of Friends', 2006, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'The Ice Truck Killer is supposedly identified, but Dexter is skeptical. Meanwhile, Rita must deal with the return of her menacing, recently paroled ex-husband.', '\n      Nov. 12, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(68, 2, 'episode', 'Shrink Wrap', 2006, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'The suicide of a wealthy and powerful businesswoman leads Dexter to suspect that her psychologist may have killed her. But Dexter gets a surprise of his own when he pays a visit to the suspect, Dr. Emmett Meridian, which he forces Dexter to open up dark secrets from his past. Elsewhere, as Rita becomes more warmer to her ex-husband Paul, who claims to be a changed man, she wants to move onto intimacy with Dexter, who is afraid of consummating their romance. Meanwhile, Lt. Laguerta visits to Neil Perry makes her become more skeptical to his claims as the Ice Truck ...', '\n      Nov. 19, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(69, 2, 'episode', 'Father Knows Best', 2006, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'Dexter learns that his biological father (named Joe Driscoll), whom he was told had died 30 years ago, has just recently died and left him everything he owned, including his house. He goes on a trip to pack the items in the house, along with Rita. But later, Debra and Rudy also show up at the house to help out, where Dexter clicks with Rudy, while suspecting something strange about Joe Driscoll''s death, and about who Dexter''s biological mother was. Flashbacks to Dexter''s childhood show him questioning Harry about who his real parents were, and about an accident which ...', '\n      Nov. 26, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(70, 2, 'episode', 'Seeing Red', 2006, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'When the Ice Truck Killer leaves a horribly bloody crime scene at a hotel, Dexter digs deeper into his past.', '\n      Dec. 3, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(71, 2, 'episode', 'Truth Be Told', 2006, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'Dexter investigates when the Ice Truck Killer strikes again, killing the prosthetic arm prostitute and leaving her body before a Christmas tree in Miami''s Santa''s Cottage. Sgt. Doakes continues to grow more suspicious about Dexter after catching him in a series of lies about his connection to the Ice Truck Killer. Dexter finally finds a connection between him and the Ice Truck Killer over a past case involving Harry Morgan and a bloodbath crime scene back in 1973 involving Dexter''s biological mother. Meanwhile, Lt. Maria Laguerta braces herself for dramatic changes in...', '\n      Dec. 10, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(72, 2, 'episode', 'Born Free', 2006, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2006&ref_=tt_eps_yr_2006', 'Dexter races against the clock to find Debra when she is abducted by Rudy, the Ice Truck Killer, which leads the two psychopathic killers to have a fateful showdown, and who finally reveals his connection to Dexter.', '\n      Dec. 17, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(73, 2, 'episode', 'Are You...?', 2012, 1, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'Having been caught in the act of eliminating Travis Marshall by his sister Deb, Dexter has to scramble to come up with an explanation. Deb is understandably shaken by what she''s just seen but accepts, somewhat reluctantly, Dexter''s explanation that he''s suffered momentary madness. As she thinks about it, Dexter''s explanation makes no sense and decides to dig deeper. Captain LaGuerta meanwhile is puzzled by a piece of evidence she found at the scene of the Marshall killing. When a member of the homicide squad is killed, Dexter goes all out to stop the killer before he ...', '\n      Sep. 30, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTQ1MDY3NTY1NV5BMl5BanBnXkFtZTcwOTAyNTc0OA@@._V1_SX120_CR0,0,120,180_.jpg'),
(74, 2, 'episode', 'Sunshine and Frosty Swirl', 2012, 2, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'With Deb having found all of Dexter''s paraphernalia, including the blood slides, he has little choice but to admit everything. She decides not to arrest him or let the police know what he does during his off hours. She does decide she''s going to try and cure him and keeps him on a very short leash. Dexter is wondering more and more what to do about Louis Greene who he is convinced sent him the hand from the Ice Truck killer case. Louis doesn''t scare easily however. The police continue to press the investigation into Mike Anderson''s death not knowing that Dexter has ...', '\n      Oct. 7, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA4MDE3ODk4MjleQTJeQWpwZ15BbWU3MDY0MTU5MTg@._V1_SY180_CR76,0,120,180_.jpg'),
(75, 2, 'episode', 'Buck the System', 2012, 3, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'With Deb keeping a close eye on him, Dexter is starting to go stir crazy. He desperately wants to satisfy his dark passenger but first decides to get Louis Greene out of his life forever. Deb is growing increasingly frustrated at the lack of progress in finding Mike Anderson''s killer. The murderer''s employer, Isaak Sirko, is having much better luck and actually traces his former employee right to Dexter''s boat. Dexter wants to kill someone and focuses on the recently paroled killer Ray Speltzer. Dexter is convinced that Speltzer will kill again and tries to convince ...', '\n      Oct. 14, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwNDczNTk2OV5BMl5BanBnXkFtZTcwMzg4NzkxOA@@._V1_SY180_CR76,0,120,180_.jpg'),
(76, 2, 'episode', 'Run', 2012, 4, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'The police quickly catch up with Ray Speltzer and does a brilliant job interrogating him and getting a confession. She and others are shocked however when a judge ruled the arresting officers had violated his Miranda rights and releases him. When he shows up on the sidelines of his latest victim''s funeral, Deb goes berserk and decides they have to get him at all costs. Dexter decides it''s time for him to do what he does best. Meanwhile, the police are still raiding the strip club and owner Isaak Sirko decides it''s time to give the police what they want and frames ...', '\n      Oct. 21, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgyNzIzNTI3N15BMl5BanBnXkFtZTcwNTYxNTg1OA@@._V1_SY180_CR76,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(77, 2, 'episode', 'Swim Deep', 2012, 5, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'After Deb learns that she has sent forensic evidence to an outside lab for analysis, Captain LaGuerta confides in her that she found a blood slide at the site of the Marshall killing and believes the Bay Harbor butcher is still alive. The Captain accepts Deb''s offers to help her in the investigation. When Dexter learns what''s going on, he just wants Deb to stay out of it. Dexter finds blood on his boat and tests reveal it belongs to Louis Greene. He soon after finds he has to deal with Isaak Sirko who is clearly out for revenge. Dexter''s plan to get him doesn''t work ...', '\n      Oct. 28, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2MDkzMDMzN15BMl5BanBnXkFtZTcwNzY0MjA2OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(78, 2, 'episode', 'Do the Wrong Thing', 2012, 6, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'Dexter decides he''s going to eliminate Hanna McKay and gathers evidence that she has eliminated a number of people in her life. Something unexpected occurs however. LaGuerta begins to think that the Bay Harbor Butcher may have been responsible for the deaths of several criminals who vanished before they could be arrested. After discussing the situation with Nadia, Quinn decides to return the money left in his car. He''s given little choice but to help the mobsters: either he eliminates the blood evidence they have linking Isaak Sirko to the Colombian shooting or Nadia ...', '\n      Nov. 4, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE3OTEwNzM1M15BMl5BanBnXkFtZTcwNDEyOTE2OA@@._V1_SX120_CR0,0,120,180_.jpg'),
(79, 2, 'episode', 'Chemistry', 2012, 7, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'Dexter''s problems keep mounting. After the surprise outcome of his planned execution of Hannah McKay, they agree they are far too much alike and decide not to see each other again. It doesn''t quite work out as planned. Dexter learns that true crime writer Sal Price is writing a book about Hannah as he is convinced she was an active participant in the murders believed to have been committed by her boyfriend. Dexter sets out to get Sal to go in another direction but Hannah takes charge of things. Deb wants Dexter to do what he does best. Meanwhile, Quinn comes under ...', '\n      Nov. 11, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE5MDY3OTYxNl5BMl5BanBnXkFtZTcwOTQ0OTE3OA@@._V1_SX120_CR0,0,120,180_.jpg'),
(80, 2, 'episode', 'Argentina', 2012, 8, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'Having spent the night together, Hannah and Dexter decide to see each other again. He''s not so sure what he''s going to do about Deb however. She is adamant that Dexter get rid of Hannah but he refuses, saying he''s sure she doesn''t want to be responsible for a murder. With everything he has to deal with, Cody and Astor come to stay with him after their grandfather is hospitalized. Deb finally breaks down and tells him her true feelings. Isaak Sirko decides to take a more direct approach and tries to shoot Dexter in broad daylight. Strip club manager George Novikov ...', '\n      Nov. 18, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjU5MjUxNzU2OF5BMl5BanBnXkFtZTcwMjIxMDE3OA@@._V1_SY180_CR76,0,120,180_.jpg'),
(81, 2, 'episode', 'Helter Skelter', 2012, 9, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'Isaak Sirko learns that the Koshka Brotherhood has sent two assassins to Miami to eliminate him. Surprisingly he turns to Dexter with a proposition: help him eliminate the assassins in return for his life. Dexter''s not too keen on the proposal and turns him down. Isaak acquires a trump card however: he''s taken Hannah hostage and now offers him her life as well. Dexter also has to deal with Deb who is embarrassed by her earlier admission to Dexter that she''s in love with him. Hannah meanwhile keeps trying to get Dexter to open up to her. Captain LaGuerta approaches her...', '\n      Nov. 25, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwNjIxOTkzN15BMl5BanBnXkFtZTcwNjExMDE3OA@@._V1_SX120_CR0,0,120,180_.jpg'),
(82, 2, 'episode', 'The Dark... Whatever', 2012, 10, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'There is another victim of the phantom arsonist, the fifth in two weeks. Dexter thinks has a pretty good idea who is behind it. He is frustrated because he promised Deb not to interfere in police cases. He tries to explain his dark passenger to Hannah but they''re interrupted by a man peeking through the window - who turns out to be Hannah''s father who has just been released from prison. He wasn''t a very good father - he once left her alone in a motel room for three days while he went off to play poker. He seems to have reformed but after she refuses him a loan he ...', '\n      Dec. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5MjM4MjY3OF5BMl5BanBnXkFtZTcwMTIxNDM3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(83, 2, 'episode', 'Do You See What I See?', 2012, 11, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'At Deb''s request, Batista locates Arlene Schramm, the witness who saw Hannah McKay kill a counselor in a halfway house. When Deb blacks out and has a car accident, she thinks she knows who might have been responsible. Dexter learns that the last of the men who killed his mother, Hector Estrada, is up for parole but has no objection as he has his own plans for the killer. Matthews has a chat with Dexter and tells him of Captain LaGuerta''s theory about him being the Bay Harbor Butcher. Dexter is quick on his feet and Matthews believes him when he denies it all. When ...', '\n      Dec. 9, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjMyNDk2Mjc2Nl5BMl5BanBnXkFtZTcwMzEwNDg3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(84, 2, 'episode', 'Surprise, Motherfucker!', 2012, 12, 'http://www.imdb.com/title/tt0773262/episodes?year=2012&ref_=tt_eps_yr_2012', 'Dexter visits Hannah in jail to explain why he didn''t protect her and she in turn explains why she did what she did. She seems to understand Dexter but has her own plans which don''t include prison. Captain LaGuerta disregards the evidence she and Tom Matthews have discovered - and which Dexter planted - which points to Sgt. Doakes as the Bay Harbor Butcher and continues her investigation into Dexter. She arrests him but Dexter has set her up and she is forced to release him leading most at Miami Metro to believe she was trying to frame him. Dexter still wants to get ...', '\n      Dec. 16, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk5Mjk1NTE0NV5BMl5BanBnXkFtZTcwMzU2MzQ4OA@@._V1_SY180_CR75,0,120,180_.jpg'),
