(97, 5, 'episode', 'Girls Vs. Suits', 2010, 12, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Barney chooses between wearing suits and sleeping with a sexy bartender. Meanwhile, Ted gets ever closer to meeting "the mother".', '\n      Jan. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ2ODExNTExOV5BMl5BanBnXkFtZTcwMTI0MzExMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(98, 5, 'episode', 'Jenkins', 2010, 13, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'When Marshall finds out he''s the "reacher" in his relationship with Lily and not the "settler," he considers pursuing a sexy and cool female coworker. Meanwhile, Ted finds out Robin is a drinking game for his architecture students.', '\n      Jan. 18, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMxMDQwMTE3OF5BMl5BanBnXkFtZTcwNDIwNDMxMw@@._V1_SY180_CR5,0,120,180_.jpg'),
(99, 5, 'episode', 'Perfect Week', 2010, 14, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'When Barney is about to complete the perfect week - landing seven different girls in seven days - the gang roots him on in order to forget about their own miserable week.', '\n      Feb. 1, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2MzgzODY3NV5BMl5BanBnXkFtZTcwMzI5MDYxMw@@._V1_SY180_CR20,0,120,180_.jpg'),
(100, 5, 'episode', 'Rabbit or Duck', 2010, 15, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Barney runs into problems when he displays his cell phone number during the Super Bowl, Ted asks Marshall and Lily to arrange a marriage for him, and Robin thinks that her co-anchor has asked her out on a date.', '\n      Feb. 8, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(101, 5, 'episode', 'Hooked', 2010, 16, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'When the gang tries to convince Ted that he is being strung along by Tiffany, they reflect about relationships where each of them has been in the same situation.', '\n      Mar. 1, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzNTI2MjQxNF5BMl5BanBnXkFtZTcwNTYwMjEyMw@@._V1_SY180_CR8,0,120,180_.jpg'),
(102, 5, 'episode', 'Of Course', 2010, 17, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'After the guys discover that Robin deliberately got Barney hooked up with an incompatible female writer, they find out that that they didn''t realize that Robin hasn''t been handling their breakup very well.', '\n      Mar. 8, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTAwMDYyMzAwMV5BMl5BanBnXkFtZTcwODQzODIyMw@@._V1_SY180_CR0,0,120,180_.jpg'),
(103, 5, 'episode', 'Say Cheese', 2010, 18, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Ted angers Lily when he brings a random date to her birthday party, so she is forced to remind him of all the other random women he has brought along to important functions, only to discover that they weren''t "the one."', '\n      Mar. 22, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(104, 5, 'episode', 'Zoo or False', 2010, 19, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Marshall comes up with a number of different outrageous and embarrassing stories to explain how he was mugged in Central Park, but which of his stories is the truth?', '\n      Apr. 12, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ5NTcyMTAxNV5BMl5BanBnXkFtZTcwNDA0NjQzMw@@._V1_SY180_CR6,0,120,180_.jpg'),
(105, 5, 'episode', 'Home Wreckers', 2010, 20, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Ted reacts to his mom''s second wedding by making the capricious decision to buy his "dream house," while everyone tries to figure out whether Barney or Robin cried at the wedding.', '\n      Apr. 19, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI3NzAyMzg0OF5BMl5BanBnXkFtZTcwNjAwODYzMw@@._V1_SY180_CR75,0,120,180_.jpg'),
(106, 5, 'episode', 'Twin Beds', 2010, 21, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'As Robin contemplates moving in with her new boyfriend Don, Ted and Barney both decide that they want her back. Meanwhile, Marshall and Lily think they''ve revolutionized modern marriage when they begin sleeping in separate beds.', '\n      May 3, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU3MDU0MjA2NV5BMl5BanBnXkFtZTcwMTAyMTgzMw@@._V1_SY180_CR62,0,120,180_.jpg'),
(107, 5, 'episode', 'Robots Vs. Wrestlers', 2010, 22, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Barney is worried that the old gang is falling apart when Ted blows off a "Wrestlers vs. Robots" competition so that he can stay at a snobby party.', '\n      May 10, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ0NTA4MTE5OF5BMl5BanBnXkFtZTcwMTczOTU0Mw@@._V1_SY180_CR14,0,120,180_.jpg'),
(108, 5, 'episode', 'The Wedding Bride', 2010, 23, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Ted is livid when he discovers that the man Stella left Ted for at the altar wrote a blockbuster movie about the incident, and portrays Ted as the bumbling, mean-spirited bad guy.', '\n      May 17, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzMTYxMzUxOV5BMl5BanBnXkFtZTcwNjgzOTU0Mw@@._V1_SY180_CR81,0,120,180_.jpg'),
(109, 5, 'episode', 'Doppelgangers', 2010, 24, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Marshall and Lily think they''ve spotted Barney''s doppelganger, which means that they can start trying to have a baby, but it''s really Barney in disguise. Meanwhile, Ted goes blonde and Robin considers taking an anchor job in Chicago.', '\n      May 24, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI4MDk3MzcwMV5BMl5BanBnXkFtZTcwNzUwNDA1Mw@@._V1_SY180_CR71,0,120,180_.jpg'),
(110, 5, 'episode', 'Big Days', 2010, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'Ted musters up the courage to talk to a girl at the bar, but then discovers she''s there with one of his exes. Meanwhile, Lily is mad at Marshall because he told his dad they''re trying to have a baby, and Robin lets herself go.', '\n      Sep. 20, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMwMzk2Nzc4Ml5BMl5BanBnXkFtZTcwMzA0MjM4Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(111, 5, 'episode', 'Cleaning House', 2010, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'The gang accompanies Barney and his brother James after they find the man who may be Barney''s father, but it turns out to be James'' father instead.', '\n      Sep. 27, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2ODcxNjUwMV5BMl5BanBnXkFtZTcwOTc5NzM5Mw@@._V1_SY180_CR40,0,120,180_.jpg'),
(112, 5, 'episode', 'Unfinished', 2010, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'When Ted declines Barney''s offer to design the new GNB building, Barney ties to woo him by using all of his best womanizing tactics. Meanwhile, Robin is still not over her relationship with Don and drunk dials him.', '\n      Oct. 4, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(113, 5, 'episode', 'Subway Wars', 2010, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2010&ref_=tt_eps_yr_2010', 'The guys race each other, each using a different form of transportation, from the pub to a restaurant seven miles away because a friend claims that Woody Allen is there.', '\n      Oct. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA5NjYwMDIwMl5BMl5BanBnXkFtZTcwODY0Njc5Mw@@._V1_SY180_CR75,0,120,180_.jpg'),
