(155, 5, 'episode', 'The Three Days Rule', 2009, 21, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Ted gets around the three-day rule by texting a woman he just met, but he doesn''t realize that he''s actually texting Barney and Marshall.', '\n      Apr. 27, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(156, 5, 'episode', 'Right Place Right Time', 2009, 22, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Ted recounts the series of random events that lead up to the chance meeting with the woman who would eventually become his wife.', '\n      May 4, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(157, 5, 'episode', 'As Fast as She Can', 2009, 23, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Stella''s boyfriend Tony breaks up with her after having a conversation with Ted, prompting Stella to come back to Ted with a surprising request.', '\n      May 11, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDA3NDA2NTIyNV5BMl5BanBnXkFtZTcwMDAzNzQ1Mg@@._V1_SY180_CR80,0,120,180_.jpg'),
(158, 5, 'episode', 'The Leap', 2009, 24, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'While Ted struggles with an unorthodox architecture project, Robin finds out that Barney is in love with her, and Marshall threatens to take a long-considered leap from the roof to a neighboring building.', '\n      May 18, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5MTY5NDc4M15BMl5BanBnXkFtZTcwMDQ2NDY1Mg@@._V1_SY180_CR72,0,120,180_.jpg'),
(159, 5, 'episode', 'Definitions', 2009, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'As Ted begins his new career as a professor and is about to meet his future wife, Lily forces Barney and Robin to have "the talk" and define their new relationship.', '\n      Sep. 21, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTM2MTEyODU0OF5BMl5BanBnXkFtZTcwMTc3MzM4Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(160, 5, 'episode', 'Double Date', 2009, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Ted goes on a blind date with the same woman he went on a blind date with seven years ago, and Barney and Marshall find Lily''s stripper look-alike.', '\n      Sep. 28, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE0MTE5OTkxN15BMl5BanBnXkFtZTcwNzQzODY4Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(161, 5, 'episode', 'Robin 101', 2009, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'When Robin fears that Barney is cheating on her, she soon discovers that he is spending his evenings with Ted learning everything there is to know on how to date her', '\n      Oct. 5, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(162, 5, 'episode', 'The Sexless Innkeeper', 2009, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'When Lily and Marshall realize that Robin and Barney are the perfect double-date friends, they try too hard to impress and come on too strong. Meanwhile, Ted gets a new nickname from Barney after an unsuccessful hook-up.', '\n      Oct. 12, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(163, 5, 'episode', 'Duel Citizenship', 2009, 5, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Ever since Marshall and Lily got married, Ted feels that his "best bro" Marshall has turned from being a "me" to a "we". That''s why Ted is so excited when Marshall agrees to recreate one of their crazy college road trips to Chicago''s Gazola''s pizza joint, which is closing. But this trip is not quite what Ted was expecting as Marshall invites Lily. As Lily''s presence changes the nature of the road trip, Ted tries to regain what he wanted this trip to be. Meanwhile, Robin may be deported unless she becomes a US citizen. Robin, a patriotic Canadian, isn''t sure if she ...', '\n      Oct. 19, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzMzk1NTgwMl5BMl5BanBnXkFtZTcwMjA4NDE5Mg@@._V1_SY180_CR15,0,120,180_.jpg'),
(164, 5, 'episode', 'Bagpipes', 2009, 6, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Despite their best efforts to be the perfect couple, Barney''s know-it-all attitude gets him in trouble with Robin and they are forced to ask Marshall and Lily for relationship advice.', '\n      Nov. 2, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA5OTk5OTIzNl5BMl5BanBnXkFtZTcwMDc5NzU5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(165, 5, 'episode', 'The Rough Patch', 2009, 7, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'After Barney and Robin hit a rough patch in their relationship, Lily devises the perfect plan to break them up, calling in help from Robin''s famous friend, Alan Thicke.', '\n      Nov. 9, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4MzUwMDgxN15BMl5BanBnXkFtZTcwNDQ1MDg5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(166, 5, 'episode', 'The Playbook', 2009, 8, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'When Barney hooks up with a woman Lily had been saving for Ted, she gets revenge by stealing his "playbook," which contains all the moves he uses to pick up women. But will Barney have the last laugh?', '\n      Nov. 16, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc2OTQxMDM2OF5BMl5BanBnXkFtZTcwNTE5Njk5Mg@@._V1_SY180_CR0,0,120,180_.jpg'),
(167, 5, 'episode', 'Slapsgiving 2: Revenge of the Slap', 2009, 9, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Barney freaks out when Marshall bequeaths a "slap bet" slap to Ted and Robin. Meanwhile, Lily''s estranged father shows up for Thanksgiving.', '\n      Nov. 23, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTg5MzgzMjYwOF5BMl5BanBnXkFtZTcwMjI3MzEwMw@@._V1_SY180_CR4,0,120,180_.jpg'),
(168, 5, 'episode', 'The Window', 2009, 10, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Maggie a girl next door Ted has wanted to date for years has suddenly broken up with her latest boyfriend, giving him and many other guys a chance to score with her.', '\n      Dec. 7, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(169, 5, 'episode', 'Last Cigarette Ever', 2009, 11, 'http://www.imdb.com/title/tt0460649/episodes?year=2009&ref_=tt_eps_yr_2009', 'Although he vowed to Robin and Marshall that he would never tell them, Ted finally tells his kids that at one time both Robin and Marshall used to smoke. In 2009, they both felt like they had good reason to do so. Marshall, only an occasional smoker, always said that each cigarette was his last. But when his old boss, the meanest man nicknamed Artillery Arthur, became his new boss, he thought he was going to be fired - again. So when Marshall found out that Arthur was a smoker, Marshall used it as a bonding mechanism to keep his job. Robin, at the time anchoring the ...', '\n      Dec. 14, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(170, 5, 'episode', 'No Tomorrow', 2008, 12, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'On St-Patrick''s Day, Ted follows Barney to a bar to party like there''s no tomorrow, while Robin discovers something strange about Marshall and Lily''s new apartment.', '\n      Mar. 17, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(171, 5, 'episode', 'Ten Sessions', 2008, 13, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'As the search for Mrs. Right continues, Ted woos his dermatologist Stella -- but her receptionist, Abby, seems more interested in him.', '\n      Mar. 24, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(172, 5, 'episode', 'The Bracket', 2008, 14, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'One of Barney''s exes is sabotaging his love life, but he doesn''t know who. So he makes a NCAA Basketball Tournament-style bracket to figure out which women he wronged the worst.', '\n      Mar. 31, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(173, 5, 'episode', 'The Chain of Screaming', 2008, 15, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Marshall cries in front of his boss after he chews him out, and everybody gives Marshall their own unique advice on how to confront his boss about the situation.', '\n      Apr. 14, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(174, 5, 'episode', 'Sandcastles in the Sand', 2008, 16, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Robin gives romance a second try with an old boyfriend, only to have him break her heart...again.', '\n      Apr. 21, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(175, 5, 'episode', 'The Goat', 2008, 17, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Barney is upset because he violated his own "bro code" by sleeping with Robin. How will Ted react when he learns that Barney slept with his ex-girlfriend?', '\n      Apr. 28, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(176, 5, 'episode', 'Rebound Bro', 2008, 18, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Barney finds a new wingman to replace Ted, but he''s painfully shy and awkward around women. Meanwhile Ted discovers that his new girlfriend Stella hasn''t had sex in 5 years.', '\n      May 5, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(177, 5, 'episode', 'Everything Must Go', 2008, 19, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Barney helps Abby get back at Ted by staging a fake proposal, but Abby doesn''t realize that it''s fake. Lily decides to sell some of her paintings so that she and Marshall can pay for floor repairs at their new place.', '\n      May 12, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(178, 5, 'episode', 'Miracles', 2008, 20, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Ted breaks up with Stella but immediately wants to take it back after a life-changing experience. However, Stella doesn''t realize that he broke up with her. Meanwhile, Barney has a serious accident on his way to see Ted in the hospital.', '\n      May 19, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(179, 5, 'episode', 'Do I Know You?', 2008, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Ted and Stella get engaged, but Ted soon learns that he doesn''t know anything about her. Meanwhile, Barney confesses to Lily that he''s in love with Robin', '\n      Sep. 22, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAwOTg2NDM0NDBeQTJeQWpwZ15BbWU3MDM0ODM1OTE@._V1_SX120_CR0,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(180, 5, 'episode', 'The Best Burger in New York', 2008, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Marshall claims that he had the best hamburger in the world during his first week in New York City, but he forgot where the burger joint is located. The gang then hits the streets of Manhattan to help him find it.', '\n      Sep. 29, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAyMjYxMDA0N15BMl5BanBnXkFtZTcwOTE5MTY5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(181, 5, 'episode', 'I Heart NJ', 2008, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Ted does not want to move in with Stella because he hates New Jersey. Robin prematurely quits her TV job because she incorrectly thinks that she already has a new job.', '\n      Oct. 6, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDI5ODI3MDY2NF5BMl5BanBnXkFtZTcwNjk1Njc5MQ@@._V1_SY180_CR30,0,120,180_.jpg'),
(182, 5, 'episode', 'Intervention', 2008, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Ted, Robin, Marshall, and Lily all begin getting cold feet because of their imminent life changes, and Barney tries to prove that he can pick up a woman while posing as an 80-year-old man.', '\n      Oct. 13, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(183, 5, 'episode', 'Shelter Island', 2008, 5, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Ted and Stella move up their wedding date, but the wedding may not go off as planned after Ted breaks the "No Exes Rule" and invites Robin to come in from Japan for the wedding.', '\n      Oct. 20, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA1MTc3OTQxMV5BMl5BanBnXkFtZTcwMzk0OTk5MQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(184, 5, 'episode', 'Happily Ever After', 2008, 6, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'The gang tries to hide from Stella when they discover that they are eating at the same restaurant.', '\n      Nov. 3, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM5NTg0MDQ0M15BMl5BanBnXkFtZTcwNjIzMTIwMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(185, 5, 'episode', 'Not a Father''s Day', 2008, 7, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'While Barney celebrates a pregnancy false alarm, Marshall and Lily try to figure out if it''s time to have a baby.', '\n      Nov. 10, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(186, 5, 'episode', 'Woooo!', 2008, 8, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Lily is disappointed to discover that Robin is secretly a "Woooo! Girl," and Barney secretly sabotages Ted''s chance to get the contract to design a new bank skyscraper.', '\n      Nov. 17, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk4OTIzOTczOF5BMl5BanBnXkFtZTcwOTgwNDQwMg@@._V1_SY180_CR11,0,120,180_.jpg'),
(187, 5, 'episode', 'The Naked Man', 2008, 9, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'When the gang learns that a bold, desperation date move got Robin into bed, Ted and Barney decide to try it out for themselves.', '\n      Nov. 24, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTIyOTE3OTUxN15BMl5BanBnXkFtZTcwNzUyOTUwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(188, 5, 'episode', 'The Fight', 2008, 10, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'The guys get invited to fight alongside Doug the Bartender. However, the fight doesn''t go exactly how they imagined it to.', '\n      Dec. 8, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc0MzUyOTk0NF5BMl5BanBnXkFtZTcwNDA2OTUxMg@@._V1_SY180_CR84,0,120,180_.jpg'),
(189, 5, 'episode', 'Little Minnesota', 2008, 11, 'http://www.imdb.com/title/tt0460649/episodes?year=2008&ref_=tt_eps_yr_2008', 'Ted tries to keep his irresponsible sister from hooking up with Barney during her trip to New York, and Robin starts hanging out with Marshall at a bar for Minnesotans, not telling them that she''s really Canadian.', '\n      Dec. 15, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(190, 5, 'episode', 'First Time in New York', 2007, 12, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Robin tries to keep her younger sister from losing her virginity while on vacation in New York, which causes everyone to reminisce about their first times.', '\n      Jan. 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(191, 5, 'episode', 'Columns', 2007, 13, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Barney asks Lily to paint a nude picture of him after finding her painting of Marshall. And Ted can''t find an opportune time to fire his old boss, who now works for him but still keeps undermining his work.', '\n      Jan. 22, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(192, 5, 'episode', 'Monday Night Football', 2007, 14, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Everybody misses the Super Bowl because of a funeral. Therefore, they all try to go 24 hours without finding out who won so that they can watch the game together on Monday night.', '\n      Feb. 5, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(193, 5, 'episode', 'Lucky Penny', 2007, 15, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'When Ted misses his important business trip to Chicago, he tries to trace his steps back to the original incident that triggered the series of events that made him miss the flight.', '\n      Feb. 12, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(194, 5, 'episode', 'Stuff', 2007, 16, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted to gets rid of everything he received from other women at Robin''s request, but getting rid of the stuff Robin received from other men won''t be as easy. Meanwhile, Barney gets revenge on Lily for making him attend her terrible play.', '\n      Feb. 19, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(195, 5, 'episode', 'Arrivederci, Fiero', 2007, 17, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'When Marshall''s car doesn''t quite make it to 200,000 miles without dying completely, everybody reminisces about their greatest memories with the car.', '\n      Feb. 26, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(196, 5, 'episode', 'Moving Day', 2007, 18, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted and Robin decide to move in together, but nobody appears to be happy with the new living arrangements--especially Barney.', '\n      Mar. 19, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(197, 5, 'episode', 'Bachelor Party', 2007, 19, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted changes Barney''s bachelor party plans for Marshall at the last minute, so that it won''t just consist of gambling and cheap strippers. And Robin gets Lily an inappropriate shower party gift.', '\n      Apr. 9, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(198, 5, 'episode', 'Showdown', 2007, 20, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Barney becomes a contestant on "The Price Is Right" so that he can confront Bob Barker, because he is believes that the game show host is his biological father.', '\n      Apr. 20, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(199, 5, 'episode', 'Something Borrowed', 2007, 21, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Marshall and Lily''s wedding is destined to become a disaster, until fate intervenes and makes it perfect.', '\n      May 7, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(200, 5, 'episode', 'Something Blue', 2007, 22, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'As the happy couple celebrate their wedding, Ted and Robin tell Barney about the latest development of their relationship.', '\n      May 14, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(201, 5, 'episode', 'Wait for It', 2007, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted''s still not ready to date months after his breakup with Robin. But when Robin returns to New York with an exotic new boyfriend, he decides it''s time to finally do something adventurous.', '\n      Sep. 24, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(202, 5, 'episode', 'We''re Not from Here', 2007, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted and Barney pose as tourists to pick up on a couple of New York women, and Robin starts getting fed up with her new boyfriend.', '\n      Oct. 1, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(203, 5, 'episode', 'Third Wheel', 2007, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted has a chance for a threesome with two women, but Barney and Lily try to sabotage it. Meanwhile, Robin''s date also goes better than expected, if only she can find a razor.', '\n      Oct. 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(204, 5, 'episode', 'Little Boys', 2007, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Robin tries to date a guy with a child, even though she does not like or want children. Meanwhile, Ted finds it impossible to make it with a woman he knows that Barney slept with a year ago.', '\n      Oct. 15, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(205, 5, 'episode', 'How I Met Everyone Else', 2007, 5, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'While everyone meets Ted''s new crazy girlfriend, everyone recounts their stories of how they met everyone else. But the stories turn out to have several inconsistencies.', '\n      Oct. 22, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(206, 5, 'episode', 'I''m Not That Guy', 2007, 6, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Ted discovers that a porn star is using his name. Marshall is wined and dined by a firm that defends polluters, and Lily''s spending habits may force him to take the job.', '\n      Oct. 29, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(207, 5, 'episode', 'Dowisetrepla', 2007, 7, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Marshall and Lily decide to buy a new home, which forces Lily to finally confront Marshall about her credit card debt.', '\n      Nov. 5, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(208, 5, 'episode', 'Spoiler Alert', 2007, 8, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'The guys shatter Ted''s impressions of his new girlfriend by telling him she talks too much. Ted responds by turning the tables on his friends, and they react by pointing out Ted''s worst flaw.', '\n      Nov. 12, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(209, 5, 'episode', 'Slapsgiving', 2007, 9, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Marshall warns Barney that the third slap in their "slap bet" will be coming on Thanksgiving night. Meanwhile, Ted and Robin sleep together on the night before Thanksgiving.', '\n      Nov. 19, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(210, 5, 'episode', 'The Yips', 2007, 10, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Barney has trouble hitting on women at the Victoria''s Secret after party and so has to return to the woman who took his virginity.', '\n      Nov. 26, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(211, 5, 'episode', 'The Platinum Rule', 2007, 11, 'http://www.imdb.com/title/tt0460649/episodes?year=2007&ref_=tt_eps_yr_2007', 'Barney and the gang try to convince Ted not to date the doctor that is removing his tattoo by giving examples of the Platinum Rule.', '\n      Dec. 10, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(212, 5, 'episode', 'The Wedding', 2006, 12, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Ted is searching for a date for a wedding. He asks Robin to come with him to the wedding as his "date" and she says yes. Problems evolve when the bride-to-be Claudia tells him he didn''t check "plus one" on the reply card and forbids him to bring someone along to the wedding. Ted now has problems to tell Robin that she cannot come with him and asks the Stu, Claudia''s future husband, if he can bring a "date" and he says "yes". This leads to further problems.', '\n      Jan. 9, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(213, 5, 'episode', 'Drumroll, Please', 2006, 13, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Ted meets a beautiful woman named Victoria at Claudia''s and Stu''s wedding and they spend a great time together that night. Unfortunately, Ted and Victoria made a deal that they will never see each other again after that night and they do not exchange telephone numbers or anything else. The morning after the wedding party, Ted wants desperately to see the girl again. So he starts searching for her and asks anyone from the wedding who could have possibly know her, but she seems to be lost.', '\n      Jan. 23, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(214, 5, 'episode', 'Zip, Zip, Zip', 2006, 14, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Ted and Victoria had decided to wait for one month before sleeping together, but Victoria forgets that she''ll be out of town on that day. Meanwhile Marshall and Lily celebrate their nine year anniversary, and Barney and Robin have a bros night out.', '\n      Feb. 6, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(215, 5, 'episode', 'Game Night', 2006, 15, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'During a game night Robin gets to meet Victoria. What actually was planned to be a funny night turns quite serious when Barney''s former love Shannon gives an old tape to Lily which shows the "real" Barney. While watching the tape an embarrassed Barney storms off. When he returns, Barney tells a story from 1998, when he seems to have been a whole different person, and what made him the person he is today. To make Barney feel better, all others also tell their most embarrassing stories.', '\n      Feb. 27, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(216, 5, 'episode', 'Cupcake', 2006, 16, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Victoria is about to leave to go to Germany for two years for a donate fellowship. Ted doesn''t know if he should her ask to stay or if he should tell her to leave. Marshall needs a new suit and Barney helps him. Meanwhile, Robin and Victoria accompany Lily to a wedding dress fitting and also the girls talk about whether Victoria should leave Ted or not.', '\n      Mar. 6, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(217, 5, 'episode', 'Life Among the Gorillas', 2006, 17, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'After a month of long-distance-relationship with Victoria, she''s already sent Ted three care packages full of stuff he likes, but he hasn''t sent her any. Marshall works in Barney''s office and doesn''t like it all or the people he works with, but Barney talks him once again into keeping the job. Marshall decides that it must be easier to work in the office if he adapts to the people he is working with and gets some "get psyched" training from Barney.', '\n      Mar. 20, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(218, 5, 'episode', 'Nothing Good Happens After 2 AM', 2006, 18, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'After having quite a rough day and being a little drunk, Robin calls Ted in the middle of the night and asks him if he wants to come over to her place. Ted, of course, says that he will come. On his way to Robin''s apartment, Ted starts to ask himself if it is okay to go to Robin since he still has got his girlfriend Victoria and asks his friends for advice.', '\n      Apr. 10, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(219, 5, 'episode', 'Mary the Paralegal', 2006, 19, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Robin invites everybody to a banquet and Ted is insecure about bringing a date or not. Barney offers to hook him up with a prostitute while Robin brings a real date. Ted pretends to be cool with the fact that Robin has moved on, but Robin''s date is her sleazy colleague Sandy Rivers whom Ted and Marshall constantly make jokes about when watching him on TV. With all these people in the same room, the evening seems to be getting interesting.', '\n      Apr. 24, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(220, 5, 'episode', 'Best Prom Ever', 2006, 20, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Marshall and Lily finally have got the perfect place they always wanted to get married at. The only problematic thing about this is that the place is only available in two months. So, this means a lot of work for everybody. To listen to a band Marshall wants to play at the wedding, Lily,Barney and Robin sneak into a High School prom. While the other three are at the prom, Marshall and Ted, who had actually planned a "men''s night", are wrapping up wedding invitations until Lily wants Marshall to come to the prom too. Of course, Ted comes along too.', '\n      May 1, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(221, 5, 'episode', 'Milk', 2006, 21, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'It''s Ted''s 28th birthday and he still keeps looking for the perfect girl. Apparantly he is about to find her since the matchmaker he once hired to find him a partner has finally found the perfect match. When he is about to meet her, Lily calls him because she is in trouble. Marshall gets himself into an office war between Barney and some guy named "Clark Butterfield" in which the guys do all kinds of gross things to each other.', '\n      May 8, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(222, 5, 'episode', 'Come On', 2006, 22, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Ted makes a final attempt to win Robin''s heart. Marshall and Lily''s relationship is in jeopardy.', '\n      May 15, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(223, 5, 'episode', 'Where Were We?', 2006, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Marshall becomes predictably depressed and pathetic after the breakup. And it only gets worse when he discovers that Lily may be back in town.', '\n      Sep. 18, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(224, 5, 'episode', 'The Scorpion and the Toad', 2006, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Barney gets Marshall back out on the singles market, but Barney keeps taking all the prospects from him. And Ted''s convinced that Lily is back because she wants Marshall back, even though she says she''s never been better.', '\n      Sep. 25, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(225, 5, 'episode', 'Brunch', 2006, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Ted discovers that his parents are keeping a secret from him after his dad acts as Barney''s wingman, and Marshall and Lily intentionally try to get each other sexually aroused.', '\n      Oct. 1, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(226, 5, 'episode', 'Ted Mosby, Architect', 2006, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Barney tells Ted that single women like architects. But will Ted use this useful tidbit of information to cheat on Robin after they have their first fight?', '\n      Oct. 9, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(227, 5, 'episode', 'World''s Greatest Couple', 2006, 5, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Lily gets introduced to Barney''s bachelor pad when she needs a place to stay, and Marshall finds a unlikely new friend to join him for brunch, concerts and musicals.', '\n      Oct. 16, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(228, 5, 'episode', 'Aldrin Justice', 2006, 6, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Ted gets Lily a job at his firm, but she only makes trouble for Ted when he refuses to stand up to his boss. And Barney sleeps with Marshall''s law school professor to help his grades, but she''s less than impressed with his prowess.', '\n      Oct. 23, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(229, 5, 'episode', 'Swarley', 2006, 7, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'The guys tell Marshall to stay away from his new date because she has "crazy eyes," but she couldn''t be any crazier than Lily after she learns that Marshall''s going out on his first new date.', '\n      Nov. 6, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(230, 5, 'episode', 'Atlantic City', 2006, 8, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Marshall and Lily elope to Atlantic City, but they discover that getting married in Atlantic City isn''t as easy as getting married in Las Vegas', '\n      Nov. 13, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(231, 5, 'episode', 'Slap Bet', 2006, 9, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'The gang discovers that Robin''s been hiding a huge secret, but they have no idea what it is. Marshall thinks she is married, and Barney thinks she was a porn star.', '\n      Nov. 20, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(232, 5, 'episode', 'Single Stamina', 2006, 10, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Barney''s gay black brother is in town, but he doesn''t want to tell Barney that he''s getting married because he''ll be losing his only single sidekick.', '\n      Nov. 27, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(233, 5, 'episode', 'How Lily Stole Christmas', 2006, 11, 'http://www.imdb.com/title/tt0460649/episodes?year=2006&ref_=tt_eps_yr_2006', 'Lily takes away her Christmas display after she finds out that Ted called her a bad name while she was broken up with Marshall, and Barney is too sick for his Christmas plans.', '\n      Dec. 11, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(234, 5, 'episode', 'Tailgate', 2012, 13, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'After celebrating New Year''s Eve, Marshall visits his father''s graveside to carry on their tradition of tailgating. Meanwhile, Barney and Ted open a bar called "Puzzles," and Robin is forced to fill in for an inebriated news anchor.', '\n      Jan. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAwMjgwMjY4MV5BMl5BanBnXkFtZTcwMDYzODAyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(235, 5, 'episode', '46 Minutes', 2012, 14, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'While Marshall and Lily spend their first night in their new home after deciding to permanently move to Long Island, Barney takes over as group leader in Manhattan--both with disastrous results.', '\n      Jan. 16, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5MzM5NzU2M15BMl5BanBnXkFtZTcwNzMyMzYyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(236, 5, 'episode', 'The Burning Beekeeper', 2012, 15, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Lily and Marshall throw a housewarming party, where Ted nearly comes to blows with Marshall''s boss, and Barney hits on a crazy divorcee.', '\n      Feb. 6, 2012\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(237, 5, 'episode', 'The Drunk Train', 2012, 16, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Kevin proposes to Robin, but will he take it back when Robin tells him she can''t have children? Meanwhile, Barney and Ted try to score on the "drunk train" to Long Island, but something is surprisingly holding Barney back.', '\n      Feb. 13, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg3ODg0MDYyMl5BMl5BanBnXkFtZTcwNTUzNzkzNw@@._V1_SY180_CR67,0,120,180_.jpg'),
(238, 5, 'episode', 'No Pressure', 2012, 17, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'While Ted waits to find out whether Robin loves him back, he discovers that Marshall and Lily have been trying to influence him in opposite directions to win a bet. Meanwhile, Barney tries to find Marshall and Lily''s sex tape.', '\n      Feb. 20, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIwOTc2NzY4NV5BMl5BanBnXkFtZTcwNDM3MjM0Nw@@._V1_SY180_CR76,0,120,180_.jpg'),
(239, 5, 'episode', 'Karma', 2012, 18, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Barney gets played and heart-broken over a stripper named "Karma," Robin becomes bored with her life on Long Island with Marshall and Lily, while Ted searches for a hobby to fill the empty space in Robin''s old room.', '\n      Feb. 27, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDg0NDE3MDc5NV5BMl5BanBnXkFtZTcwMTUwNTY0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(240, 5, 'episode', 'The Broath', 2012, 19, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'The gang tries to break up Barney and Quinn after learning they plan on moving in together, leaving Robin and Ted to fight over who deserves to sublet her apartment.', '\n      Mar. 19, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE1MjMyMjg5NV5BMl5BanBnXkFtZTcwNzg2MzU1Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(241, 5, 'episode', 'Trilogy Time', 2012, 20, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'As Ted, Marshall, and Barney get together for their annual viewing of the original Star Wars trilogy, Ted begins to question if he will ever end up where he wants to be - especially now that Barney and Quinn are getting serious.', '\n      Apr. 9, 2012\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(242, 5, 'episode', 'Now We''re Even', 2012, 21, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Just as Ted starts to settle into his new apartment alone, Barney tries to entice him into going out every single night. Meanwhile, Lily has a naughty dream about someone other then Marshall, and Robin finally becomes a famous news anchor.', '\n      Apr. 16, 2012\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(243, 5, 'episode', 'Good Crazy', 2012, 22, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Barney tries to set Ted up on dates so that he can forget about Robin, while also plotting to get Quinn out of her stripping job. Meanwhile, Lily sends Marshall on a getaway so that he will stop stressing over the baby.', '\n      Apr. 30, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY3MDgxNTM4OV5BMl5BanBnXkFtZTcwMDgwMjM3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(244, 5, 'episode', 'The Magician''s Code: Part 1', 2012, 23, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Ted and Robin take care of Lily when she goes into labor because Marshall is drunk and stuck in Atlantic City with Barney.', '\n      May 14, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIxMDE2OTMwNF5BMl5BanBnXkFtZTcwNzcwMjM3Nw@@._V1_SY180_CR12,0,120,180_.jpg'),
(245, 5, 'episode', 'The Magician''s Code: Part 2', 2012, 24, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Ted makes a fateful phone call to his old girlfriend Victoria, Barney''s magic trick gets him in trouble with airport security just as he''s about to leave on a trip with Quinn, and Robin tries to take the perfect birth announcement photo.', '\n      May 14, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzk1NzY0MjI0Nl5BMl5BanBnXkFtZTcwNjYwMjM3Nw@@._V1_SY180_CR78,0,120,180_.jpg'),
(246, 5, 'episode', 'Farhampton', 2012, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Ted convinces Victoria to take a brief detour before they leave together after she leaves her fiancé at the altar, and Barney''s engagement to Quinn may be short-lived after she finds about his past relationship with Robin.', '\n      Sep. 24, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYzMDIyOTY0N15BMl5BanBnXkFtZTcwNzA0NDIzOA@@._V1_SY180_CR68,0,120,180_.jpg'),
(247, 5, 'episode', 'The Pre-Nup', 2012, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Barney''s ridiculous pre-nup that he asks Quinn to sign gives the other guys ideas of their own, but the women find a way to retaliate.', '\n      Oct. 1, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI4ODkxNzMxN15BMl5BanBnXkFtZTcwMTMwMzU1OA@@._V1_SY180_CR74,0,120,180_.jpg'),
(248, 5, 'episode', 'Nannies', 2012, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'When Lily and Marshall have trouble finding a nanny, they learn it''s because of an elaborate scheme Barney came up with to meet girls. Meanwhile, Robin and Ted butt heads over who has a more serious relationship.', '\n      Oct. 8, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgzNjU4MzYyOF5BMl5BanBnXkFtZTcwMDM1NTg1OA@@._V1_SY180_CR100,0,120,180_.jpg'),
(249, 5, 'episode', 'Who Wants to Be a Godparent', 2012, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'When Lily and Marshall can''t decide on godparents for Marvin, they put the gang to the test to see who would make the best one.', '\n      Oct. 15, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI1MTQ3MjU2OV5BMl5BanBnXkFtZTcwOTI1NTg1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(250, 5, 'episode', 'The Autumn of Breakups', 2012, 5, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'As the season of break-ups continues, Ted and Victoria must choose the next step in their long and complicated relationship. Meanwhile, Robin worries about Barney when he chooses a dog to be his wingman.', '\n      Nov. 5, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzc0NDY1NzMxNl5BMl5BanBnXkFtZTcwMDQxNDI2OA@@._V1_SY180_CR51,0,120,180_.jpg'),
(251, 5, 'episode', 'Splitsville', 2012, 6, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'When Robin is hesitant to break up with Nick, Barney takes matters into his own hands. Meanwhile, Lily and Marshall are desperate for some private time.', '\n      Nov. 12, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIyMDg3MDQ1N15BMl5BanBnXkFtZTcwNjMxNDI2OA@@._V1_SY180_CR50,0,120,180_.jpg'),
(252, 5, 'episode', 'The Stamp Tramp', 2012, 7, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Marshall gets in the doghouse at work after he recommends a friend for a job, Robin helps Barney find a new strip club, and Ted is embarrassed after watching his video diary from college.', '\n      Nov. 19, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwNzQ3MjAzMl5BMl5BanBnXkFtZTcwMzM5NzQ3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(253, 5, 'episode', 'Twelve Horny Women', 2012, 8, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'While Marshall faces the most important court case of his career against his new arch-nemesis, Brad Morris, the rest of the gang tries to figure out which one was the biggest bad-ass in their youth.', '\n      Nov. 26, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjQ1MTkwMDM3N15BMl5BanBnXkFtZTcwMzI5NzQ3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(254, 5, 'episode', 'Lobster Crawl', 2012, 9, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Robin has a plan to get Barney out of her system for good, Ted witnesses Marvin''s first crawl while babysitting for Marshall and Lily, and Barney has a new business idea after destroying a beloved tie.', '\n      Dec. 3, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI4MDI3Mjc1Ml5BMl5BanBnXkFtZTcwNzk1MzA4OA@@._V1_SY180_CR0,0,120,180_.jpg'),
(255, 5, 'episode', 'The Over-Correction', 2012, 10, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Robin tries to get Barney''s "Playbook" out of jealousy over his new girlfriend, Marshall catches his mom having sex with Lily''s dad, and Ted tries to get everything back that was borrowed from him and never returned.', '\n      Dec. 10, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ4OTUzMTEyNl5BMl5BanBnXkFtZTcwNjEyNjI4OA@@._V1_SX120_CR0,0,120,180_.jpg'),
(256, 5, 'episode', 'The Final Page: Part One', 2012, 11, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Ted wants to rub his new building in the face of an old professor, Barney is the victim of a lengthy jinx, Marshall and Lily run into an annoying old acquaintance, and Robin gets an opportunity to fire Patrice.', '\n      Dec. 17, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc1MjQ1MzExNF5BMl5BanBnXkFtZTcwMTk2OTM4OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(257, 5, 'episode', 'The Final Page: Part Two', 2012, 12, 'http://www.imdb.com/title/tt0460649/episodes?year=2012&ref_=tt_eps_yr_2012', 'Will Ted go to the opening of his new building with Robin as his date, or will he break his promise to Barney and tell her that Barney is proposing to Patrice? Meanwhile, Marshall and Lily have big plans for a rare night out.', '\n      Dec. 17, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc1MjQ1MzExNF5BMl5BanBnXkFtZTcwMTk2OTM4OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(258, 5, 'episode', 'Band or DJ?', 2013, 13, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Robin''s dad denies Barney permission to marry his daughter, Marshall and Lily deal with Marvin''s constipation, and why is Ted so dead-set against hiring a band for Barney and Robin''s wedding?', '\n      Jan. 14, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwMzI5NjI1MF5BMl5BanBnXkFtZTcwMjQ3NDA5OA@@._V1_SY180_CR74,0,120,180_.jpg'),
(259, 5, 'episode', 'Ring Up!', 2013, 14, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Barney convinces Ted to sleep with a 20 year old until Barney learns her identity, Robin discovers that her engagement ring makes her invisible, and a leather cuff improves Marshall and Lily''s love life.', '\n      Jan. 21, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDU0NzcwOTc5N15BMl5BanBnXkFtZTcwOTk0MjEwOQ@@._V1_SY180_CR81,0,120,180_.jpg'),
(260, 5, 'episode', 'P.S. I Love You', 2013, 15, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Robin''s past as a Canadian pop star is revisited when Barney uncovers the lost episode of a music documentary series in which she was featured as Robin Sparkles. Marshall and Lily have some concerns about Ted''s latest girlfriend.', '\n      Feb. 4, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjM0Njk0NzYyNV5BMl5BanBnXkFtZTcwNDk0MjEwOQ@@._V1_SY180_CR0,0,120,180_.jpg'),
(261, 5, 'episode', 'Bad Crazy', 2013, 16, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Ted''s attempt to break up with his crazy new girlfriend does not go as planned, and Robin''s fear of holding Marvin leads to an adventure with Mike Tyson.', '\n      Feb. 11, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(262, 5, 'episode', 'The Ashtray', 2013, 17, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'When Ted receives an unexpected call from The Captain, the gang reminisced about their last awkward encounter with him.', '\n      Feb. 18, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(263, 5, 'episode', 'Weekend at Barney''s', 2013, 18, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Barney is forced to break out "The Playbook" one final time to keep Ted from getting back together with Jeanette and taking her to his wedding, and Marshall embarrasses Lily at an art exhibition.', '\n      Feb. 25, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg5NTYwNjg1N15BMl5BanBnXkFtZTcwNzIzMTUxOQ@@._V1_SY180_CR73,0,120,180_.jpg'),
(264, 5, 'episode', 'The Fortress', 2013, 19, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'It''s weeks before Barney and Robin''s wedding, and one of the many things they still have to decide is where to live. The one thing Robin insists is that they don''t live at Barney''s apartment. So it goes on the market. However, Barney doesn''t want to sell it to just anyone, but someone who is worthy of what was and will always be in his heart his "Fortress of Barnitude". Robin has a slightly different idea, which isn''t as easy to achieve as she would like when she and others learn more and more about with what Barney has equipped his apartment. Meanwhile, Lily hasn''t ...', '\n      Mar. 18, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(265, 5, 'episode', 'The Time Travelers', 2013, 20, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Ted and Barney run into their future selves as they debate whether to go to "Wrestlers vs. Robots," while Robin and Marshall argue over who gets credit for a new drink at McLaren''s.', '\n      Mar. 25, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(266, 5, 'episode', 'Romeward Bound', 2013, 21, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', '"The Captain" offers Lily a job in Rome, but will she take it? Meanwhile, Ted won''t stop raving about the body of Barney and Robin''s wedding planner.', '\n      Apr. 15, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3MjAwMTU0Nl5BMl5BanBnXkFtZTcwODYxMDgzOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(267, 5, 'episode', 'The Bro Mitzvah', 2013, 22, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Ted and Marshall turn Barney''s bachelor party into the worst night of his life, or is that exactly what they want him to believe?', '\n      Apr. 29, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTEyNDA1MDg0NDheQTJeQWpwZ15BbWU3MDEwNzQzNDk@._V1_SY180_CR77,0,120,180_.jpg'),
(268, 5, 'episode', 'Something Old', 2013, 23, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Robin searches for a locket that she buried in Central Park for her wedding, Ted helps Marshall and Lily pack for Italy, and Barney plays laser tag with his future father in law.', '\n      May 6, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA4MTE0ODQ2NzleQTJeQWpwZ15BbWU3MDYwMjg2NDk@._V1_SY180_CR75,0,120,180_.jpg'),
(269, 5, 'episode', 'Something New', 2013, 24, 'http://www.imdb.com/title/tt0460649/episodes?year=2013&ref_=tt_eps_yr_2013', 'Robin and Barney are out for a special dinner at one of their favorite restaurants, where they want to recreate one of their favorite past experiences together. Their dinner is ruined by who they deem the most obnoxious couple they''ve ever met. As such, Robin and Barney''s mission changes to ruining not only that couple''s dinner, but their lives. Meanwhile, Marshall is in St. Cloud with Marvin to visit Judy, who has just learned that Marshall and Lily are moving to Rome. Judy threatens to do whatever subversive measure required to stop them from moving away. As Lily is...', '\n      May 13, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEzMzE4MDc0NF5BMl5BanBnXkFtZTcwOTE3NDM0OQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(270, 5, 'episode', 'Pilot', 2005, 1, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'It''s the year 2030 and an older Ted Mosby is telling the story to his son and daughter about how he met and will eventually marry their mother. This is where we meet for the first time Ted, Lily Marshall, Barney and Robin.', '\n      Sep. 19, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(271, 5, 'episode', 'Purple Giraffe', 2005, 2, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'After telling Robin that "He loves her", things fall apart for she and Ted and he figures that it''s all over for the two of them, but not for long as Ted finds out from Lily after she met Robin that she (Robin) likes him and Ted tries once again to win her affections, by throwing a party at his and Marshall''s place, but it turns into 3 parties in 3 nights, when Robin was a no show for the first 2. Meanwhile, after Lily said yes to Marshall''s marriage proposal, she has become extra affectionate to him in the bedroom and Marshall is worrying about finishing a huge paper...', '\n      Sep. 26, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(272, 5, 'episode', 'The Sweet Taste of Liberty', 2005, 3, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'Rather than go to McLaren''s, their usual hangout, Barney convinces Ted to go to the airport with him to "pick someone up". It turns out that they''re there to pick up some girls. While doing this, they fly to Philadelphia, get arrested by airport security and that''s when Ted starts to wonder why he ends up in these adventures with Barney. Meanwhile Marshall has studying to do, so Lily and Robin do a girls night out and Lily notices guys are buying drinks and try talking to Robin, so Lily starts to wonder what it would be like to have her engagement ring off, and with ...', '\n      Oct. 3, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(273, 5, 'episode', 'Return of the Shirt', 2005, 4, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'Ted dated a girl, Natalie, three years ago and quickly got annoyed by some of her antics. Therefore he broke up with her, leaving a message on her answering machine on her birthday. His blamed his behavior on his immaturity and after being forgiven by Natalie they end up getting back together. Robin meanwhile realizes that no one is interested in her show and plans to do or say crazy things which Barney dares her to.', '\n      Oct. 10, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(274, 5, 'episode', 'Okay Awesome', 2005, 5, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'Robin manages to get into OK, an ultra hip exclusive nightclub. Ted and Barney will be going with her, but not Marshall and Lily, as they have been doing a lot of "Classy grown-up things", as she referred it to and thinks it may be time for she and Marshall to grow up and put behind the things they used to do back in college. While at the club, Robin runs into problems as she cannot get into the VIP Room, then while outside trying to get it straightened out,a different front door bouncer will not let her in, even though she is on their list to get in, but her name is ...', '\n      Oct. 17, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(275, 5, 'episode', 'The Slutty Pumpkin', 2005, 6, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'On Halloween, Robin and her new boyfriend Mike meet for a Double Date with Lily and Marshall, who are eager to win the costume contest. Robin turns out as someone who is not so much into "couple things" so the dinner is not as pleasant as expected. Barney actually wants to take Ted with him to a Victoria Secret''s Party, but Ted heads for a party on the roof of his apartment house, where he a few years ago met a beautiful woman, which is just called the "slutty pumpkin". Eager to meet her again, because he never had the change to call her because he lost her number, he...', '\n      Oct. 24, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(276, 5, 'episode', 'Matchmaker', 2005, 7, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'Barney takes Ted to matchmaker Ellen Pierce, but while Barney gets thrown out, Ellen promises to find a woman for Ted within three days. This promise has disastrous results: the woman that suits him the best has already a boyfriend. Lily and Marshall have problems with some sort of cockroach or mouse that is in the apartment and they cannot get rid of.', '\n      Nov. 7, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(277, 5, 'episode', 'The Duel', 2005, 8, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'Lily moves in with Ted and Marshall and although it was Ted''s idea to ask Lily to move in, he starts to worry that the apartment changes too much with Lily there. Another issue for Ted is who will keep the apartment after Lily and Marshall got married. In the end, a real fight starts between Ted and Marshall over the apartment.', '\n      Nov. 14, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(278, 5, 'episode', 'Belly Full of Turkey', 2005, 9, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'It''s Thanksgiving and while Lily and Marshall visit his family in Minnesota, Robin and Ted want to volunteer at a homeless shelter kitchen. Surprisingly, Robin and Ted meet Barney at the kitchen, who has been doing volunteer work for the past few years. At the kitchen, Ted meets Amanda, who seems to be a quite nice girl until everything turns out to be different. Lily has some issues with Marshall''s family and is unsure about how her future with Marshall will look like.', '\n      Nov. 21, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(279, 5, 'episode', 'The Pineapple Incident', 2005, 10, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'In 2030, Ted admits to his kids that he doesn''t remember all the stories from his past, with what he and Marshall call "the pineapple incident" being one of the more fuzzier ones. In late 2005, in the still short time their group of friends has included Robin, she is onto yet another guy (this time a multi-multi-millionaire) while Ted has barely had any women. Barney thinks it''s because Ted over-analyzes every situation. So to lower Ted''s inhibitions, Barney, Marshall and Lily think it would do Ted some good if he downed all five shots that Carl the bartender has ...', '\n      Nov. 28, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(280, 5, 'episode', 'The Limo', 2005, 11, 'http://www.imdb.com/title/tt0460649/episodes?year=2005&ref_=tt_eps_yr_2005', 'It''s New Year''s Eve 2005 and Ted spends a large portion of his Christmas bonus for a limo for he and the gang. In addition, he has outlined a plan how they will ring in the New Year. Unfoirtunatley, things don''t always go as planned.', '\n      Dec. 19, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(281, 4, 'episode', 'The Bad Fish Paradigm', 2, 1, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'Leonard is concerned when his date with Penny ends abruptly and she starts blowing him off. When told the truth, Sheldon would rather move out than keep Penny''s reasons a secret from Leonard.', '\n      Sep. 22, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAxNzM5MDk2MV5BMl5BanBnXkFtZTcwMjE4MzU5MQ@@._V1_SY180_CR26,0,120,180_.jpg'),
(282, 4, 'episode', 'The Codpiece Topology', 2, 2, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'After seeing Penny with her new boyfriend, Leonard turns to Leslie for comfort. The move angers Sheldon, who considers Leslie his comic book-style "arch enemy."', '\n      Sep. 29, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcyNDMwNTIzOF5BMl5BanBnXkFtZTcwMzk3MzU5MQ@@._V1_SY180_CR36,0,120,180_.jpg'),
(283, 4, 'episode', 'The Barbarian Sublimation', 2, 3, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'Sheldon turns Penny on to online gaming, and then she refuses to turn it off after becoming addicted.', '\n      Oct. 6, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(284, 4, 'episode', 'The Griffin Equivalency', 2, 4, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'After being featured in a People magazine article, Raj becomes full of himself and alienates his friends. However, his newfound fame does get him a date with Penny.', '\n      Oct. 13, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(285, 4, 'episode', 'The Euclid Alternative', 2, 5, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'The gang tries to teach Sheldon how to drive.', '\n      Oct. 20, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(286, 4, 'episode', 'The Cooper-Nowitzki Theorem', 2, 6, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'Sheldon becomes cozy with a female graduate student who is infatuated with him, but nobody can figure out whether they''re in a relationship--including Sheldon.', '\n      Nov. 3, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk3NTczNTE3MF5BMl5BanBnXkFtZTcwNDEzMTIwMg@@._V1_SY180_CR0,0,120,180_.jpg'),
(287, 4, 'episode', 'The Panty Piñata Polarization', 2, 7, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'Penny plans revenge when Sheldon bans her from the guys'' apartment, while Howard and Rajesh use the latest technology to try to find the house being used in "America''s Next Top Model."', '\n      Nov. 10, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMyMjQzMjYzM15BMl5BanBnXkFtZTcwMDkxMjMwMg@@._V1_SY180_CR47,0,120,180_.jpg'),
(288, 4, 'episode', 'The Lizard-Spock Expansion', 2, 8, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'Howard and Leonard''s friendship could be at an end when Leonard steals Howard''s new woman from him.', '\n      Nov. 17, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg4MjU5MDc5MF5BMl5BanBnXkFtZTcwNDcwNDQwMg@@._V1_SY180_CR0,0,120,180_.jpg'),
(289, 4, 'episode', 'The White Asparagus Triangulation', 2, 9, 'http://www.imdb.com/title/tt0898266/episodes?season=2&ref_=tt_eps_sn_2', 'Sheldon tries to help move Leonard''s new relationship along, because his track record with women has been less than successful. But will he cause more trouble than good?', '\n      Nov. 24, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
