(381, 4, 'episode', 'The Love Car Displacement', 4, 13, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Tension runs high as the entire gang spends the weekend together at a science convention.', '\n      Jan. 20, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg4MzU4OTYzNl5BMl5BanBnXkFtZTcwMzYxMzYzNA@@._V1_SY180_CR52,0,120,180_.jpg'),
(382, 4, 'episode', 'The Thespian Catalyst', 4, 14, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'To improve his skills as an instructor, Sheldon asks Penny to give him acting lessons. Meanwhile, Raj begins having impure fantasies about Bernadette.', '\n      Feb. 3, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3NzgyMDkzMF5BMl5BanBnXkFtZTcwNjIzMjI0NA@@._V1_SY180_CR57,0,120,180_.jpg'),
(383, 4, 'episode', 'The Benefactor Factor', 4, 15, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'To secure needed funding for their school, Sheldon convinces Leonard to get friendly with a wealthy benefactor.', '\n      Feb. 10, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(384, 4, 'episode', 'The Cohabitation Formulation', 4, 16, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Bernadette makes Howard choose between herself and his mother, and how will Penny react when Leonard begins seeing Raj''s sister again when she''s back in town?', '\n      Feb. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc0OTY1Mjc2Ml5BMl5BanBnXkFtZTcwNjI5Nzk0NA@@._V1_SY180_CR4,0,120,180_.jpg'),
(385, 4, 'episode', 'The Toast Derivation', 4, 17, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Sheldon becomes concerned when everybody begins to hang out at Raj''s apartment and discovers Leonard is the center of the group.', '\n      Feb. 24, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTI0MTQ1MjI0M15BMl5BanBnXkFtZTcwNTk5MTQ1NA@@._V1_SY180_CR97,0,120,180_.jpg'),
(386, 4, 'episode', 'The Prestidigitation Approximation', 4, 18, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Priya forces Leonard to choose between a relationship with her or a friendship with Penny. A magic trick by Howard has Sheldon fooled.', '\n      Mar. 10, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BODE0NTIwMzA0MF5BMl5BanBnXkFtZTcwNzEyOTY2NA@@._V1_SY180_CR76,0,120,180_.jpg'),
(387, 4, 'episode', 'The Zarnecki Incursion', 4, 19, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'The gang goes all out to help Sheldon find the person responsible for hacking his online gaming account, but Priya is beginning to get fed up with Leonard''s childish behavior.', '\n      Mar. 31, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk5ODE0NjMzN15BMl5BanBnXkFtZTcwNTM2MTQ4NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(388, 4, 'episode', 'The Herb Garden Germination', 4, 20, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Sheldon and Amy secretly experiment on the gang by spreading rumors. Howard and Bernadette''s relationship reaches an important milestone.', '\n      Apr. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAxOTIwMTkwNV5BMl5BanBnXkFtZTcwNTU1NDg4NA@@._V1_SY180_CR63,0,120,180_.jpg'),
(389, 4, 'episode', 'The Agreement Dissection', 4, 21, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'When Priya finds a loophole in the roommate agreement to throw Sheldon out for the night, Penny, Amy, and Bernadette take Sheldon to a nightclub.', '\n      Apr. 28, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI4ODMxOTY5NV5BMl5BanBnXkFtZTcwNTcxNzkwNQ@@._V1_SY180_CR0,0,120,180_.jpg'),
(390, 4, 'episode', 'The Wildebeest Implementation', 4, 22, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'While Sheldon invents a three-player chess game, Bernadette uses a double date to spy on Leonard and Priya''s relationship, and Raj tries a new drug to treat his social anxiety.', '\n      May 5, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkxNDg1MTg0M15BMl5BanBnXkFtZTcwNzc3NDcxNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(391, 4, 'episode', 'The Engagement Reaction', 4, 23, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Howard believes that his mom suffered a heart attack because he told her that he''s marrying Bernadette, and Sheldon freaks out over germs after he accidentally drinks Leonard''s water.', '\n      May 12, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(392, 4, 'episode', 'The Roommate Transmogrification', 4, 24, 'http://www.imdb.com/title/tt0898266/episodes?season=4&ref_=tt_eps_sn_4', 'Raj moves in with Sheldon after hearing Leonard and Priya engage in a Star Trek fantasy in his apartment. Bernadette receives her doctorate, and the gang teases Howard about not having one.', '\n      May 19, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM5MDM1MTUxNl5BMl5BanBnXkFtZTcwOTk2NTIzNQ@@._V1_SY180_CR3,0,120,180_.jpg'),
(393, 4, 'episode', 'The Skank Reflex Analysis', 5, 1, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'The gang deals with the fallout from Penny and Raj''s night together. Amy counsels Penny when she considers moving back to Nebraska due to her failing acting career. Sheldon takes charge of the paintball team.', '\n      Sep. 22, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAzNjA4MjQ4OF5BMl5BanBnXkFtZTcwMjEyOTYzNg@@._V1_SY180_CR60,0,120,180_.jpg'),
(394, 4, 'episode', 'The Infestation Hypothesis', 5, 2, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon has health issues with Penny''s new chair. Amy gets inadvertently caught in the middle of a fight between Sheldon and Penny. Leonard tries to add some spice to his long-distance relationship with Priya.', '\n      Sep. 22, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg1MjAzNzc3Nl5BMl5BanBnXkFtZTcwNDQzNjc3Ng@@._V1_SY180_CR75,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(395, 4, 'episode', 'The Pulled Groin Extrapolation', 5, 3, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'While Sheldon stays at home to play with his new train set, Leonard and Amy learn a lot about each other when he goes as her "plus one" to a wedding. Howard and Bernadette spend the weekend with his mother.', '\n      Sep. 29, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA4NjM2NzA4M15BMl5BanBnXkFtZTcwNDMzNjc3Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(396, 4, 'episode', 'The Wiggly Finger Catalyst', 5, 4, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Penny sets up Raj with a deaf friend, not knowing that she''s actually a gold digger, and Sheldon decides to let his minor decisions rest on the roll of the dice.', '\n      Oct. 6, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4NDcyNTQ3MF5BMl5BanBnXkFtZTcwMjg3NDg4Ng@@._V1_SY180_CR0,0,120,180_.jpg'),
(397, 4, 'episode', 'The Russian Rocket Reaction', 5, 5, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon takes offense when Leonard wants to attend a party with Star Trek''s Wil Wheaton and Brent Spiner, and Bernadette tries to block Howard''s opportunity to go into outer space.', '\n      Oct. 13, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(398, 4, 'episode', 'The Rhinitis Revelation', 5, 6, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon is upset when his mom comes to visit but refuses to cook for him and attend physics lectures.', '\n      Oct. 20, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIxNzUwMDUyMV5BMl5BanBnXkFtZTcwNTQ3MDQ5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(399, 4, 'episode', 'The Good Guy Fluctuation', 5, 7, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon tries to get into the spirit of Halloween by trying to scare the guys after they prank him. A comic book artist is interested in Leonard.', '\n      Oct. 27, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIwMjE0Mzc5N15BMl5BanBnXkFtZTcwOTAxMDc5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(400, 4, 'episode', 'The Isolation Permutation', 5, 8, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Amy is hurt when Bernadette and Penny goes bridesmaid dress shopping without her, so she turns to a reluctant Sheldon for comfort.', '\n      Nov. 3, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg3OTkwNjMzM15BMl5BanBnXkFtZTcwMDY1NzAwNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(401, 4, 'episode', 'The Ornithophobia Diffusion', 5, 9, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon must overcome his fear of birds while Leonard and Penny attempt to hang out together strictly as friends.', '\n      Nov. 10, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkyNDc0MjM0M15BMl5BanBnXkFtZTcwNTM4NTMwNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(402, 4, 'episode', 'The Flaming Spittoon Acquisition', 5, 10, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'When Stuart from the comic book store asks Amy on a date, Sheldon considers having a more serious relationship with her. Meanwhile, the guys become obsessed with a new card game involving Wild West heroes and witches.', '\n      Nov. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg1MjY5NTI5MF5BMl5BanBnXkFtZTcwNjM4NTMwNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(403, 4, 'episode', 'The Speckerman Recurrence', 5, 11, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Leonard must confront the man who bullied him in high school, while Penny realizes she did her fair share of tormenting in the past.', '\n      Dec. 8, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU3NzI1MzE1NF5BMl5BanBnXkFtZTcwOTg2MTMxNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(404, 4, 'episode', 'The Shiny Trinket Maneuver', 5, 12, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Penny must help Sheldon work on his relationship with Amy when he trivializes one of her accomplishments. Bernadette''s dislike of children bothers Howard.', '\n      Jan. 12, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BODYxODc5MjY5M15BMl5BanBnXkFtZTcwMDc2NjUyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(405, 4, 'episode', 'The Recombination Hypothesis', 5, 13, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Leonard and Penny contemplate reviving their romantic relationship. Sheldon''s attempt to order Star Trek memorabilia doesn''t go as planned.', '\n      Jan. 19, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIxNTQ4Mzc5MF5BMl5BanBnXkFtZTcwNjAzNzgyNw@@._V1_SY180_CR0,0,120,180_.jpg'),
(406, 4, 'episode', 'The Beta Test Initiation', 5, 14, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Leonard and Penny develop a system to insure their dates go smoothly. Raj finally finds a woman he can talk to - the virtual assistant on his mobile phone.', '\n      Jan. 26, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM2NTYwMTQ3N15BMl5BanBnXkFtZTcwMDk2MDIzNw@@._V1_SY180_CR0,0,120,180_.jpg'),
(407, 4, 'episode', 'The Friendship Contraction', 5, 15, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Leonard signs out of his roommate agreement, reducing himself and Sheldon to mere acquaintances, while Howard tries to think of a cool astronaut nickname for himself.', '\n      Feb. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDEwMzI5NjQ0Ml5BMl5BanBnXkFtZTcwOTY0MDUzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(408, 4, 'episode', 'The Vacation Solution', 5, 16, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'When the university forces Sheldon to use vacation days, he decides to hang out in Amy''s lab. Bernadette wants Howard to sign a prenuptial agreement.', '\n      Feb. 9, 2012\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(409, 4, 'episode', 'The Rothman Disintegration', 5, 17, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon battles Barry Kripke for a coveted office at the university. Penny receives a very unusual gift from Amy.', '\n      Feb. 16, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3ODMyMzQ3N15BMl5BanBnXkFtZTcwOTQ2MTE0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(410, 4, 'episode', 'The Werewolf Transformation', 5, 18, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon wreaks havoc when he tries to get a haircut from his regular barber, who is ill. Howard runs into a few problems with astronaut training.', '\n      Feb. 23, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQxMjM2NjAyM15BMl5BanBnXkFtZTcwNjk2MjQ0Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
(411, 4, 'episode', 'The Weekend Vortex', 5, 19, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon must choose between joining Amy at her aunt''s birthday party or playing videogames all weekend with the guys.', '\n      Mar. 8, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzOTM3OTE3OV5BMl5BanBnXkFtZTcwMDEzMzA1Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(412, 4, 'episode', 'The Transporter Malfunction', 5, 20, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Raj gets quite a surprise when he asks his parents to set him up on a date. Penny buys Leonard and Sheldon a pair of Star Trek keepsake collectibles, not knowing the effect it would have on Sheldon.', '\n      Mar. 29, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM2ODk4ODMwM15BMl5BanBnXkFtZTcwMDI3MDE2Nw@@._V1_SY180_CR0,0,120,180_.jpg'),
(413, 4, 'episode', 'The Hawking Excitation', 5, 21, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Sheldon uses any and all means to meet his hero, Dr. Stephen Hawking.', '\n      Apr. 5, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE5MDA4NDA2NF5BMl5BanBnXkFtZTcwODA1NTM2Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(414, 4, 'episode', 'The Stag Convergence', 5, 22, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'The guys throw Howard a bachelor party, and some embarrassing details about his life get posted on the Internet.', '\n      Apr. 26, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkxMzA4MzU1MV5BMl5BanBnXkFtZTcwMTM1NzE3Nw@@._V1_SY180_CR6,0,120,180_.jpg'),
(415, 4, 'episode', 'The Launch Acceleration', 5, 23, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'Howard faces double trouble when NASA moves up his launch and he has to meet Bernadette''s father. Some awkward pillow talk by Leonard may change his relationship with Penny.', '\n      May 3, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM4NTYxNDYxMV5BMl5BanBnXkFtZTcwMzY5MTI3Nw@@._V1_SY180_CR53,0,120,180_.jpg'),
(416, 4, 'episode', 'The Countdown Reflection', 5, 24, 'http://www.imdb.com/title/tt0898266/episodes?season=5&ref_=tt_eps_sn_5', 'The gang scrambles to provide Howard and Bernadette a wedding before Howard''s mission into space.', '\n      May 10, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1OTQwOTMyNF5BMl5BanBnXkFtZTcwMTE0ODQ3Nw@@._V1_SY180_CR74,0,120,180_.jpg'),
(417, 0, 'episode', 'The North Remembers', 2, 1, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Tyrion arrives at Kings Landing to take his father''s place as Hand of the King. Stannis Baratheon plans to take the Iron Throne for his own. Robb tries to decide his next move in the war. The Night''s Watch arrive at the house of Craster.', '\n      Apr. 1, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNzc4NDQ5MzA1N15BMl5BanBnXkFtZTcwMDQwNTgzNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(418, 0, 'episode', 'The Night Lands', 2, 2, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Arya makes friends with Gendry. Tyrion tries to take control of the small council. Theon arrives at his home, Pyke, in order to persuade his father into helping Robb with the war. Jon tries to investigate Craster''s secret.', '\n      Apr. 8, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUxNjkwODczN15BMl5BanBnXkFtZTcwODMwNTgzNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(419, 0, 'episode', 'What Is Dead May Never Die', 2, 3, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Tyrion tries to see who he can trust in the small council. Catelyn visits Renly to try and persuade him to join Robb in the war. Theon must decide if his loyalties lie with his own family or with Robb.', '\n      Apr. 15, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc3MDQwOTI5OV5BMl5BanBnXkFtZTcwNTY5NDgzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(420, 0, 'episode', 'Garden of Bones', 2, 4, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Lord Baelish arrives at Renly''s camp just before he faces off against Stannis. Daenerys and her company are welcomed into the city of Qarth. Arya, Gendry, and Hot Pie find themselves imprisoned at Harrenhal.', '\n      Apr. 22, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTczMjc5MTY0NF5BMl5BanBnXkFtZTcwMDY5NDgzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(421, 0, 'episode', 'The Ghost of Harrenhal', 2, 5, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Renly is dead, and his army has merged with Stannis. Tyrion investigates a secret weapon that King Joffery plans to use against Stannis. Meanwhile, as a token for saving his life, Jaqen H''ghar offers to kill three people that Arya chooses.', '\n      Apr. 29, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTExNzU3NDM3NDleQTJeQWpwZ15BbWU3MDE0MDU4Mzc@._V1_SY180_CR75,0,120,180_.jpg'),
(422, 0, 'episode', 'The Old Gods and the New', 2, 6, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Theon seizes control of Winterfell. Jon captures a wildling, named Ygritte. The people of King''s Landing begin to turn against King Joffery. Daenerys looks to buy ships to sail for the Seven Kingdoms.', '\n      May 6, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY1NjUxMTY1MV5BMl5BanBnXkFtZTcwODU4MTc3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(423, 0, 'episode', 'A Man Without Honor', 2, 7, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Bran and Rickon have escaped Winterfell. Theon tries to hunt them down. Daenerys'' dragons have been stolen. Jon travels through the wilderness with Ygritte as his prisoner. Sansa has bled and is now ready to have Joffery''s children.', '\n      May 13, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU1MTc3MjM1N15BMl5BanBnXkFtZTcwMDIyNjA4Nw@@._V1_SY180_CR66,0,120,180_.jpg'),
(424, 0, 'episode', 'The Prince of Winterfell', 2, 8, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Stannis is just days from King''s Landing. Tyrion prepares for his arrival. Jon and Qhorin are taken prisoner by the wildlings. Catelyn is arrested for releasing Jamie. Arya, Gendry, and Hot Pie plan to escape from Harrenhal.', '\n      May 20, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc2ODYwNjUwNl5BMl5BanBnXkFtZTcwMTY2NDg1Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(425, 0, 'episode', 'Blackwater', 2, 9, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Stannis has arrived at King''s Landing. The battle has come!', '\n      May 27, 2012\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(426, 0, 'episode', 'Valar Morghulis', 2, 10, 'http://www.imdb.com/title/tt0944947/episodes?season=2&ref_=tt_eps_sn_2', 'Joffery names Tywin the new Hand of the King. Robb marries Talisa Maegyr. Jon prepares to meet Mance Rayder. Arya says farewell to Jaqen H''ghar. Daenerys tries to rescue her dragons.', '\n      Jun. 3, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUxMzI1MjgxMF5BMl5BanBnXkFtZTcwNDQ1Mjg4Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
