(431, 0, 'episode', 'Kissed by Fire', 3, 5, 'http://www.imdb.com/title/tt0944947/episodes?season=3&ref_=tt_eps_sn_3', 'Robb''s army is falling apart. Jamie reveals a story, to Brienne, that he has never told anyone. Jon breaks his vows. The Hound is granted his freedom. The Lannisters hatch a new plan.', '\n      Apr. 28, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BNzg2NTA2MTU4OF5BMl5BanBnXkFtZTcwMDkxNTcyOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
