(437, 0, 'episode', 'Winter Is Coming', 1, 1, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'Jon Arryn, the Hand of the King, is dead. King Robert Baratheon plans to ask his oldest friend, Eddard Stark, to take Jon''s place. Across the sea, Viserys Targaryen plans to wed his sister to a nomadic warlord in exchange for an army.', '\n      Apr. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk5MDU3OTkzMF5BMl5BanBnXkFtZTcwOTc0ODg5NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(438, 0, 'episode', 'The Kingsroad', 1, 2, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'While Bran recovers from his fall, Ned takes only his daughters to Kings Landing. Jon Snow goes with his uncle Benjen to The Wall. Tyrion joins them.', '\n      Apr. 24, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM5NTk4MTk4N15BMl5BanBnXkFtZTcwNTk0ODg5NA@@._V1_SX120_CR0,0,120,180_.jpg'),
