(441, 0, 'episode', 'The Wolf and the Lion', 1, 5, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'Catelyn has captured Tyrion and plans to bring him to her sister, Lysa Arryn, at The Vale, to be tried for his, supposed, crimes against Bran. Robert plans to have Daenerys killed, but Eddard refuses to be a part of it and quits.', '\n      May 15, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg4NjU0NjMzMV5BMl5BanBnXkFtZTcwMTczMDYyNQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(442, 0, 'episode', 'A Golden Crown', 1, 6, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'While recovering from his battle with Jamie, Eddard is forced to run the kingdom while Robert goes hunting. Tyrion demands a trial by combat for his freedom. Viserys is losing his patience with Drogo.', '\n      May 22, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDYyNTQ0OTQ3MV5BMl5BanBnXkFtZTcwMjYyNjIzNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(443, 0, 'episode', 'You Win or You Die', 1, 7, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'Robert has been injured while hunting and is dying. Jon and the others finally take their vows to the Night''s Watch. A man, sent by Robert, is captured for trying to poison Daenerys. Furious, Drogo vows to attack the Seven Kingdoms.', '\n      May 29, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcwODk4NzUxNV5BMl5BanBnXkFtZTcwNzc0NTM0NQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(444, 0, 'episode', 'The Pointy End', 1, 8, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'Eddard and his men are betrayed and captured by the Lannisters. When word reaches Robb, he plans to go to war to rescue them. The White Walkers attack The Wall. Tyrion returns to his father with some new friends.', '\n      Jun. 5, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM4NTA5NzEwMV5BMl5BanBnXkFtZTcwMDI4ODI2NQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(445, 0, 'episode', 'Baelor', 1, 9, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'Robb goes to war against the Lannisters. Jon finds himself struggling on deciding if his place is with Robb or the Night''s Watch. Drogo has fallen ill from a fresh battle wound. Daenerys is desperate to save him.', '\n      Jun. 12, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTczMDc2ODM1MV5BMl5BanBnXkFtZTcwODE4ODI2NQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(446, 0, 'episode', 'Fire and Blood', 1, 10, 'http://www.imdb.com/title/tt0944947/episodes?season=1&ref_=tt_eps_sn_1', 'With Ned dead, Robb vows to get revenge on the Lannnisters. Jon must officially decide if his place is with Robb or the Night''s Watch. Daenerys says her final goodbye to Drogo.', '\n      Jun. 19, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BODk1NjIzNjczMl5BMl5BanBnXkFtZTcwODU1MTc2NQ@@._V1_SY180_CR75,0,120,180_.jpg'),
