(449, 3, 'episode', 'Days Gone Bye', 2010, 1, 'http://www.imdb.com/title/tt1520211/episodes?year=2010&ref_=tt_eps_yr_2010', 'Deputy Sheriff Rick Grimes wakes up in the hospital, after being shot, to find his town overrun by flesh-eating zombies. After making friends with survivor Morgan Jones and his son Duane, Rick sets out to find his wife and son.', '\n      Oct. 31, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM5NDkxNDM0Nl5BMl5BanBnXkFtZTcwNDI3MDQwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(450, 3, 'episode', 'Guts', 2010, 2, 'http://www.imdb.com/title/tt1520211/episodes?year=2010&ref_=tt_eps_yr_2010', 'Rick finds himself trapped, with other survivors, inside a department store, surrounded by zombies.', '\n      Nov. 7, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI3NDg4MDAzMF5BMl5BanBnXkFtZTcwMjA3MDQwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(451, 3, 'episode', 'Tell It to the Frogs', 2010, 3, 'http://www.imdb.com/title/tt1520211/episodes?year=2010&ref_=tt_eps_yr_2010', 'Rick is reunited with Lori and Carl, but soon decides - along with some of the other survivors - to return to the rooftop and rescue Merle. Back at camp, tensions run high between the other survivors.', '\n      Nov. 14, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDI3OTYzMDYyNV5BMl5BanBnXkFtZTcwMTI1NzkwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(452, 3, 'episode', 'Vatos', 2010, 4, 'http://www.imdb.com/title/tt1520211/episodes?year=2010&ref_=tt_eps_yr_2010', 'While searching for Merle, Rick and the others come across another group of - seemingly hostile - survivors. Meanwhile, back at camp, Jim is deeply disturbed by a dream he cannot fully remember, a dream which may turn out to be prophetic.', '\n      Nov. 21, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc0ODI2MjY4OV5BMl5BanBnXkFtZTcwMTA5MjIxNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(453, 3, 'episode', 'Wildfire', 2010, 5, 'http://www.imdb.com/title/tt1520211/episodes?year=2010&ref_=tt_eps_yr_2010', 'Rick tries to make contact with Morgan to tell him his location. Back at camp, after the fight with the zombies, Jim has been bitten and is slowly beginning to change; Andrea mourns over Amy''s death; and Shane blames it all on Rick for leaving. Now that camp isn''t safe anymore, Rick decides that it''s time for them all to move out. He plans to take them to the C.D.C., a military base, to find a cure for Jim and, hopefully, more survivors.', '\n      Nov. 28, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(454, 3, 'episode', 'TS-19', 2010, 6, 'http://www.imdb.com/title/tt1520211/episodes?year=2010&ref_=tt_eps_yr_2010', 'At the C.D.C., Rick and the others find Dr. Edwin Jenner, a scientist who is on the verge of suicide. But just when they think they''re safe, Jenner tells them that the building is on a countdown to self-destruct.', '\n      Dec. 5, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg0MzI4ODU0N15BMl5BanBnXkFtZTcwMTYxNzYxNA@@._V1_SY180_CR75,0,120,180_.jpg'),
(455, 3, 'episode', 'What Lies Ahead', 2011, 1, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'The group heads for Fort Benning. But along the way, they run into a herd of zombies and Sophia runs off in fear. Now Rick and the others try to track her down.', '\n      Oct. 16, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BODI0NDQ1NjMyMl5BMl5BanBnXkFtZTcwNjk0MDgyNg@@._V1_SY180_CR75,0,120,180_.jpg'),
(456, 3, 'episode', 'Bloodletting', 2011, 2, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'After Carl gets shot, Rick and Shane find Dr. Hershel Greene and his family in a nearby house. But Carl has lost too much blood and Hershel doesn''t have everything he needs. Could Carl die before the right equipment is found?', '\n      Oct. 23, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1OTc1Nzk4N15BMl5BanBnXkFtZTcwMDgwNDQ5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(457, 3, 'episode', 'Save the Last One', 2011, 3, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'Shane and Otis try to dodge the zombies as they head back to the house. Meanwhile, Carl is getting worse and time is running out.', '\n      Oct. 30, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcyMDYwODcxN15BMl5BanBnXkFtZTcwMjQ0Njc5Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(458, 3, 'episode', 'Cherokee Rose', 2011, 4, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'With Carl recovering, the group, once again, puts their focus on finding Sophia.', '\n      Nov. 6, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc2Njg2NDI1Nl5BMl5BanBnXkFtZTcwOTIzOTEwNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(459, 3, 'episode', 'Chupacabra', 2011, 5, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'While searching for Sophia, Daryl becomes injured and stranded in the middle of the woods. Now he''s beginning to see Merle everywhere. Meanwhile Lori has just found out that she''s pregnant and she doesn''t know how to tell Rick.', '\n      Nov. 13, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(460, 3, 'episode', 'Secrets', 2011, 6, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'Now that Glen knows there are walkers in the barn, Maggie Greene begs him not to tell anyone. Herschel believes that those walkers, which include loved ones, are just sick and may someday be cured. Herschel''s isn''t the only secret Glen is asked to keep as Lori asks him to go into town and get something for her from the pharmacy. Shane and Andrea head of to a nearby suburb in search of Sophia and their encounter with walkers leads to a new phase in their relationship. Lori finally breaks down and tells Rick that she is pregnant.', '\n      Nov. 20, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3OTkyMDYwOF5BMl5BanBnXkFtZTcwMjUwMDYwNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(461, 3, 'episode', 'Pretty Much Dead Already', 2011, 7, 'http://www.imdb.com/title/tt1520211/episodes?year=2011&ref_=tt_eps_yr_2011', 'Glenn tells the others about the zombies in the barn. Now, they are debating whether they should stay or not.', '\n      Nov. 27, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI3NTIyNTExN15BMl5BanBnXkFtZTcwOTMzNzkwNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(462, 3, 'episode', 'Nebraska', 2012, 8, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'The gang bury Sophia''s body and burn the rest. Hershel disappears just as Beth falls into shock. Rick and Glenn head out to find him.', '\n      Feb. 12, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BODczMjM3ODIzNF5BMl5BanBnXkFtZTcwNjMyNDEzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(463, 3, 'episode', 'Triggerfinger', 2012, 9, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Rick, Glenn, and Hershel come under enemy fire in a nearby town. Shane is starting to turn more savage. Lori fears for her family.', '\n      Feb. 19, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQyNTc3ODU1MF5BMl5BanBnXkFtZTcwNDMzMDE0Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
(464, 3, 'episode', '18 Miles Out', 2012, 10, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Rick and Shane try to decide what to do with their new captive, Randall. Meanwhile, Lori and Maggie try to stop Beth from committing suicide.', '\n      Feb. 26, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3MDIxNTk3MV5BMl5BanBnXkFtZTcwMzU1MjQ0Nw@@._V1_SY180_CR76,0,120,180_.jpg'),
(465, 3, 'episode', 'Judge, Jury, Executioner', 2012, 11, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Daryl interrogates Randall about his group and he learns that they are formed by thirty dangerous men capable to rape two teenage daughters in front of their father. Rick and Shane decide to kill Randall, who is considered a threat to the survivors, but Dale opposes to their decision and Rick summons the group that is supportive to the execution to vote. Dale tries to convince each survivor that they must not lose their humanity. Carl is affected by the situation and has strange actions: first he sneaks to talk to Randall; then he disrespects Carol with an offensive ...', '\n      Mar. 4, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk0OTE2NzExOF5BMl5BanBnXkFtZTcwNTc2MDg0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(466, 3, 'episode', 'Better Angels', 2012, 12, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'The group of survivors is organizing the preparation for the winter following the instructions of Rick. Carl is uncomfortable, feeling responsible for the death of Dale and he talks to Shane about what had happened in the swamp. He asks Shane to give the weapon back to Daryl and Shane talks to Rick about the problem. While Rick and Carl are having a conversation, Shane works hard and Lori tells to him that she is not sure whether the baby is his or Rick''s. Shane releases Randall and walks with him on the field. Out of the blue, he breaks Randall''s neck, hides his body...', '\n      Mar. 11, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIxMjM0Njc2N15BMl5BanBnXkFtZTcwNDQ5MjE1Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(467, 3, 'episode', 'Beside the Dying Fire', 2012, 13, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Rick and Carl return to the farm but quickly realize that that they are being followed by by a large group of walkers. Mayhem ensues as the humans try to save the farm but they are eventually forced to flee realizing that the it is lost. Several of them do not survive the onslaught and others are separated into small groups. Some are reunited but fed up with the constant bickering and complaints about his leadership, Rick lets it be known that people will now do as they are told. Andrea meanwhile, on her own and separated from the others, is rescued by a hooded ...', '\n      Mar. 18, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU1MDYzNzgwMV5BMl5BanBnXkFtZTcwMjc3MzU1Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
(468, 3, 'episode', 'Seed', 2012, 1, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'The survivors have spent a difficult winter moving from place to place trying to stay clear of the walkers and constantly looking for food. Lori is now at the advanced stage of her pregnancy but it''s obvious that she and Rick aren''t getting along. When they notice a prison in the distance, Rick convinces them it may be just what they''re looking for with the possibility of food and medicine being available. They have to fight their way in, eliminating a large number of walkers but they soon settle into a secure prison block. Several of them set off to explore the ...', '\n      Oct. 14, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAxMTYzODgyNzFeQTJeQWpwZ15BbWU3MDU0ODc2OTc@._V1_SY180_CR75,0,120,180_.jpg'),
(469, 3, 'episode', 'Sick', 2012, 2, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Having found some of the prison inmates alive, Rick proposes that they clear out another cell block for them. The prisoners were locked in the cafeteria area by a prison guard when a riot erupted 10 months before and have been there ever since. They have no idea what has been going on in the outside world. Rick''s first priority is to protect everyone in his group so when push comes to shove, he''s prepared to do whatever is necessary. Hershel is still unconscious following the amputation and they are keeping a close watch on him in the event he should turn into a ...', '\n      Oct. 21, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEwNTMxNzYyN15BMl5BanBnXkFtZTcwMzcyMDM1OA@@._V1_SY180_CR76,0,120,180_.jpg'),
(470, 3, 'episode', 'Walk with Me', 2012, 3, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Andrea and Michonne see a helicopter crash and they head to the spot to seek out survivors to help them. However a group of armed men arrives together and they hide in the wood. The men take the pilot from the helicopter and the women are surprised by Merle. The group takes Andrea and Michonne to their community in Woodbury where the women are welcomed with food, medicine, hot shower and clothes. They are introduced to the Governor, a man that rules Woodbury, protecting and giving quality of life to the people in the community. Andrea believes that Woodbury is the ...', '\n      Oct. 28, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3NzQzNTI2Nl5BMl5BanBnXkFtZTcwNzAyMDM1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(471, 3, 'episode', 'Killer Within', 2012, 4, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Michone is intent on leaving Woodbury convinced that there is something out of place there. Andrea isn''t so sure she wants to leave and on a map shows Merle the location of the farm where she last saw his brother Daryl. Back at the prison, Herschel is hobbling around with the help of crutches. Suddenly, Rick and the others are having to deal with a major attack by walkers. Someone has set off the prison siren and the group is broken up into twos and threes. Lori goes into labor leaving it to Maggie and Carl to help her deliver the baby. T-Dog and Carol have to face an...', '\n      Nov. 4, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA2MTgzMTAyM15BMl5BanBnXkFtZTcwODcyMDM1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(472, 3, 'episode', 'Say the Word', 2012, 5, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'At the prison, Rick is nearly catatonic in his grief and heads off on his own inside the prison. Daryl and Maggie go off to find formula for the newborn. In Woodbury, the residents celebrate their survival with a town picnic. A suspicious Michonne takes the opportunity to look around and finds some walkers locked away. She kills them only to find she has interfered with a research project. Unable to convince Andrea that they are really prisoners, Michonne leaves on her own. Andrea is not too keen on the evening festivities. One of the Governor''s secrets is revealed.', '\n      Nov. 11, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTEzNjM3MTE1OF5BMl5BanBnXkFtZTcwNDQzMDM1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(473, 3, 'episode', 'Hounded', 2012, 6, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'At the prison, Rick is surprised by the ringing telephone after his rampage against the walkers. The callers won''t identify themselves or say where they are other than they are in a very safe place. While Rick comes to terms with his own demons, Daryl, Carl and Oscar go to clear out other areas of the prison. Just when he thinks he''s done, Daryl makes an amazing discovery. In Woodbury, the Governor sends Merle and three others to track down and kill Michone. They don''t have much luck but Merle comes across Glen and Maggie who were out looking for baby formula. ...', '\n      Nov. 18, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNzM1NjA5Mzc5NF5BMl5BanBnXkFtZTcwMjk0MjQ3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(474, 3, 'episode', 'When the Dead Come Knocking', 2012, 7, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'At the prison, everyone is surprised by the arrival of Michone but they have no intention of letting her stay and join the group. She tells them about Glen and Maggie being taken to Woodbury and offers to lead them there. She makes no mention of Andrea or Daryl''s brother. In Woodbury, Merle interrogates Glenn rather forcefully but he refuses to tell him where the others can be found. The Governor decides to interrogate Maggie himself and has more success. Meanwhile the Governor has asked Andrea to help Milton with an experiment.', '\n      Nov. 25, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgyNzIzNjEzMF5BMl5BanBnXkFtZTcwMjQxOTc3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(475, 3, 'episode', 'Made to Suffer', 2012, 8, 'http://www.imdb.com/title/tt1520211/episodes?year=2012&ref_=tt_eps_yr_2012', 'Rick, Daryl, Oscar and Michonne enter Woodbury in search of Glenn and Maggie. When shooting erupts, they are soon reunited but they will have to fight their way out. One will not make it. The Governor needs a scapegoat and he is quick to point the finger at one of his own. Michonne goes off on her own, intent on killing the Governor. She waits for him in his quarters but isn''t quite prepared for what she finds there. Back at the prison meanwhile, a new group arrives in need help.', '\n      Dec. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg0MTI2MTgxNF5BMl5BanBnXkFtZTcwNTQxOTc3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(476, 3, 'episode', 'The Suicide King', 2013, 9, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'After the invasion of Woodbury by Rick''s group, Daryl and Merle are captured by The Governor. Rick decides the fate of Tyreese''s group.', '\n      Feb. 10, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ1MjEyMjkxMV5BMl5BanBnXkFtZTcwNzMwNzMwOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(477, 3, 'episode', 'Home', 2013, 10, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'Rick is totally disturbed and seeing Lori everywhere. Meanwhile the Machiavellian Governor asks Andrea to lead his people because he needs time. Daryl and Merle are looking for food and see a Latin family with baby under attack of walkers. Daryl helps them and when Merle is ready to pillage them, Daryl points his weapon to his brother and protects the family. Meanwhile Glenn questions the leadership of Rick to Hershel and wants to attack Woodbury, but Hershel convinces him that it will not be good and he leaves the prison to seek where the breach where the walkers are...', '\n      Feb. 17, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgxODQ3NTU4NV5BMl5BanBnXkFtZTcwNjk5NTAxOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(478, 3, 'episode', 'I Ain''t a Judas', 2013, 11, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'Andrea sees the Governor preparing the dwellers of Woodbury to attack the prison and she decides to sneak out to visit Rick and the survivors to convince them to make an agreement with the Governor. She asks Milton to help her and the minion discloses her plan to the Governor that orders him to help her. Milton helps Andrea to capture a walker and they stumble with Tyreese group that Rick had expelled from the prison. Milton brings them to Woodbury and they offer to help the Governor in the war against Rick. Meanwhile, in the prison, Rick and his group are protecting ...', '\n      Feb. 24, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgwNTQxMzk5Nl5BMl5BanBnXkFtZTcwNjY4NDMxOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(479, 3, 'episode', 'Clear', 2013, 12, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'Rick, Carl, and Michonne head back to Rick''s hometown to find more guns to fortify themselves against The Governor. Rick runs into a familiar friend. Michonne and Carl head out to find something important.', '\n      Mar. 3, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc2ODAzMjc5OV5BMl5BanBnXkFtZTcwNjc1ODYxOQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(480, 3, 'episode', 'Arrow on the Doorpost', 2013, 13, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'Andrea arranges for Rick and the Governor to meet at a neutral site. They no sooner arrive than the Governor makes it clear he''s not there to negotiate but to tell Rick he and his people have to clear out. When Andrea interjects, the Governor tells her to leave. He decides to offer Rick a deal: give him Michonne and he will leave Rick and his group alone. While the two are talking, those that accompanied them wait patiently outside and find that they have more in common than they might have thought. Back at the prison, Merle tries to convince those still there that ...', '\n      Mar. 10, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjA0OTcyOTI2MF5BMl5BanBnXkFtZTcwOTYwMDIyOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(481, 3, 'episode', 'Prey', 2013, 14, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'In Woodbury, the Governor is preparing to go to war. He tells his senior men that anyone who comes to the meeting in two days time from Rick''s camp is to be killed. Everyone except Michonne and he''s prepared a special room just for her. He doesn''t tell Andrea the truth but Milton, disgusted by the Governor''s plan to slaughter Rick''s group, tells her the truth and she sets off to the prison to warn her friends. When he hears what''s happened, the Governor sets off after her. Meanwhile Tyreese begins to wonder what they''ve got themselves into when he sees the pit full of...', '\n      Mar. 17, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4MzY1NDU5MV5BMl5BanBnXkFtZTcwMzczNDUyOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(482, 3, 'episode', 'This Sorrowful Life', 2013, 15, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'Rick decides the fate of Michonne. One of the group betrays Rick. The Governor and his group head to the meeting area.', '\n      Mar. 24, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkzMzU1ODI1NV5BMl5BanBnXkFtZTcwOTgyNTYyOQ@@._V1_SY180_CR76,0,120,180_.jpg'),
(483, 3, 'episode', 'Welcome to the Tombs', 2013, 16, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', 'Rick and the group have to seriously consider if the prison is worth defending as the Governor''s impending attack looms over their heads.', '\n      Mar. 31, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA2MDIxNTgyN15BMl5BanBnXkFtZTcwMTY2ODAzOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(484, 3, 'episode', 'Episode #4.1', 2013, 1, 'http://www.imdb.com/title/tt1520211/episodes?year=2013&ref_=tt_eps_yr_2013', '', '\n      Oct. 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(485, 1, 'episode', 'We Need to Talk About Kevin', 8, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Dean returns from Purgatory, one year after the fight with the Leviathans. After reuniting with Sam, they find out that Kevin escaped Crowley with another Word of God that may hold the key to closing the gates of Hell forever.', '\n      Oct. 3, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAwMDU3NjE4NTheQTJeQWpwZ15BbWU3MDUyNzA3NDg@._V1_SY180_CR75,0,120,180_.jpg'),
(486, 1, 'episode', 'What''s Up, Tiger Mommy?', 8, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'After saving Kevin''s mother from demons, Sam, Dean, and Kevin go after the Word of God which is being auctioned off by Pultus, the god of greed.', '\n      Oct. 10, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTEwNDM4NDg2OV5BMl5BanBnXkFtZTcwNzAxNDM1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(487, 1, 'episode', 'Heartache', 8, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'While trying to track down Kevin, Sam and Dean get sidetracked by a series of murders where the victims have gotten their hearts ripped out.', '\n      Oct. 17, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA0NTQ5ODQ3M15BMl5BanBnXkFtZTcwMzA0NDc1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(488, 1, 'episode', 'Bitten', 8, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean come across a home made video of three friends investigating a werewolf attack.', '\n      Oct. 24, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjMzMDkzMTc5N15BMl5BanBnXkFtZTcwNzg1Mzk1OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(489, 1, 'episode', 'Blood Brother', 8, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Dean assists the vampire, Benny, who escaped from Purgatory with him, as he goes after the vampire that bit him. Sam thinks back to his life before Dean returned.', '\n      Oct. 31, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE3NjUxNDU4NV5BMl5BanBnXkFtZTcwODgzMjA2OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(490, 1, 'episode', 'Southern Comfort', 8, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean team up with Garth, who has taken over Bobby''s job, as they hunt down a Specter that''s possessing innocent people who have a grudge against someone.', '\n      Nov. 7, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ0ODE0NzM1MF5BMl5BanBnXkFtZTcwNjYwMDY2OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(491, 1, 'episode', 'A Little Slice of Kevin', 8, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Crowley has kidnapped Kevin and the rest of the prophets that are able to read the Word of God. Castiel mysteriously returns from Purgatory and helps Sam and Dean rescue Kevin.', '\n      Nov. 14, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYyODU2NzA1Ml5BMl5BanBnXkFtZTcwNDcwODg2OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(492, 1, 'episode', 'Hunteri Heroici', 8, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Castiel decides to become a hunter, like Sam and Dean. But his first day on the job is a doozy when they investigate a series of murders caused by old cartoon gags. Meanwhile, Sam thinks back to his first time meeting Amelia''s father.', '\n      Nov. 28, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzUyNTE4ODcxM15BMl5BanBnXkFtZTcwMzc2Nzg3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(493, 1, 'episode', 'Citizen Fang', 8, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Benny seems to be attacking innocent people and only Dean believes he''s innocent.', '\n      Dec. 5, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTM3MTE4NzQwNl5BMl5BanBnXkFtZTcwNTY2Nzg3OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(494, 1, 'episode', 'Torn and Frayed', 8, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Dean and Castiel try to rescue Samandriel from Crowley. Sam tries to decide whether or not he should continue hunting or be with Amelia.', '\n      Jan. 16, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQzMzYwNjQ5NV5BMl5BanBnXkFtZTcwNjU5NTc5OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(495, 1, 'episode', 'LARP and the Real Girl', 8, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'When two LARPers turn up dead, Sam and Dean investigate the fictional world of Moondoor, where they find a familiar face.', '\n      Jan. 23, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk4OTI4MjQ4NF5BMl5BanBnXkFtZTcwMjQ5NTc5OA@@._V1_SY180_CR75,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(496, 1, 'episode', 'As Time Goes By', 8, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean''s grandfather, Henry Winchester, arrives by time travel, claiming that he has something to protect from an Abaddon that is hot on his trail.', '\n      Jan. 30, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcxNzU2MzUyM15BMl5BanBnXkFtZTcwNjM5NTc5OA@@._V1_SY180_CR75,0,120,180_.jpg'),
(497, 1, 'episode', 'Everybody Hates Hitler', 8, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean go up against an group of Nazi necromancers.', '\n      Feb. 6, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUxMDQ5NDI1M15BMl5BanBnXkFtZTcwMzI0OTQwOQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(498, 1, 'episode', 'Trial and Error', 8, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Kevin has found out that in order to close the gates of Hell, the person needs to accomplish three tasks. The first, is to kill a Hellhound.', '\n      Feb. 13, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjMxMDk3Njk1OV5BMl5BanBnXkFtZTcwMjY1MTAxOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(499, 1, 'episode', 'Man''s Best Friend with Benefits', 8, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'James Frampton, an old friend of Sam and Dean, has become a witch. Now he''s supposedly killing innocent people.', '\n      Feb. 20, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(500, 1, 'episode', 'Remember the Titans', 8, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean come across a mysterious man that dies once every day.', '\n      Feb. 27, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3ODU0MzIzM15BMl5BanBnXkFtZTcwODYwOTYxOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(501, 1, 'episode', 'Goodbye Stranger', 8, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean hunt down the angel tablet with assistance from Castiel and Meg.', '\n      Mar. 20, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5OTAxMDg2MF5BMl5BanBnXkFtZTcwNjUwOTQyOQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(502, 1, 'episode', 'Freaks and Geeks', 8, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'A hunter has been training Krissy and other kids to be hunters.', '\n      Mar. 27, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(503, 1, 'episode', 'Taxi Driver', 8, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'The second task is to rescue an innocent soul from Hell and deliver it to Heaven.', '\n      Apr. 3, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(504, 1, 'episode', 'Pac-Man Fever', 8, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'While searching for Kevin, again, Charlie joins up with Sam and Dean as they track down a creature that''s been liquefying it''s victims. Plus, a new side of Charlie is revealed.', '\n      Apr. 24, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY3NDgyNjA0M15BMl5BanBnXkFtZTcwMDU5NDI0OQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(505, 1, 'episode', 'The Great Escapist', 8, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', 'Sam and Dean search for the Word''s author, Metatron. Castiel tries to protect the angel tablet. Kevin tries to solve the third trial under Crowley''s supervision.', '\n      May 1, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgyODY2NDc4OV5BMl5BanBnXkFtZTcwMjE5NDU0OQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(506, 1, 'episode', 'Clip Show', 8, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      May 8, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkwMDU0MjE3N15BMl5BanBnXkFtZTcwNDI4NjY0OQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(507, 1, 'episode', 'Sacrifice', 8, 23, 'http://www.imdb.com/title/tt0460681/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      May 15, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAyNTU0NzUxNjheQTJeQWpwZ15BbWU3MDM4NzgxNTk@._V1_SY180_CR75,0,120,180_.jpg'),
(508, 1, 'episode', 'In My Time of Dying', 2, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'In the aftermath of the car crash, the surviving Winchesters go to the hospital, where one is stalked by a Reaper while another must consider sacrificing himself to save the others.', '\n      Sep. 28, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(509, 1, 'episode', 'Everybody Loves a Clown', 2, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam and Dean listen to a message on John''s cell phone from a woman named Ellen (guest star Samantha Ferris)and decide to track her down. They are shocked to discover Ellen runs a road house that also serves as a gathering place for hunters like themselves. Meanwhile, at a small town carnival, a demonic clown is persuading children to let them into their home so he can murder their parents.', '\n      Oct. 5, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(510, 1, 'episode', 'Bloodlust', 2, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'The Winchester brothers enjoy Dean''s new baby: a shiny newly restored car, while checking out a report of two recent human deaths and over a dozen split-open cows in the small town of Red Lodge, Montana. The local sheriff laughs at Sam and Dean''s idea that a cult is behind it, claiming it happens naturally in the sun. But when Sam and Dean sneak into the morgue under false pretenses, they find a victim that has retractable vampire fangs. They catch black demon hunter Gordon Walker, who claims to be a friend of their late father and having made both kills after six ...', '\n      Oct. 12, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(511, 1, 'episode', 'Children Shouldn''t Play with Dead Things', 2, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam insists to visit ma Mary''s grave, although empty and meaningless to Dean, who is however intrigued in the cemetery by the perfect circle of dead vegetation around the three days old grave of local college student Angela Mason who died in a car accident, suspecting the ground is desecrated, Sam thinks it''s another diversion not to have to think about either deceased Winchester parent. Her roommate Lindsey says Angela''s grieving boyfriend Matt Harrison just slit his throat, all plants in his place are also dead. Another student, Neil Levine, tells Matt blamed ...', '\n      Oct. 19, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(512, 1, 'episode', 'Simon Said', 2, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Visions show Sam, still hunting for the master demon with Dean, the way to another small town where paranormal events occur, some innocent, some chillingly evil. The Winchester brothers are convinced it''s all the paranormal work of 23 year-old Andy Gallagher, but doubt as that boy, although a bit of an outcast looser living in a van filled with philosophy as well as rock music seems sincerely surprised and using his powers with self-control. Soon they find after rescuing Tracy from what seems his work there is another at least as able and less scrupled, in fact Andy''s...', '\n      Oct. 26, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(513, 1, 'episode', 'No Exit', 2, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam and Dean meet up with America''s first serial killer, while Jo lies to her mother about going to Vegas and joins Sam and Dean to help them on their hunt.', '\n      Nov. 2, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(514, 1, 'episode', 'The Usual Suspects', 2, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam and Dean investigate the murders of a lawyer and his wife who claimed to have seen a ghost right before they died. However, after local detectives Ballard and Sheridan uncover the Winchesters'' records, they arrest the brothers for a double homicide before they are able to find the ghost. When the ghost begins to visit Ballard, she begins to wonder if the tale Sam and Dean are telling her could be true, and if she might be the next to die.', '\n      Nov. 9, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(515, 1, 'episode', 'Crossroad Blues', 2, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam and Dean try to save the life of architect Evan Hudson who sold his soul to a demon so that his wife could live a long and healthy life free of cancer. While Sam protects Evan from hell hounds, Dean is tempted by the demon, who tries to convince him to trade his soul for his father''s life, who she claims did the same to save Dean and is now suffering in hell for it.', '\n      Nov. 16, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(516, 1, 'episode', 'Croatoan', 2, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Another one of Sam''s visions in which Dean kills a man by name of Duane Tanner sends the Winchesters to Rivergrove, a near ghost town facing mass demonic possession. Sam and Dean begin to believe that the demons are trying to destroy the town from the inside out when the remaining town-folk try to kill them.', '\n      Dec. 7, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(517, 1, 'episode', 'Hunted', 2, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam is shocked when Dean finally tells him their dad asked him to watch over Sam to save him, or if that fails kill him. Sam leaves alone to let Ash look up a same-type clairvoyant demonic victim. Ava Wilson, from Peoria, Indiana, fits that bill and looks up Sam to warn she saw his death, then leaves ridiculing him. Dean followed Sam, just in time to intervene when crazy Gordon Walker turns up, who will stop at nothing to destroy ''utterly evil'' Sam. It''s a testing fight for the brothers.', '\n      Jan. 11, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(518, 1, 'episode', 'Playthings', 2, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam and Dean visit the Pierpont Inn, a creepy old mansion turned failing hotel. They meet the owner, Susan, and her daughter Tyler, who are packing to move after they sell the hotel. Tyler is playing with a little girl named Maggie. The brothers notice strange items around the hotel, including an urn with a familiar pattern, dolls with their heads backwards and Susan''s mother, who looks vacant and beyond terrified. When Susan finds them in her mother''s room trying to talk to her, she throws them out and threatens to call the cops.', '\n      Jan. 18, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(519, 1, 'episode', 'Nightshifter', 2, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'A jewelery store heist committed by an employee is linked to a mysterious bank robberies bring Sam and Dean into the chase. The weird part seems to be the fact that the suspects end up dead before even getting their hands on the money. A friendly tip points towards another shapeshifter. However, the search is interrupted by a hostage crisis.', '\n      Jan. 25, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(520, 1, 'episode', 'Houses of the Holy', 2, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'In Providence, Rhode Island, the local Gloria kills a man claiming that an angel in a beautiful white night had chosen her for redemption and asked her to stab the sinner to accomplish God''s will. Dean and Sam investigate the case and they discover that other people had been visited by the angel and committed murders. Further, the angel has appeared after the death of Father Gregory, who was murdered on the steps of his church two months ago. When Sam is visited by the angel and asked to kill a man, the skeptical and atheist Dean confronts the faith of Sam telling ...', '\n      Feb. 1, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(521, 1, 'episode', 'Born Under a Bad Sign', 2, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'After Sam goes missing for over a week, Dean finally receives a phone call from his brother. Dean finds Sam in a hotel room, covered in blood and suffering from the effects of a week long memory blackout. Upon investigation, the brothers find a video-tape of Sam killing another hunter in cold blood, which leads Sam to believe his dark side is taking over. When the dark side finally emerges Sam attacks Dean and continues on his hunter killing spree with his next targets being family friends Jo Harvelle and Bobby Singer.', '\n      Feb. 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(522, 1, 'episode', 'Tall Tales', 2, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam, Dean, and Bobby encounter what appears to be a dancing alien, a chainsaw killer, alligators in the sewers, and other oddities straight out of the tabloids while probing strange occurrences on a college campus. They discover all are actually the work of one college janitor, a Trickster who has the ability to conjure into reality anything he wants. Not helping matters is the brothers'' slowly escalating feud which Bobby suspects is also the work of the Trickster.', '\n      Feb. 15, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(523, 1, 'episode', 'Roadkill', 2, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Molly and her husband are driving along a long deserted highway at night when they come upon a farmer. The next thing Molly knows both the husband and the farmer have disappeared. Things get worse when the Winchesters inform Molly that the farmer is actually a highway ghost who, it seems, appears annually to claim a new victim, who happens to be Molly this time. Molly is actually the driver of the vehicle who killed the farmer and his wife and is dead herself but doesn''t know it. Her husband David survived the accident, and when faced with the truth Molly is able to ...', '\n      Mar. 15, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(524, 1, 'episode', 'Heart', 2, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Sam and Dean come across werewolf activity when they investigate the death of lawyer who was believed to have been killed by a wild animal. While Dean tracks the werewolf on the outside, Sam offers to protect Madison(guest star Emmanuelle Vaugier)who is likely to be the werewolf''s next target.', '\n      Mar. 22, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(525, 1, 'episode', 'Hollywood Babylon', 2, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'The Winchesters go undercover as PAs on a haunted movie set after getting wind of reports of tag teaming ghosts. The brothers deal with an asinine studio executive out to make cheap marketing stunts(guest star Gary Cole), a disenfranchised screenwriter seeking revenge for unnecessary revisions to a formally great script, and Dean''s fan-boyish feelings for the leading lady.', '\n      Apr. 19, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(526, 1, 'episode', 'Folsom Prison Blues', 2, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'When an old block is reopened in the Green River County Detention Center after thirty years, a fiend is released, killing the interns. Three months later, Dean and Sam are arrested during a heist to be sent to the haunted prison to help Deacon, a former friend of their father. While FBI Agent Victor Henricksen presses Dean, the public defender Mara Daniels believes the brothers are not guilty of most of the inconsistent charges against them, and helps the Winchester brothers in the end.', '\n      Apr. 26, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(527, 1, 'episode', 'What Is and What Should Never Be', 2, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Dean gets attacked by a Djinn, a creature capable of warping reality. The next things he knows he''s in Lawrence, Kansas, in a stable relationship with a woman named Carmen, his mother is alive and well, and he and Sam are no longer on speaking terms. When the idea of a peaceful existence begins to settle in, visions of his previous life as a hunter start appearing out of nowhere.', '\n      May 3, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(528, 1, 'episode', 'All Hell Breaks Loose: Part 1', 2, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'The Yellow Eyed Demon transports Sam, Andy, and Ava along with other "Special Children" Jake and Lily to the remains of a ghost town to initiate the first steps of his war against mankind. Dean contacts Bobby Singer, Ash, and Ellen for help in locating his brother.', '\n      May 10, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(529, 1, 'episode', 'All Hell Breaks Loose: Part 2', 2, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=2&ref_=tt_eps_sn_2', 'Dean hits an emotional rock bottom after a devastating personal loss. The Yellow Eyed Demon begins a calculated strategic move to unleash the armies of hell.', '\n      May 17, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(530, 1, 'episode', 'The Magnificent Seven', 3, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Sam, Dean, and Bobby deal with the ramifications of the Gate to Hell opening, meeting the demon incarnations of the Seven Deadly Sins, while Dean is living life to the fullest in the shadow of a deal he made with the Crossroads Demon, and a mysterious blonde woman with a demon-killing knife assists Sam.', '\n      Oct. 4, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(531, 1, 'episode', 'The Kids Are Alright', 3, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'A strange death reported in the newspaper prompts Dean and Sam to find Lisa Braeden, a woman Dean had a weekend fling with about 8.75 years ago, only to find she has a son turning 8. While investigating the death in the paper along with several other mysterious recent deaths, Sam and Dean find they are chasing a Changeling, who is replacing children with it''s offspring. The mysterious blond woman is back, giving Sam a cryptic message that he should look into his mother''s friends.', '\n      Oct. 11, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(532, 1, 'episode', 'Bad Day at Black Rock', 3, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'The Winchesters are called regarding a robbery of their father''s storage unit, and track down the robbers to find the item stolen is a cursed rabbit''s foot, which provides great luck until lost, and once lost the previous owner dies within a week. Sam picks up the foot and has great fortune, until it is pickpocketted away by the mercenary Bela. Dean must then get it back before Sam''s bad luck gets him killed. To complicate the whole situation, Gordon, from his prison home, has convinced two other hunters that Sam is pure evil and must be killed.', '\n      Oct. 18, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(533, 1, 'episode', 'Sin City', 3, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'The Winchester boys head to Ohio to research several deaths in a small town, where sin has taken a firm foothold on the population; prostitution, adultery, alcohol abuse, murder, and suicide are all prevalent in the once quiet town. Dean has a revealing conversation with a demon possessed woman. The demon Ruby assists Bobby in restoring the Colt to it''s demon-killing grandeur.', '\n      Oct. 25, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(534, 1, 'episode', 'Bedtime Stories', 3, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'The ''Three Little Pigs'' and ''Hansel and Gretel'' come to life and attract Sam and Dean''s attention to Maple Springs, NY, where they try to prevent ''Little Red Riding Hood'', ''Cinderella'', and ''Snow White'' from having unhappy endings. Sam also confronts the Crossroad Demon with the newly refurbished Colt.', '\n      Nov. 1, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(535, 1, 'episode', 'Red Sky at Morning', 3, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Strange land-locked drownings are happening and the boys head to the coast to find out why, discovering a Ghost Ship has been witnessed by each of the victims shortly before their deaths. They find that Bela is already involved, running a scam on elderly Gertrude Case, the aunt of the first victim with a crush on Sam.', '\n      Nov. 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(536, 1, 'episode', 'Fresh Blood', 3, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Gordon Walker is out of prison and out for blood, Sam''s blood, and pays Bela to reveal their location. Meanwhile, the Winchesters are hot on the trail of a vampire named Dixon, who in turn has a beef with Gordon.', '\n      Nov. 15, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(537, 1, 'episode', 'A Very Supernatural Christmas', 3, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Sam and Dean follow the trail of an Anti-Claus when victims are apparently pulled up the chimney never to be seen again. After a lead goes nowhere, the Winchesters learn the Anti-Claus in in fact a pair of old pagan gods who have assimilated into society and have found a new way of getting their yearly sacrifices. A flashback to Christmas Eve 1991 reveals how Sam found out for the first time what their father really did and where Dean got his gold amulet.', '\n      Dec. 13, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(538, 1, 'episode', 'Malleus Maleficarum', 3, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'The seemingly harmless practices of a group of neighborhood witches goes bad when one of them kills a woman. Ruby offers her assistance... but she has a few secrets of her own.', '\n      Jan. 31, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(539, 1, 'episode', 'Dream a Little Dream of Me', 3, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'When Bobby Singer is discovered in a coma, Dean and Sam uncover a demon who works through people''s dreams to destroy them.', '\n      Feb. 7, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(540, 1, 'episode', 'Mystery Spot', 3, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Sam relives the same day over and over, continually having to deal with Dean''s death.', '\n      Feb. 14, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(541, 1, 'episode', 'Jus in Bello', 3, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Sam and Dean are arrested by Agent Henriksen and thrown into a jail cell in Colorado just as an army of demons makes their first move under a new leader who wants Sam dead.', '\n      Feb. 21, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(542, 1, 'episode', 'Ghostfacers', 3, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Sam and Dean inexplicably encounter the Hell Hounds while investigating a case that John failed to crack years earlier and become fixtures in their pilot for a reality show called Ghostfacers.', '\n      Apr. 24, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(543, 1, 'episode', 'Long-Distance Call', 3, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Sam and Dean are on the trail of the Crocotta, an entity that secures its victims by communicating as a loved one via phone and computer. While Sam watches over a family being tormented by the ghostly communiques, Dean walks into a trap when a voice from beyond the grave gives the whereabouts of the demon who holds his contract.', '\n      May 1, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(544, 1, 'episode', 'Time Is on My Side', 3, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'The Winchesters encounter the mysterious and very much still alive Doc Benton when they look into a series of abductions where the victims report missing body parts after forced surgery. When Bobby manages to locate Bela, Dean heads off to confront her and get the Colt back. Meanwhile Sam stays behind hoping that Doc Benton can make Dean immortal to get him out of the Deal.', '\n      May 8, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(545, 1, 'episode', 'No Rest for the Wicked', 3, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=3&ref_=tt_eps_sn_3', 'Dean''s time is up and he has to pay the Devil his due. When Lilith resurfaces in New Harmony, Indiana terrorizing a family to no end Sam, Dean, and Bobby steal Ruby''s knife and confront the mother of all demons in a battle to the death.', '\n      May 15, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5NDc2OTg3M15BMl5BanBnXkFtZTcwNzk0ODU4MQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(546, 1, 'episode', 'Pilot', 1, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean Winchester were trained by their father to hunt the creatures of the supernatural. Now, their father has mysteriously disappeared while hunting the demon that killed their mother, 22 years ago.', '\n      Sep. 13, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(547, 1, 'episode', 'Wendigo', 1, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean make a stop at Blackwater Ridge and end up helping a young woman and her brother find their other brother, who mysteriously disappeared, while on a camping trip, in the woods.', '\n      Sep. 20, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(548, 1, 'episode', 'Dead in the Water', 1, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'As the trail on their father goes cold, Sam and Dean find themselves in a small town in Wisconsin where 3 people have disappeared without trace in to a lake in the past year alone. Soon, the dam holding the water for the lake will burst and the town will be lost forever. The spirit causing the disappearances begins taking more and more people as it is running out of time. Sam and Dean must figure out who the spirit is and put it to rest before anymore people are taken and lost forever.', '\n      Sep. 27, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(549, 1, 'episode', 'Phantom Traveler', 1, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean are called in to investigate when a plane crashes under mysterious circumstances. Their investigation leads them to the conclusion that a demon is possessing people and causing them to crash the plane they are on. Things become more urgent when they discover that the demon is going after the 7 survivors of the crash, including the pilot and a stewardess.', '\n      Oct. 4, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(550, 1, 'episode', 'Bloody Mary', 1, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'All over the world, kids play the "Bloody Mary" game, daring each other to say her name three times in a mirror. But no one has even died from it. Until now. Sam and Dean must find a way to stop her before she claims another victim.', '\n      Oct. 11, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(551, 1, 'episode', 'Skin', 1, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'When one of Sam''s old school friends is framed for the murder of his girlfriend, Sam and Dean investigate, discovering that a shapeshifter is responsible for that murder and possibly other similar murders.', '\n      Oct. 18, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(552, 1, 'episode', 'Hook Man', 1, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean help a girl whose date became a victim of the "Hook Man," a famous urban legend that turns out to be real, in a small college town somewhere in Iowa. In order to save her and her father, the local minister, the brothers have to find the ghost''s bones so they can destroy them. But Sam and Dean run into a problem when they discover that the bones are in an unmarked grave.', '\n      Oct. 25, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(553, 1, 'episode', 'Bugs', 1, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean head to Oklahoma to investigate a recent spate of insect related deaths around a new housing development.', '\n      Nov. 8, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(554, 1, 'episode', 'Home', 1, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'When Sam starts to have nightmares about their old home, he and Dean head back to Kansas. They soon discover that the new owners of their old house are being plagued by a malevolent entity, could it be the same thing that killed their mother many years earlier?', '\n      Nov. 15, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(555, 1, 'episode', 'Asylum', 1, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean investigate an abandoned sanitarium and discover that when the hospital was open, the patients held a revolt against the cruel and unusual experimental treatments carried out by the head doctor. Now the ghosts roam the halls, driving anyone who spends the night insane. While trying to rescue two lost teenagers, Sam is captured and turns against Dean.', '\n      Nov. 22, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(556, 1, 'episode', 'Scarecrow', 1, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'While in a motel, Sam and Dean receive a call from their father, asking them to give up trying to find him and to take note of the names of three young couples that had disappeared in Indiana along the last three years, always on the second week of April. Sam decides to go after his father in California and leaves Dean, who arrives in the small town of Burkitsville for investigation of the missing couples. Sam meets the drifter Meg, who is also hitchhiking to California on the road, and stays with her waiting for a bus in the bus station. Dean discloses that a pagan ...', '\n      Jan. 10, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(557, 1, 'episode', 'Faith', 1, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'When Dean is accidentally electrocuted fighting a monster, he permanently damages his heart. When he''s diagnosed as only having a month, at most, to live, Sam searches for a means to save him and finds Roy Le Grange, a faith healer who may actually be the real deal. After Le Grange heals Dean, the brothers discover that Le Grange is using black magic to bind a "Reaper" to do his bidding... and each healing comes with a terrible price of someone else''s life.', '\n      Jan. 17, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(558, 1, 'episode', 'Route 666', 1, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Dean gets contacted by his first love, an African American woman, about racist murders that occur on a desert route, caused by a truck that seems driver-less', '\n      Jan. 31, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(559, 1, 'episode', 'Nightmare', 1, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam has a premonition in which a man is killed, but the murder is made to look like a suicide. Sam convinces Dean that they must investigate the case, but the two are puzzled when they fail to find anything that indicates that the death was supernatural in nature. That is, until they find out that Max, the reclusive son of the first victim, has been using his recently acquired power of telekinesis to kill the family members that once abused him. Sam also discovers Max''s mother was killed by the same fiery demon that took his own mom.', '\n      Feb. 7, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(560, 1, 'episode', 'The Benders', 1, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'After hearing in ''smallville'' Hibbing, while masquerading as Minnesota state police, a boy''s story about a monster probably was inspired by a Godzilla movie, Sam points out the county was marked by dad as suspicious and has the state''s highest ratio of disappearances, but Dean just wants to relax, at least till the morning, until Sam disappears on the parking lot. Dean teams up with local police woman Kathleen, who even after finding out they impersonated cops decides not to arrest him before Sam is found, because her own brother also disappeared years earlier. Their ...', '\n      Feb. 14, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(561, 1, 'episode', 'Shadow', 1, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Dean and Sam are investigating a mysterious murder in Chicago and discover that Meg is responsible for it. However, when they try to catch her, Meg unleashes shadow spirits on them and they realize that she is really setting a trap for their father.', '\n      Feb. 28, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(562, 1, 'episode', 'Hell House', 1, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean investigate the case of a maniacal ghost inhabiting a long abandoned Texas farmhouse known as "Hell House." They believe the ghost is the spirit of a deceased Depression-era farmer who killed his family, but they soon realize it is something far more powerful.', '\n      Mar. 30, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(563, 1, 'episode', 'Something Wicked', 1, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean investigate a small town in Wisconsin where children are falling into comas for no apparent reason. The brothers discover that a witch is creeping into the bedrooms of the children and stealing their "life force." While battling the witch, Dean recalls a past mistake that almost cost Sam his life at the hands of the very same witch, an event which has fueled Dean''s protectiveness over Sam and his blind obedience to his father.', '\n      Apr. 6, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(564, 1, 'episode', 'Provenance', 1, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'A young couple is murdered in their home shortly after buying an antique painting of a family portrait circa 1910. Upon reviewing the painting''s provenance, Sam and Dean learn that everyone who has ever bought the painting has been murdered and race to discover how the portrait is causing the deaths before it can claim its next victim.', '\n      Apr. 13, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(565, 1, 'episode', 'Dead Man''s Blood', 1, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'After Daniel Elkins, a vampire hunter and John''s mentor, is murdered, Sam and Dean are surprised when John himself shows up to solve the case. John discovers the vampires have taken an antique gun, which has the power to kill all supernatural beings. The Winchester family sets out to retrieve the gun from the vampires so they can use it to kill the demon that took Sam and Dean''s mother.', '\n      Apr. 20, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(566, 1, 'episode', 'Salvation', 1, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Meg turns to killing John''s friends in order to get the Colt. Sam and Dean stakeout the Demon''s next target; a family with a six month old baby showing signs of special abilities. John heads off alone to confront Meg.', '\n      Apr. 27, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(567, 1, 'episode', 'Devil''s Trap', 1, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=1&ref_=tt_eps_sn_1', 'Sam and Dean seek help from Bobby Singer, an old family friend in their mission to save their father from Meg. The brothers set a trap for Meg.', '\n      May 4, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(568, 1, 'episode', 'Exile on Main St.', 6, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'One year ago, Dean moved to Lisa''s house to live a normal, "apple-pie" life with Lisa and her son Ben, as recommended by Sam, working as a construction worker. One day, Dean finds scratches of Djinn in several places and he chases the supernatural being. When his is attacked by the Djinn, he is saved by Sam that tells him that he was released from hell one year ago and teamed-up with their Grandfather Samuel and three Campbells. Now Dean has to decide whether he wishes to leave Lisa and Ben to hunt demons again or stay with his regular life.', '\n      Sep. 24, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI2NjY4NDY0M15BMl5BanBnXkFtZTcwNjY0NTk3Mw@@._V1_SY180_CR3,0,120,180_.jpg'),
(569, 1, 'episode', 'Two and a Half Men', 6, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'When four families are killed and their babies are missing, Sam finds that a security company may be involved in the case and summons Dean to help him to bring the baby of a fifth slaughtered family to Samuel. However they are chased by a powerful shape shifter that wants the baby and they discover that the baby is a new breed.', '\n      Oct. 1, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjg0MTAxOTQwM15BMl5BanBnXkFtZTcwOTg1MzU5Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(570, 1, 'episode', 'The Third Man', 6, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Sam calls Dean and asks him to head to Easter, Pennsylvania, to investigate the mysterious and gore death of two police officers. They visit the police officer Toby Grey that had witnessed the death of his partner and they learn that the three police officers had killed a teenager and planted a gun to justify their action. Then Toby dies in front of the Winchester brothers. They summon Castiel and they learn that the police officers were killed by Moses'' staff. Further, Castiel tells that Heaven is chaotic and several lethal weapons have been stolen. They visit the ...', '\n      Oct. 8, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgxNzk4NDk2OF5BMl5BanBnXkFtZTcwMDA2MzU5Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(571, 1, 'episode', 'Weekend at Bobby''s', 6, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Bobby summons Crowley and finds that the demon has no intention of returning his soul and has given ten additional years of life for him. Meanwhile, Dean and Sam ask Bobby to advise which demon is killing people in Wisconsin, and after a long research, Bobby informs that is a Lamia. Then Rufus knocks on Bobby''s door with the corpse of a demon Okami to bury it. However the demon is still alive and Bobby has to seek it out and vanquish the demon. Dean and Sam travel to Scotland and help Bobby to get his soul back. When Bobby is ready to eat a slice of the peach cobbler ...', '\n      Oct. 15, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI0NjQ1NDA2MF5BMl5BanBnXkFtZTcwODA2MzU5Mw@@._V1_SY180_CR4,0,120,180_.jpg'),
(572, 1, 'episode', 'Live Free or Twihard', 6, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'When six teenage girls disappear in seven days in a small town, Dean and Sam investigate the case. They go to the house of the last girl that went missing, Kristen, and they find that the girl is a vampire fan. Sam hacks her notebook and finds that Kristen had a date with a weird guy in the Black Rose bar. The Winchester brothers go to the place and they discover that there are many vampires there. While fighting with a strong vampire, he forces Dean to drink his blood and Dean is turned into a vampire. Samuel tells that the only chance that Dean may have to become ...', '\n      Oct. 22, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzU2NzI1NjYwMF5BMl5BanBnXkFtZTcwNDg3NzEwNA@@._V1_SY180_CR1,0,120,180_.jpg'),
(573, 1, 'episode', 'You Can''t Handle the Truth', 6, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'After four suspicious suicides, Dean and Sam investigate the cases and they discover that the suicidal victims have heard painful truths before their final act. Their further investigation shows another death that might have been suicide. They visit the victim''s sister and they discover that she had invoked Veritas, the Goddess of Truth, who feeds of the victims of the truth. Soon Dean becomes her next victim and he uses his fate to question Sam about what has happened after his return from Hell. But when Veritas captures the Winchester brothers, they hear truths ...', '\n      Oct. 29, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI5Mzk5MDE1NV5BMl5BanBnXkFtZTcwMjc3NzEwNA@@._V1_SY180_CR69,0,120,180_.jpg'),
(574, 1, 'episode', 'Family Matters', 6, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Dean suspects Samuel and he joins his team with Sam to hunt the vampire Alpha. Dean sneaks out and sees Samuel capturing the Alpha and taking him in a van for interrogation. Sam plants a GPS in Samuel''s car to follow him with Dean and they discover that their grandfather wants to find out where purgatory is. The Alpha escapes and subdues Sam, but Dean vanquishes the Alpha injecting dead man blood in him. Out of the blue, Crowley appears and tells that he had brought Sam and Samuel back from Hell since he is powerful now. Further, Christian is a demon and Samuel is ...', '\n      Nov. 5, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(575, 1, 'episode', 'All Dogs Go to Heaven', 6, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Crowley bosses Dean and Sam and sends them to Buffalo, New York, to capture an Alpha werewolf that is killing people. Crowley would return Sam''s soul if they succeed and bring the Alpha to him. Soon they discover that the killer is actually a skinwalker posing as the family dog Lucky that loves his owners Mandy and her son. He kills those that threaten the family to protect them. Dean and Sam catch Lucky and they discover that there are thirty skinwalkers living as family dogs and ready to transform their families into an army of skinwalkers. Now Dean and Sam want to ...', '\n      Nov. 12, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(576, 1, 'episode', 'Clap Your Hands If You Believe', 6, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'When a fourth person vanishes in Elwood, Indiana, and the witnesses claim that they have been abducted by aliens, Dean and Sam head to the town to investigate the UFO sightings. They contact the father of the last victim, Mr. Brennan, who is a traditional watchmaker, and the Winchester brothers suspect that the man is hiding something. Dean and Sam interview people on the streets expecting to find a clue. Among the interviewees, they talk to UFO expert Wayne Whittaker Jr. and the apparently crazy Marion, who is an expert in fairies. While investigating the cornfield ...', '\n      Nov. 19, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1NzEwMzU2MF5BMl5BanBnXkFtZTcwMjM4MTgwNA@@._V1_SY180_CR75,0,120,180_.jpg'),
(577, 1, 'episode', 'Caged Heat', 6, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Dean and Sam are captured by Meg that wants to know Crowley''s hideout. Sam proposes to show where Crowley is provided she gets his soul back. The Winchester brothers asks the reluctant Samuel that has made a deal with Crowley to have his daughter Mary back but he finally points out the spot. Dean and Sam break in an old prison with Castiel, Meg and two other demons to seek out Crowley, but they are betrayed by Samuel. Castiel escapes, but Sam and Dean are arrested and Meg is tortured by Christian. Will that be the end of the quest of the Winchester brothers for Sam''s ...', '\n      Dec. 3, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(578, 1, 'episode', 'Appointment in Samarra', 6, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Dean goes to Dr. Robert to have a 3 minutes near-death experience to meet Death. They have a meeting and Death proposes Dean to wear his ring for 24 hours; in return, her would bring Sam''s soul back and put a wall to isolate his traumatic period in Hell. Dean plays Death with Tessa and soon he learns that the natural order cannot be violated. Meanwhile Sam summons Balthazar to have a spell to avoid having his soul back and he needs to kill Bobby for the spell work.', '\n      Dec. 10, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(579, 1, 'episode', 'Like a Virgin', 6, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Dean and Bobby investigate the disappearance of teenage girls when Sam awakes after recovering his mended soul. Bobby still does not trust Sam and Dean and his brother travel to investigate further. They find that the abducted girls are virgins and that dragons are the responsible for the kidnappings. Dean calls Bobby and he tells the name of a specialist that may teach them how to vanquish the dragon. While Sam searches where the dragon might be hidden, Dean visits Dr. Eleanor Visyak that tells him that he needs a blade forged with dragon blood. Dean borrows a piece ...', '\n      Feb. 4, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQxMDg5MzM0OV5BMl5BanBnXkFtZTcwNDY1NzkzNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(580, 1, 'episode', 'Unforgiven', 6, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Sam receives a text about the disappearance of four young women and together with Dean, they head to Bristol, Rhode Island, to investigate the case. Sam has flashbacks with recollections from the town and he partially remembers that he had been in the spot one year ago to investigate missing men, and he believes that the cases are connected. The mystery increases when Dean discovers that Sam had had love affairs with the missing girls. When Sam meets the widow Brenna Dobbs, whose husband Sheriff Roy Dobbs had also disappeared, he finally recalls Arachne''s case and ...', '\n      Feb. 11, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(581, 1, 'episode', 'Mannequin 3: The Reckoning', 6, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Dean and Sam travel to New Jersey to investigate a mysterious murder cases. However, Ben calls Dean and tells that it is an emergency situation and he heads to Lisa''s house, leaving Sam alone. Sam discovers that the victims had played a prank on their colleague Rose and their deaths might have been caused by her revengeful ghost. Meanwhile Dean also learns what the "emergency situation" reported by Ben is about.', '\n      Feb. 18, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(582, 1, 'episode', 'The French Mistake', 6, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'To protect Sam and Dean from a surprise attack from Raphael, Balthazar sends them both into an alternate universe where their lives are a TV show called "Supernatural".', '\n      Feb. 25, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk1NDcwNTIwNl5BMl5BanBnXkFtZTcwNzI2ODM2NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(583, 1, 'episode', 'And Then There Were None', 6, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'After a series of brutal murders, Dean, Sam and Bobby travel to investigate and they meet Rufus. They team-up and find that Eve, a.k.a. The Mother of All, is the responsible for the killings. When they find a clue of the location where she might be, they stumble with Samuel and Gwen that are also chasing Eve. Soon they learn that that Eve has created an evil worm that penetrates through the ear and force the victim to kill. Now they do not know who might have been possessed by the creature.', '\n      Mar. 4, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(584, 1, 'episode', 'My Heart Will Go On', 6, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'After a series of weird deaths in Chester, Pensylvannia, Dean and Sam discover that Balthazar has changed the history, avoiding the collision of the Titanic with an iceberg. Now Fate is intervening, murdering those that should never had died. The dilemma for the Winchester brothers is that Ellen and Jo are alive and if Castiel restores the time line, Elen and Jo will be gone. Further, Castiel advises Dean and Sam that Fate is angry with them and they need to kill her to survive.', '\n      Apr. 15, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUxODQ2Mzk5NF5BMl5BanBnXkFtZTcwODgwMTY5NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(585, 1, 'episode', 'Frontierland', 6, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Dean and Sam learn in Samuel Colt''s diary that ashes of a Phoenix may defeat Eve and they summon Castiel to send them back to 1861, to Sunrise, Wyoming, where they can meet Samuel Colt and get the ashes. Casteil gives twenty-four hours to the brothers to get what they want; otherwise their return may be dangerous. Will the brothers be well succeeded in their intent?', '\n      Apr. 22, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUyMDg3NDEzNV5BMl5BanBnXkFtZTcwODI1NTMwNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(586, 1, 'episode', 'Mommy Dearest', 6, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Lenore tells to Dean, Sam, Bobby and Castiel that Eve is in a small town in Oregon and they head to hunt her down. Soon they discover that the locals have been transformed in hybrid species of demons and Dean calls them "Jefferson Starships". When they meet the Mother of All, they discover a secret about Crowley.', '\n      Apr. 29, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMxMjc5MjM3Nl5BMl5BanBnXkFtZTcwMDY0MDExNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(587, 1, 'episode', 'The Man Who Would Be King', 6, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Castiel tells his story in his own words and confesses to some interesting choices.', '\n      May 6, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY4NzcyMDk0Nl5BMl5BanBnXkFtZTcwNjM3NDgxNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(588, 1, 'episode', 'Let It Bleed', 6, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Bobby tells Dean and Sam that Castiel has stolen the Moishe Campbell Diary, but he has a copy. They read the journal and discover that in 1937, H.P. Lovecraft had opened a gate to Purgatory with five worshipers of the devil. Meanwhile Crowley abducts Lisa and Ben to force Dean and Sam to step back. Sam summons Balthazar and the angel is surprised with the revelations about the partnership of Castiel with Balthazar. While Dean and Sam seek out Lisa and Ben, Bobby investigates what happened in 10 March 1937 and discovers the truth about his friend Ellie. Balthazar ...', '\n      May 20, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE0Mjc3MDk5MV5BMl5BanBnXkFtZTcwNDgwMjkyNQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(589, 1, 'episode', 'The Man Who Knew Too Much', 6, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=6&ref_=tt_eps_sn_6', 'Sam wanders with amnesia and chased by the police. While he tries to remember who he is, Dean and Bobby watch Sam that is in coma lying on a bed in Bobby''s safe house. Dean and Bobby drive to the location where Castiel is; however, Crowley arrives with his new partner Gabriel and requests the blood of the Demon from the Purgatory to open the gate. Meanwhile Sam wakes-up and heads to meet Dean and Bobby.', '\n      May 20, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjExOTgyNzY0MF5BMl5BanBnXkFtZTcwMDAxMjkyNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(590, 1, 'episode', 'Meet the New Boss', 7, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Castiel believes he is the new God and becomes obsessed with power. Sam, Dean, and Bobby try to find a way to stop him before he explodes with power, even if that means talking to Death himself.', '\n      Sep. 23, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEwMDMwNjE0OF5BMl5BanBnXkFtZTcwNjk4MjA4Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(591, 1, 'episode', 'Hello, Cruel World', 7, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'The leviathans destroy Castiel''s body and break loose. Now Sam, Dean, and Bobby have to track them all down. Meanwhile, Sam is beginning to struggle with what is real and what is an hallucination.', '\n      Sep. 30, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTAzNjg2MTQ3NV5BMl5BanBnXkFtZTcwNzc4MjA4Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(592, 1, 'episode', 'The Girl Next Door', 7, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam reunites with a childhood girlfriend who is supposedly preying on human brains.', '\n      Oct. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAyMTQwMTE1Nl5BMl5BanBnXkFtZTcwMzU5ODg4Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(593, 1, 'episode', 'Defending Your Life', 7, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean investigate murders of people who have their guilty pasts come back and kill them. Could Dean be next?', '\n      Oct. 14, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(594, 1, 'episode', 'Shut Up, Dr. Phil', 7, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean get caught in the middle of a feud between a married witch couple.', '\n      Oct. 21, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE5Njk3ODc1Ml5BMl5BanBnXkFtZTcwNzQwNjE5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(595, 1, 'episode', 'Slash Fiction', 7, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Two Leviathans are impersonating Sam and Dean and going on a killing spree. Now, Sam and Dean are the most wanted criminals in the country.', '\n      Oct. 28, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzNzE2OTc1OV5BMl5BanBnXkFtZTcwNTI0Njc5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(596, 1, 'episode', 'The Mentalists', 7, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean investigate the murders of mediums in Lily Dale, the most "psychic" town in America. They discover that an angry spirit is killing off the psychics, but in a town full of people who claim to be summoning spirits, they have a little trouble identifying the medium controlling the ghost.', '\n      Nov. 4, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE0NDYxNzUzMl5BMl5BanBnXkFtZTcwNjA4MTEwNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(597, 1, 'episode', 'Season Seven, Time for a Wedding!', 7, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam runs into Becky and they end up getting married. Dean finds it suspicious that Sam is falling for her and decides to investigate.', '\n      Nov. 11, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIzMzA0NTUzM15BMl5BanBnXkFtZTcwMzAyMDQwNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(598, 1, 'episode', 'How to Win Friends and Influence Monsters', 7, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Something is turning all of the people of a small town in New Jersey into cannibals.', '\n      Nov. 18, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(599, 1, 'episode', 'Death''s Door', 7, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Bobby is close to dying. He must confront his worst memory to escape, before his reaper catches up to him.', '\n      Dec. 2, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDMwMjI5MTM2OF5BMl5BanBnXkFtZTcwOTc2NzExNw@@._V1_SY180_CR67,0,120,180_.jpg'),
(600, 1, 'episode', 'Adventures in Babysitting', 7, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'While Dean and Frank try to figure out the numbers from Bobby''s clue, Sam tries to help a young girl search for her missing father.', '\n      Jan. 6, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA0MjYzNDg4MDNeQTJeQWpwZ15BbWU3MDIwMjkyMjc@._V1_SY180_CR67,0,120,180_.jpg'),
(601, 1, 'episode', 'Time After Time', 7, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'After attacking Chronos, the time god, Dean is sent back to 1944.', '\n      Jan. 13, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcwNzQxNzA4OV5BMl5BanBnXkFtZTcwMTQ5ODUyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(602, 1, 'episode', 'The Slice Girls', 7, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean go up against the Amazons as they go on a killing spree. But it''s twice as difficult for Dean because one of them is his daughter.', '\n      Feb. 3, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkyNjUwOTI1Nl5BMl5BanBnXkFtZTcwMDUwMjUzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(603, 1, 'episode', 'Plucky Pennywhistle''s Magical Menagerie', 7, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean are stumped. Somehow, a group of children''s personal fears are becoming a reality and killing off a parent that each child has a certain hatred for.', '\n      Feb. 10, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzMTEzODcxMF5BMl5BanBnXkFtZTcwNTA0NTgzNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(604, 1, 'episode', 'Repo Man', 7, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Four years ago, Sam and Dean exorcised a demon serial killer. Now he''s back for revenge.', '\n      Feb. 17, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTg3NDMzNDg0NV5BMl5BanBnXkFtZTcwODE1NjE0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(605, 1, 'episode', 'Out with the Old', 7, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'After a ballerina is found dead from dancing herself to death, Sam and Dean look into the case and discover the ballet slippers she wore were cursed. When Dean accidentally touches the shoes the power of the curse starts to take hold of him.', '\n      Mar. 16, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAyOTQwODY2MV5BMl5BanBnXkFtZTcwMDA0NTQ1Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(606, 1, 'episode', 'The Born-Again Identity', 7, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Lucifer is driving Sam into madness. Desperate to save him, Dean tries to find someone who can help. He finds Castiel with amnesia, instead.', '\n      Mar. 23, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0NDE3OTM4OV5BMl5BanBnXkFtZTcwNzYyMDg1Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(607, 1, 'episode', 'Party On, Garth', 7, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Garth calls Sam and Dean for assistance in battling a ghost that you can only see when drunk.', '\n      Mar. 30, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg3NjM2MDk3OF5BMl5BanBnXkFtZTcwNjg5MDE2Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(608, 1, 'episode', 'Of Grave Importance', 7, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Bobby''s spirit tries to help Sam and Dean as they try to find a missing friend inside a haunted house.', '\n      Apr. 20, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA5MDY2OTQ2MDBeQTJeQWpwZ15BbWU3MDQ1MjI5Njc@._V1_SX120_CR0,0,120,180_.jpg'),
(609, 1, 'episode', 'The Girl with the Dungeons and Dragons Tattoo', 7, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean discover that Frank''s hard drive, containing everything on the leviathans, is now in Dick''s company building. To retrieve it, they ask for help from one of the employees, a young computer hacker.', '\n      Apr. 27, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI2OTQzNjc2MV5BMl5BanBnXkFtZTcwOTg2MjI3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(610, 1, 'episode', 'Reading is Fundamental', 7, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean have possession of a Word of God, but are unable to read it. They find a young prophet that can help, but unfortunately, the angels and leviathans are after him, too.', '\n      May 4, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg1OTg4NzM5MV5BMl5BanBnXkFtZTcwMzAzMzQ3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(611, 1, 'episode', 'There Will Be Blood', 7, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'To officially kill the leviathans, Sam and Dean need the blood of an Alpha. But Dick knows what the Winchesters are up to and sends his men after them.', '\n      May 11, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ0NTA1NjQ0Ml5BMl5BanBnXkFtZTcwODU3OTg3Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
(612, 1, 'episode', 'Survival of the Fittest', 7, 23, 'http://www.imdb.com/title/tt0460681/episodes?season=7&ref_=tt_eps_sn_7', 'Sam and Dean make a plan to storm Dick''s company building and kill him once and for all, with help from Castiel and Meg. Providing Bobby doesn''t get to Dick first.', '\n      May 18, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3MTY1MzI2NV5BMl5BanBnXkFtZTcwOTY3OTg3Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
(613, 1, 'episode', 'Lazarus Rising', 4, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam tries to move on without his brother and becomes hardened and more reckless in the way he hunts. Bobby and his psychic friend Pamela try to contact the other side to find out more about Dean''s ultimate fate.', '\n      Sep. 18, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAyMjAwNTk5OV5BMl5BanBnXkFtZTcwOTk3NzU5MQ@@._V1_SY180_CR100,0,120,180_.jpg'),
(614, 1, 'episode', 'Are You There, God? It''s Me, Dean Winchester', 4, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'The Winchesters and Bobby Singer encounter the angry spirits of people they couldn''t save.', '\n      Sep. 25, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3NTk5NDc5Nl5BMl5BanBnXkFtZTcwOTc3OTU5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(615, 1, 'episode', 'In the Beginning', 4, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Castiel sends Dean back in time to 1973 where he encounters younger versions of his parents and for the first time meets his grandfather Samuel Campbell who holds a secret that sheds a light on the Winchester Family''s connection to the hunter community.', '\n      Oct. 2, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg1MDM4ODUxMV5BMl5BanBnXkFtZTcwMDg4MTc5MQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(616, 1, 'episode', 'Metamorphosis', 4, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'A hunter named Travis points Sam and Dean towards a meat eating creature called a Rugaru. Complicating matters is the fact that Travis''s target is a normal suburban dad in the earlier process of changing and he hasn''t killed anyone yet.', '\n      Oct. 9, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkwMzE4MzYxOV5BMl5BanBnXkFtZTcwMzAyMDg5MQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(617, 1, 'episode', 'Monster Movie', 4, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'It''s Halloween time and the Winchesters face-off against a shapeshifter with a penchant for impersonating classic movie monsters like Dracula, the Wolfman, and the Mummy.', '\n      Oct. 16, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwMzIxNzIwNl5BMl5BanBnXkFtZTcwMTIyMDg5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(618, 1, 'episode', 'Yellow Fever', 4, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam and Dean discover a Colorado small town''s darkest secret as a wave of people fall prey to a "ghost sickness" that induces fear, paranoia, and ultimately a fatal heart attack. Sam and Bobby must figure out the cause and cure of the sickness when Dean himself falls prey to it.', '\n      Oct. 23, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(619, 1, 'episode', 'It''s the Great Pumpkin, Sam Winchester', 4, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Investigating two mysterious deaths in a small town, Sam and Dean discover a witch is sacrificing people to summon a dangerous demon.', '\n      Oct. 30, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUyMzQ0NzUxOF5BMl5BanBnXkFtZTcwMTczNjEwMg@@._V1_SY180_CR0,0,120,180_.jpg'),
(620, 1, 'episode', 'Wishful Thinking', 4, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam and Dean investigate when a small town''s wishing well actually starts to grant the people''s wishes.', '\n      Nov. 6, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(621, 1, 'episode', 'I Know What You Did Last Summer', 4, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam, Dean, and Ruby discover the existence of a female prophet named Anna Milton, who can hear the voices of angels and thus figures into the plans of a demon named Alastair who wants to use her as a tool against the angels.', '\n      Nov. 13, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzY5MjMyMTYzNl5BMl5BanBnXkFtZTcwOTU1OTUwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(622, 1, 'episode', 'Heaven and Hell', 4, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Dean and Sam figure out why Castiel and his superior/handler, Uriel the Angel of Death, want Anna Milton dead when the three of them are forced to go on the run, not only from heavenly and vengeful angels, but from Alastair and his demon minions who also try to track down Sam, Dean, and Anna. With the assistance from the now-blind soothsayer, Pamela Barnes, they discover that ''Anna'' is a fallen (former) angel and needs to seek her grace wings before the forces of both Heaven and Hell find them.', '\n      Nov. 20, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(623, 1, 'episode', 'Family Remains', 4, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'The Winchesters try to stop a family from moving into a haunted house.', '\n      Jan. 15, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcyODE3NTYxM15BMl5BanBnXkFtZTcwMjg1ODUyMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(624, 1, 'episode', 'Criss Angel Is a Douche Bag', 4, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam and Dean investigate the activities of a trio of magicians who are using a grimoire to execute real feats of magic.', '\n      Jan. 22, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(625, 1, 'episode', 'After School Special', 4, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam and Dean investigate a haunting at one of their old high schools where we will see what school was like for the brothers.', '\n      Jan. 29, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU5NTUxNTkzOV5BMl5BanBnXkFtZTcwNzkwMDkyMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(626, 1, 'episode', 'Sex and Violence', 4, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'The Winchester''s investigation into a series of deaths takes a deadly turn when a siren tries to tear them apart for good.', '\n      Feb. 5, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg1NDEyNzg3M15BMl5BanBnXkFtZTcwMTgwMjAzMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(627, 1, 'episode', 'Death Takes a Holiday', 4, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam and Dean try to find out why people in a small town are having near death experiences with alarming frequency by going into the spirit world.', '\n      Mar. 12, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY4MjQ3MTk4OF5BMl5BanBnXkFtZTcwMjE4ODkzMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(628, 1, 'episode', 'On the Head of a Pin', 4, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Castiel and Uriel ask Dean to torture Alastair for information. But when Alastair breaks free, Castiel starts to believe that there is a traitor among the angels.', '\n      Mar. 19, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4NTE5MjU3Ml5BMl5BanBnXkFtZTcwODY1NTE0Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(629, 1, 'episode', 'It''s a Terrible Life', 4, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'In an alternate reality mysteriously created as if Sam and Dean where never brothers and have never met, Sam and Dean work at a marketing office where they are forced to team up with one another when a series of mysterious suicides point to a ghost haunting the premises.', '\n      Mar. 26, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(630, 1, 'episode', 'The Monster at the End of This Book', 4, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'An author has been writing books about Sam and Dean since 2005. Sam and Dean try to figure out how he knows so much about them.', '\n      Apr. 2, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIwNjg0OTA1OV5BMl5BanBnXkFtZTcwODIzNzQ0Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(631, 1, 'episode', 'Jump the Shark', 4, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam and Dean are contacted by one Adam Milligan who claims to be John Winchester''s son. The boys immediately suspect a demon trap and go to investigate. Adam turns out to legitimately be John''s son and Dean is furious that John kept Adam''s existence from them as well as sheltered Adam from the hunting life. Meanwhile other supernatural forces are at work, which lead to a tragic twist that neither Sam, Dean, or their new sibling could have guessed.', '\n      Apr. 23, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk1NjA4OTc5MF5BMl5BanBnXkFtZTcwNjUzNTk0Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(632, 1, 'episode', 'The Rapture', 4, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Castiel has been sent back to Heaven. His human host, Jimmy, tries to regain his life. But the demons won''t leave him alone and now his family is at risk. Sam and Dean can help a little, but they''re going to need a "miracle" to win.', '\n      Apr. 30, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzc1ODM3NzI1NV5BMl5BanBnXkFtZTcwMzI0NTk0Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(633, 1, 'episode', 'When the Levee Breaks', 4, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'Sam is becoming more and more inhuman. Dean and Bobby put him in the safe hold until he gets over his addictions. After Sam escapes with help, unknown to him, from Castiel, he finds Ruby and begins to feed once again. Dean begins to truly believe that the old Sam is gone for good.', '\n      May 7, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(634, 1, 'episode', 'Lucifer Rising', 4, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=4&ref_=tt_eps_sn_4', 'When the last few of the 66 Seals are broken by Lilith''s minions, Sam and Dean prepare for the big and probably futile fight in very different ways. Sam joins Ruby on a final attempt to kill Lilith before Lucifer rises, while Castiel and Zachariah tell Dean that it''s time to play his part in stopping Lucifer.', '\n      May 14, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwMDYxMDE0OV5BMl5BanBnXkFtZTcwNTgwODU1Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(635, 1, 'episode', 'Sympathy for the Devil', 5, 1, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'In the aftermath of the Devil rising, Sam and Dean are whisked away and they are given a message from Chuck Shurley that Castiel is dead and that Luficer walks the Earth. As a result, Sam and Dean turn to Bobby for help to find a mystical weapon, called Michael''s Sword. This will enable them to find the Devil before he takes on a new form to bring the slow end of the world. But the Winchester brothers are pitted against the archangel Zachariah who has plans for Dean, as well as more demons. Sam and Dean recognise a demon, Meg, who has returned from Hell.', '\n      Sep. 10, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI0ODA5NDA0Nl5BMl5BanBnXkFtZTcwNDc4NTk3Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(636, 1, 'episode', 'Good God, Y''All', 5, 2, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'An old friend of Bobby''s calls, panicked about demons attacking his town. Sam and Dean arrive and everything appears exactly as they had expected. As time progresses they realize there is more than they bargained for.', '\n      Sep. 17, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkwOTkwMjc0N15BMl5BanBnXkFtZTcwMzc1MDQ4Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(637, 1, 'episode', 'Free to Be You and Me', 5, 3, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Not sure he trusts himself, Sam decides to give up hunting and goes off on his own. But that night, a late-night visitor tells Sam that he won''t let him off the hook that easily. Dean, intent on stopping the Apocalypse, continues hunting on his own and teams up with Castiel to find the Archangel Raphael since Castiel believes Raphael knows the location of God''s vessel on Earth.', '\n      Sep. 24, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY0ODgzNzA1M15BMl5BanBnXkFtZTcwMzM2MDY4Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(638, 1, 'episode', 'The End', 5, 4, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean awakens five years in the future in an abandoned city and is attacked by humans infected with a demonic virus that makes them mindless, flesh-eating zombies. Zachariah soon appears and explains to Dean that the world he sees is the result of his refusal to help the angels fight Lucifer.', '\n      Oct. 1, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgwMDI3MDIzMV5BMl5BanBnXkFtZTcwMjU2MDY4Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(639, 1, 'episode', 'Fallen Idols', 5, 5, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Sam and Dean decide to start hunting together again and their first case leads them to a small town whose inhabitants are being killed by famous dead icons like Abraham Lincoln and James Dean, etc. Once they discover Paris Hilton has been involved in demonic crimes too, they don''t know what to believe anymore.', '\n      Oct. 8, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI5NzM1OTY1NV5BMl5BanBnXkFtZTcwOTU3NTk4Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(640, 1, 'episode', 'I Believe the Children Are Our Future', 5, 6, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Sam and Dean investigate a series of odd murders that strangely resemble fairy tales and urban legends. The brothers track down an 11-year-old boy named Jesse, and realize that whatever Jesse believes is coming true. Castiel appears again and tells Sam and Dean that Jesse is a serious threat and needs to be eliminated which deeply disturbers and divides them since it is against the Winchester brother''s custom of killing a human.', '\n      Oct. 15, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQzNTk4OTkyNF5BMl5BanBnXkFtZTcwNTY2NjI5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(641, 1, 'episode', 'The Curious Case of Dean Winchester', 5, 7, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Sam and Dean discover that a witch is running a high-stakes poker game where the currency is life years vs. money. Bobby sees the game as a chance to get out of the wheelchair and bets 25 years, but loses. As Bobby begins to age rapidly, Dean steps in to save him but also ends up turning into an old man, leaving Sam holding the only hopes for their survival.', '\n      Oct. 29, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU3MDAyODU3OF5BMl5BanBnXkFtZTcwMjc2NjI5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(642, 1, 'episode', 'Changing Channels', 5, 8, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Sam and Dean catch up with the Trickster, who sends them through a dizzying montage of TV show parodies, inviting them to play along with their "roles" or be stuck in "TV Land" forever. But once Castiel shows up, the boys get an idea as to what the Trickster might be hiding and eventually come up with a surprising answer.', '\n      Nov. 5, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc1NzMxNTQ5N15BMl5BanBnXkFtZTcwOTc2NjI5Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(643, 1, 'episode', 'The Real Ghostbusters', 5, 9, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean and Sam are on a Supernatural convention where they meet lots of fans of the Supernatural Comic Books. After a while they get the impression that something is not right at the location of the convention.', '\n      Nov. 12, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1NzI0MjkyNl5BMl5BanBnXkFtZTcwMDkxNzg5Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(644, 1, 'episode', 'Abandon All Hope', 5, 10, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean and Sam get to know the whereabouts of Lucifer and want to hunt him down. But Lucifer is well prepared and is working his own plans.', '\n      Nov. 19, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4Mjc0Mjk1MF5BMl5BanBnXkFtZTcwOTA4NTAwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(645, 1, 'episode', 'Sam, Interrupted', 5, 11, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'When a former hunter calls Sam and Dean for help from inside a mental institution, the brothers get themselves admitted as patients to check out his claims of supernatural phenomena. When their incarceration pushes them both to the breaking point their personal issues send them over the edge.', '\n      Jan. 21, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(646, 1, 'episode', 'Swap Meat', 5, 12, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'In Massachusetts, seventeen year-old nerd Gary uses witchcraft to swap bodies with Sam. Gary has lots of fun with the sexy Crystal and following Dean, who is hunting the witch Maggie Briggs. Meanwhile, Sam is trapped in the body of the teenager and trying to find out how Gary had succeeded in the black magic, and also trying to communicate with Dean. When Sam meets Gary''s friends Trevor and Nora, he discovers that the intention of the teenagers that are playing a deadly game with the witchcraft.', '\n      Jan. 28, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(647, 1, 'episode', 'The Song Remains the Same', 5, 13, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'The renegade angel Anna escapes from her prison in heaven. She travels back in time to kill Sam and Dean''s parents so that Sam is never born, and cannot be the vessel for Lucifer. Castiel sends Sam and Dean back to stop Anna.', '\n      Feb. 4, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BODE2MTAyMjY4MF5BMl5BanBnXkFtZTcwNDMwODMxMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(648, 1, 'episode', 'My Bloody Valentine', 5, 14, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'A couple of days before Valentines Day, two valentines devour each other. On the next day, two lovers commit suicide. Dean and Sam investigate the murders and summon Castiel to help them. Castiel tells that the responsible is a cupid that has gone nuts. The angel brings the cupid and they conclude that he is innocent. When Sam feels hunger for demon blood, they discover that the local population has been attacked by Famine, one of the Four Horsemen of the Apocalypse.', '\n      Feb. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA3MjQwNDY5NF5BMl5BanBnXkFtZTcwMDQ4MTgxMw@@._V1_SY180_CR67,0,120,180_.jpg'),
(649, 1, 'episode', 'Dead Men Don''t Wear Plaid', 5, 15, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Sam and Dean investigate Bobby''s home town where the dead are rising from the grave but instead of attacking humans, they are happily reuniting with their families. The brothers turn to Bobby for help but he tells them not to worry about it and to leave town. Suspicious, Dean investigates and comes face to face with Bobby''s dead wife who has no memory of what happened to her. Once the zombies start turning evil, the boys tell Bobby he has to kill his wife but he refuses.', '\n      Mar. 25, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI4MTA0NDU5NV5BMl5BanBnXkFtZTcwNjQwOTUyMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(650, 1, 'episode', 'Dark Side of the Moon', 5, 16, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean and Sam are killed by the hunters Walt and Roy. The awake in heaven and Castiel contacts Dean and asks him to seek out the angel Joshua. Meanwhile Zachariah is chasing them in Heaven to force Dean to be Michael''s vessel.', '\n      Apr. 1, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE2NDgyNjI3Ml5BMl5BanBnXkFtZTcwNTAwMDEzMw@@._V1_SY180_CR75,0,120,180_.jpg'),
(651, 1, 'episode', '99 Problems', 5, 17, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean and Sam are saved on the road from a demon attack by a group of citizens from Blue Earth, a small town in Minnesota. They discover that the pastor''s daughter Leah Gideon has visions with the angels and tells them where the demons are. Their followers believe that the will live in Paradise on Earth after the Apocalypse. Sam calls Castiel and when he arrives, they discover the truth about Leah.', '\n      Apr. 8, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(652, 1, 'episode', 'Point of No Return', 5, 18, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean has decided to say yes to Zachariah and Michael to stop Lucifer and avoid the Apocalypse. However, Castiel brings their half-brother Adam, who is the Plan B for the angels. Zachariah lures Adam about the feelings of the Winchester brothers, forcing Dean, Sam and Castiel to fight against several angels to rescue Adam.', '\n      Apr. 15, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNzQwMTgyNzUzMV5BMl5BanBnXkFtZTcwNjUyNzQzMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(653, 1, 'episode', 'Hammer of the Gods', 5, 19, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'While driving through the road, Dean and Sam stop for the night in a remote four-star hotel. Soon they learn that Kali, Baldur, Odin and other pagan gods have kidnapped the guests to eat them and dean and Sam to summon Lucifer and avoid the Apocalypse. Out of the blue, Gabriel arrives in the spot to warn Kali and the other gods that Lucifer will destroy them; however, it is too late sin Lucifer has just arrives in the hotel.', '\n      Apr. 22, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzIzMjUxM15BMl5BanBnXkFtZTcwNTgwODUzMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(654, 1, 'episode', 'The Devil You Know', 5, 20, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean and Sam are heading east in their Impala tracking down a swine flu outbreak. Out of the blue, the cunning demon Crowley appears in their car and offers to help them to find the last two Horsemen to get their rings. Crowley explains to the reluctant brothers that he wants Lucifer trapped and he knows a demon that can tell the location of Pestilence. Dean heads with Crowley to the Niveus Pharmaceuticals, and they abduct the demon Brady, who had studied with Sam and was his friend. Crowley unsuccessfully interrogates Brady; however, when they hear a hell hound ...', '\n      Apr. 29, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3MDI3MjkyMF5BMl5BanBnXkFtZTcwOTEyNDI0Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(655, 1, 'episode', 'Two Minutes to Midnight', 5, 21, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Dean has an argument with Sam that wants to say "yes" to Lucifer to trap him. However, they go to the Serenity Valley Convalescent Home where Pestilence is and they are defeated by the Horseman. Out of the blue, Castiel appears and gets his ring. Bobby sells his soul to Crowley to get the information of where Death is. Crowley recovers Bobby and makes him walk. Dean, Sam, Bobby, Castiel and Crowley head to Chicago to meet Death. Bobby, Castiel and Sam find that Niveus Pharmaceuticals will supply vaccines with the Croaton virus. When Dean sees Death in a pizzeria, the ...', '\n      May 6, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg3MzE4MjA1MF5BMl5BanBnXkFtZTcwOTIyNDI0Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(656, 1, 'episode', 'Swan Song', 5, 22, 'http://www.imdb.com/title/tt0460681/episodes?season=5&ref_=tt_eps_sn_5', 'Sam goes with Dean to Lucifer''s place and accepts to be his vessel, expecting to lure the cunning being and trap him with the four Horsemen''s ring. However Lucifer is smarter and uses his son''s vessel instead to fight against Michael that is using Adam''s vessel. Dean discovers the place of the final battle with Chuck in an old cemetery in Lawrence and he heads to the place in his Impala with Bobby and Castiel. Will Dean be able to avoid the inevitable?', '\n      May 13, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEyOTM4OTIwN15BMl5BanBnXkFtZTcwMDg2OTU0Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(657, 6, 'episode', 'The Return', 2, 1, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Elena arrives home to a nightmare as she discovers Uncle John''s and Jeremy''s fate. At the hospital, Sheriff Forbes is comforted by Matt, Bonnie and Damon while she waits to hear if Caroline will survive the car accident. After a confusing conversation with Elena about the night''s events, Damon is the first to realize that Katherine has returned. Katherine''s arrival sends Stefan and Damon on a path to find out what she wants, why she''s back, and how much of a threat she is to the people they love. Meanwhile, still reeling from his father''s death, Tyler is surprised ...', '\n      Sep. 9, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkyNzgyMDYzOV5BMl5BanBnXkFtZTcwMzk1NDc3Mw@@._V1_SY180_CR65,0,120,180_.jpg'),
(658, 6, 'episode', 'Brave New World', 2, 2, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'When a confused and desperate Caroline leaves the hospital and joins her friends at the Mystic Falls Carnival, Damon wants to take immediate action, but Stefan and Elena come to Caroline''s defense. Matt is completely mystified by Caroline''s behavior, but still tries to tell her about his feelings for her. Damon has suspicions about Tyler''s Uncle Mason and uses Tyler''s volatile personality in an attempt to get Mason to reveal his secret. Upset with everything going on around her, Bonnie takes her anger out on Damon.', '\n      Sep. 16, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgyNzgwNDM3OV5BMl5BanBnXkFtZTcwOTc2Njk4Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(659, 6, 'episode', 'Bad Moon Rising', 2, 3, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'While interacting with big cousin Mason, Tyler discretely looks for his part in dark family secrets. After a campfire party in the wood Mason made shift away from the Lockwood estate, Tyler follows him into the ruin basement. Mason, who chained himself up there, has to flee and transform into a werewolf in the car. After saving Matt who was bitten by self control-deficient novice vampire Caroline, Stefano is in those woods, fearing lycanthropes as vampires'' natural enemies. Damon is not amused how Elena plays him an eventful trip with Alaric to Duke University to ...', '\n      Sep. 23, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMyMzAwNzA0OF5BMl5BanBnXkFtZTcwMjU3Njk4Mw@@._V1_SY180_CR62,0,120,180_.jpg'),
(660, 6, 'episode', 'Memory Lane', 2, 4, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Stefan is shocked that Katherine appears again to him as her and scares Elena, claiming she loves him and wants him back. He tricks Katherine to be chained and is prepared to torture her with verbena, but she proves prepared and continues her story how she tricked and betrayed the Salvatores, the Lockwoods and hence both vampires and werewolves. Mason proves himself a dangerous adversary to Damon and resists telling Tyler about the family curse, but finally sneers it''s triggered irreversibly by homicide. Matt is totally turned off by Caroline.', '\n      Sep. 30, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg5NzEzOTcxM15BMl5BanBnXkFtZTcwNTY3Njk4Mw@@._V1_SY180_CR2,0,120,180_.jpg'),
(661, 6, 'episode', 'Kill or Be Killed', 2, 5, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Mason earns the moonstone by telling Tyler how his Lockwood vampire curse was triggered in his student days by an accidentally fatal brawl escalation on a spring-break Miami excursion, all orchestrated by Kathryn, but leaves out that he''s in league with her. Jeremy becomes mates again with lonely Tyler. The Salvatore brothers get trapped in a forest ruin by the sheriff after Mason convinces her that Damon is a vampire. Caroline exposes herself to save them.', '\n      Oct. 7, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU2OTE2NzY3NF5BMl5BanBnXkFtZTcwMDkyMzU5Mw@@._V1_SY180_CR2,0,120,180_.jpg'),
(662, 6, 'episode', 'Plan B', 2, 6, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Despite Elena''s efforts to keep Jeremy safe, he offers to help Damon and Alaric deal with Katherine. Sheriff Forbes and Caroline share a few rare moments of quality mother/daughter time. Bonnie accidentally discovers new information about Mason and shares it with Stefan leading Damon to take matters into his own hands.', '\n      Oct. 21, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMwNjUzMTYyMF5BMl5BanBnXkFtZTcwOTI2NTMwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(663, 6, 'episode', 'Masquerade', 2, 7, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Stefan and Damon decide on a new plan to deal with Katherine at the Lockwood''s masquerade ball. Katherine calls on an old friend, Lucy, to attend the ball with her. Bonnie, Jeremy and Alaric all do what they can to help Stefan and Damon, but Katherine has a surprise planned that none of them could foresee. Things take an ugly turn when Matt and Tyler start doing shots with their friends.', '\n      Oct. 28, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwMjY5MzE4N15BMl5BanBnXkFtZTcwNDQ2NTMwNA@@._V1_SY180_CR74,0,120,180_.jpg'),
(664, 6, 'episode', 'Rose', 2, 8, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'After the masquerade, Elena is abducted to a stately, desolate country estate by ancient vampires Trevor and Rose. Jeremy is first to notice her absence, so Stefan sets out on a rescue with Damon after Bonnie magically locates Elena. Tyler realizes Caroline is supernatural too, but doesn''t figure out the exact truth. The Salvatore brothers arrive after the ancient duo has welcomed Elijah, one of the original European vampires, who concludes a gruesome deal.', '\n      Nov. 4, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkxMDQwNzk5MF5BMl5BanBnXkFtZTcwNzE5NTYwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(665, 6, 'episode', 'Katerina', 2, 9, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Elena puts herself in a dangerous position as she searches for the truth about Katherine''s past and what her own future may hold. Knowing that Stefan would never agree to her plan, Elena swears Caroline to secrecy. Damon uses a new-found confidant to help him try to discover the real purpose and power of the moonstone. Jeremy and Bonnie meet Luka, a new student with a surprising family history.', '\n      Nov. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjEzODQ2NjA0OF5BMl5BanBnXkFtZTcwMTEzOTgwNA@@._V1_SY180_CR75,0,120,180_.jpg'),
(666, 6, 'episode', 'The Sacrifice', 2, 10, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Elena decides to take matters into her own hands and offers a tempting incentive to Rose for her help. When things take an unexpected turn, however, Rose calls on Damon to deal with the plan Elena has set in motion. Jeremy''s reckless attempt to help Bonnie retrieve the moonstone lands him in a life-threatening position and forces Stefan to put himself in danger. Bonnie and Luka form a closer connection. Tyler shows Caroline the Lockwood cellar, where she makes a discovery that leaves them both terrified.', '\n      Dec. 2, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(667, 6, 'episode', 'By the Light of the Moon', 2, 11, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'As the full moon approaches, Caroline helps Tyler prepare for the transformation he is powerless to stop. While Stefan and Katherine play mind games on one another, Damon and Alaric are suspicious when a stranger named Jules shows up in Mystic Falls, searching for her missing friend, Mason. Elena is frustrated at the lengths Jeremy and her friends have gone to in order to keep her safe. Bonnie and Luca work together on a spell, while still keeping secrets from one another. Finally, Elijah makes an unexpected appearance with an offer that could change everything.', '\n      Dec. 9, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA1MDg4NjQzMzVeQTJeQWpwZ15BbWU3MDgzNzA4MTQ@._V1_SY180_CR72,0,120,180_.jpg'),
(668, 6, 'episode', 'The Descent', 2, 12, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Stefan has his own ideas about Elena''s new plan for the future. While Damon tries to get the truth out of Jules, he asks Elena to keep an eye on Rose, a situation that turns unexpectedly dangerous. Caroline and Matt try to be honest about their feelings for one another, and Tyler''s reaction to Caroline''s generosity comes as a surprise to her. Damon struggles to hide his true feelings when a life-and-death crisis hits him harder than he expected.', '\n      Jan. 27, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE2NjcwMTc1Nl5BMl5BanBnXkFtZTcwNTgxNTkzNA@@._V1_SY180_CR2,0,120,180_.jpg'),
(669, 6, 'episode', 'Daddy Issues', 2, 13, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Johnathan Gilbert''s return to Mystic Falls comes as an unhappy surprise to Elena, Jenna and Damon. Caroline lets Stefan know about her conversation with Tyler, and Stefan does his best to reach out to a confused and conflicted Tyler. Jeremy comforts Bonnie after her disturbing conversation with Jonas. When Jules takes a hostage, the situation quickly escalates into a violent confrontation.', '\n      Feb. 3, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE1NTU0MzYxOF5BMl5BanBnXkFtZTcwNTE5MjI0NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(670, 6, 'episode', 'Crying Wolf', 2, 14, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Stefan accepts to spend a quality time weekend with Elena in the Gilbert lake cabin, where they find the missing diaries. Back home, Damon attends a historical society function to meet Elijah and is captured by surprise by Elijah''s acolytes but survives torture until he can escape, while Elijah finds the moon stone anyhow. Tyler is recruited for the werewolves pack''s cause to reverse the moon spell, but won''t subscribe to the sacrifice and assures Matt that ''helpful friend'' Caroline is still truly in love with him. Jeremy, Bonnie and Caroline learn from Luka that ...', '\n      Feb. 10, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3NzMxMTcwOF5BMl5BanBnXkFtZTcwOTUyODU0NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(671, 6, 'episode', 'The Dinner Party', 2, 15, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'After confirmation by apparently terrified Katherine that the single ash-bound knife can kill an original vampire, Damon invites Elijah, her maker, to a dinner party to stab him. Alaric however finds out a nasty limitation to that method. Meanwhile Stefan tells Elena about the time when he was the vicious vampire, Damon tried to be good, and John Gilbert played a surprisingly positive part. Jeremy can''t prevent ''immature'' witch Bonnie being questioned and suitably punished by accomplished Luka.', '\n      Feb. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwNzQ2OTY0Ml5BMl5BanBnXkFtZTcwMDQwOTk0NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(672, 6, 'episode', 'The House Guest', 2, 16, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'The Salvatore party is unpleasantly surprised that killing Elijah didn''t harm but release Katherine. Damon indignantly rejects her flirtation. Dr. Jonas Martin uses invisible astral projection to enable his son Luka to retrieve the ash dagger and thus revive Elijah, but Damon notices so, finds back and thus kills the unidentified knave. Grieved even worse, Jonas attacks Jeremy, traitor witch Bonnie and her girls night friends, but ends up dead and surprisingly restoring Bonnie''s powers. Alaric refuses to keep lying to Jenna, who refuses to be protected by secrecy, so ...', '\n      Feb. 24, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2OTg2MjA2M15BMl5BanBnXkFtZTcwOTQwOTk0NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(673, 6, 'episode', 'Know Thy Enemy', 2, 17, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Jeremy is delighted to have Bonnie restored to her powers, yet worried when accompanying her and Damon to the house where a 100 witches were burned to gather enough power to undo the moonstone''s curse. Elena''s mother Isobel Flemming''s return startles her and even Katherine, as turns out doing Klaus''s bidding for a gruesome ''prize''. John Gilbert confesses more wrong choices, also at Jenna''s expense, yet unlike furious Alaric, Elena ends up choosing to keep her father in her life. The Salvatore brothers piece together from the Gilbert diaries what they believe equals a ...', '\n      Apr. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAwODU4ODEzNF5BMl5BanBnXkFtZTcwNTY0Mjg4NA@@._V1_SY180_CR50,0,120,180_.jpg'),
(674, 6, 'episode', 'The Last Dance', 2, 18, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Original vampire Klaus forces captured Katherine to torture herself. Meanwhile Klaus takes henchman witch Maddox''s advice to possess Alaric''s body and use his history teacher job as cover to work on the school-kids and attend the high-school 1690s theme dance, where he hopes to tempt Bonnie to overexert her hundredfold witch powers against an unbreakable charm until she dies. Jeremy mistrusts Bonnie''s assurance she can cope and consults Damon, who doesn''t even confide into Stefano to brilliantly mount an elaborate trap. Matt teams up with the sheriff for Caroline''s ...', '\n      Apr. 14, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMwMzczMDkyOF5BMl5BanBnXkFtZTcwNzY5ODQ5NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(675, 6, 'episode', 'Klaus', 2, 19, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Resuscitated by Elena, who even hands him the dagger as proof of alliance, Elijah explain to her how his Bulgarian family became the first, still most powerful vampires, but witches prevented them becoming invulnerable. He loved Nicolaus ''Klaus'', being his brother, but has to turn against him in the end. They ingeniously staged the moon curse in order to get vampires and werewolves to help look for a cure for Klaus''s real curse, doubly monstrous genes. Alari-Klaus toys further with Katherina and instruct Maddocks to fetch a new body so he can leave Rick''s. Stefano ...', '\n      Apr. 21, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkwNDkxMjM4NF5BMl5BanBnXkFtZTcwNzg1MzIwNQ@@._V1_SY180_CR21,0,120,180_.jpg'),
(676, 6, 'episode', 'The Last Day', 2, 20, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'Klaus completes his preparations to break the moon curse but luring Tyler home to visit his mother after a non-accidental fall. The Salvatore brothers bicker worse then ever over how to protect Elena, who wants to take risks by doing things Elijah''s way, which will kill her but relies on an ancient resuscitation elixir. Stefano takes her away on a ''last day'' excursion. Matt finds helping the sheriff with Caroline about unbearable. Alaric''s secret is finally discovered by Jenna, who takes it well but runs into tragic trouble. Klaus refuses to wait until the next full ...', '\n      Apr. 28, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA2NTUxOTAzN15BMl5BanBnXkFtZTcwMTAxNzkwNQ@@._V1_SY180_CR53,0,120,180_.jpg'),
(677, 6, 'episode', 'The Sun Also Rises', 2, 21, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'With the arrival of the full moon, Elena tries to prepare for whatever Klaus has planned and Tyler faces his second transformation. The terrifying events quickly spin out of control, despite an unexpected act of courage. Finally, Damon admits the truth to Stefan about a terrible new development they must face.', '\n      May 5, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwNDg3MDQwOF5BMl5BanBnXkFtZTcwNzE3NDcxNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(678, 6, 'episode', 'As I Lay Dying', 2, 22, 'http://www.imdb.com/title/tt1405406/episodes?season=2&ref_=tt_eps_sn_2', 'While Mystic Falls presents a screening of "Gone with The Wind" in the town square, Damon''s memories of Katherine in 1864 mix with the reality of Elena in the present day. Stefan pays a terrible personal price for his attempt to prevent a tragedy, and Sheriff Forbes makes a deadly mistake while trying to keep everyone safe. More than one life hangs in the balance as the consequences of the sacrifice ritual play out to a horrifying conclusion.', '\n      May 12, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkxNzM1NjE1M15BMl5BanBnXkFtZTcwOTk3OTQyNQ@@._V1_SY180_CR24,0,120,180_.jpg'),
(679, 6, 'episode', 'The Birthday', 3, 1, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'On the morning of Elena''s 18th birthday, Caroline is busy planning a party, but Elena is focused on searching for any clues that might help her discover where Stefan is. Damon is also searching for Stefan, while trying to protect Elena and keep her from doing anything that would draw Klaus'' attention. Meanwhile, Klaus and Stefan are busy trailing a werewolf named Ray Sutton. Now working at the Mystic Grill along with Matt, Jeremy is struggling to understand why he keeps seeing the ghosts of Vicki and Anna since he was brought back to life by Bonnie''s magic. Meanwhile,...', '\n      Sep. 15, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc2MjA0NDg2OV5BMl5BanBnXkFtZTcwNzcyNjE0Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(680, 6, 'episode', 'The Hybrid', 3, 2, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Tyler finds his mother verbena-poisoned his beloved Caroline, realizes she ignores his cursed paternal heritage and shows her, chaining himself down at fall moon for transformation. Assisted by will-less Stefano, Klaus forces torture-wounded Ray to betray his werewolf pack so he can bite them to create a hybrid army, but it fails, the spell having been crossed by Elena''s secret resuscitation. Damon reluctantly follows Alaric and Elena, who recruited him to search for Stefano, wisely acting as backup. Jeremy, who is haunted by Vicky, gets initially reluctant Matt to ...', '\n      Sep. 22, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk1Mjg3ODc0N15BMl5BanBnXkFtZTcwMTYxNzc3Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(681, 6, 'episode', 'The End of the Affair', 3, 3, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Klaus and Stefan arrive in Chicago, where Stefan is reunited with a vampire who hasn''t really moved on from her interest in him decades earlier. In a flashback to Chicago in the 1920s, Stefan comes face-to-face with a shocking chapter from his wild past. After Damon gets a tip on Stefan and Klaus'' whereabouts from an unexpected source, he and Elena follow their trail. Back in Mystic Falls, Tyler is concerned about Caroline and turns to Sheriff Forbes for help.', '\n      Sep. 29, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAxNjk4NDY2MDleQTJeQWpwZ15BbWU3MDU1MTc3NzY@._V1_SY180_CR75,0,120,180_.jpg'),
(682, 6, 'episode', 'Disturbing Behavior', 3, 4, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Still in Chicago, Klaus uses Gloria, a witch he knew long ago, to help him track down missing information that will explain why his plan isn''t working. Gloria''s spells reveal intriguing glimpses of the truth, but she soon realizes she needs Stefan''s knowledge to complete the puzzle. When Stefan suddenly finds himself in danger, help comes from a surprising ally. Back in Mystic Falls, a frustrating new enemy pushes Damon over the brink and he lashes out in a way that will have lasting consequences. Caroline struggles with her own emotional issues, even as she tries to ...', '\n      Oct. 6, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEyMjczMzIwMV5BMl5BanBnXkFtZTcwMDc4NDg4Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(683, 6, 'episode', 'The Reckoning', 3, 5, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Despite all that has happened, Caroline is determined to see that Elena, Bonnie, Matt and Tyler all enjoy a traditional Senior Prank Night before the school year begins at Mystic Falls High School. However, when uninvited guests show up, it doesn''t take long for the evening to take a deadly turn. Damon convinces Jeremy that he can use his new connection to the other side to help find a way to defeat Klaus. Finally, Klaus deepens his hold on Stefan and uses him for increasingly violent and dangerous purposes.', '\n      Oct. 13, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI4MjA3MjA2MV5BMl5BanBnXkFtZTcwMzIwMjE5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(684, 6, 'episode', 'Smells Like Teen Spirit', 3, 6, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'On the first day of their senior year, Elena, Caroline, Bonnie and Matt are still reeling from recent events, while Tyler seems to be enjoying everything a little too much. Damon is annoyed by a new houseguest, and everyone is surprised by the arrival of a new student in Alaric''s history class. Matt asks Bonnie for help when he realizes he made a serious mistake. Meanwhile, Stefan continues to carry out his latest assignment from Klaus.', '\n      Oct. 20, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM2MTM2NTAxNF5BMl5BanBnXkFtZTcwMzQ3MDQ5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(685, 6, 'episode', 'Ghost World', 3, 7, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'As Mystic Falls prepares to celebrate the traditional Illumination Night, the town is invaded by spirits of the dead. After a particularly violent encounter with an angry spirit, Damon asks Bonnie to find the reason behind the ghosts'' surprising power. Elena convinces Jeremy to use his connection to the other side to help her find a new way to reach Stefan, leading Jeremy to a terrible choice. Finally, Alaric discovers a long-hidden clue to the past.', '\n      Oct. 27, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA3OTE4MzUwOTNeQTJeQWpwZ15BbWU3MDU1MDA3OTY@._V1_SY180_CR75,0,120,180_.jpg'),
(686, 6, 'episode', 'Ordinary People', 3, 8, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'With help from Elena and Bonnie, Alaric tries to decipher the meaning behind his recent discovery. Elena and Rebekah (Claire Holt) engage in a mean-girl power struggle, until Rebekah finally reveals some of her family''s ancient secrets and the violent past she shares with Klaus and Elijah. Damon tries a reckless new approach to make a breakthrough with Stefan, and they''re both surprised by an unlikely ally.', '\n      Nov. 3, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI1NDQ1MTU2OV5BMl5BanBnXkFtZTcwMzg5NzAwNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(687, 6, 'episode', 'Homecoming', 3, 9, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'On the night of the Homecoming dance, Rebekah opens up to Elena about why the evening is so important to her, leaving Elena with conflicting emotions. Caroline and Matt are both shocked at Tyler''s behavior throughout the evening. The night takes a surreal turn when Klaus puts his latest plan into action. Determined to outsmart Klaus, Damon enters into a dangerous partnership, leading to a terrifying turn of events.', '\n      Nov. 10, 2011\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(688, 6, 'episode', 'The New Deal', 3, 10, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Stefan has hidden the coffins containing the bodies of Klaus'' family, and Klaus quickly turns to violence to convince Damon and Elena that no one will be safe until he finds Stefan and gets his family back. Tyler continues to make the most of his new abilities as a hybrid, but he has to face the disturbing consequences of his actions as well. After a terrifying incident, Elena and Alaric grow increasingly concerned about Jeremy''s attitude and, ultimately, his safety. Alaric meets the beautiful Dr. Fell, who is intrigued with his amazing ability to heal. While trying ...', '\n      Jan. 5, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwMTA3Nzc3Ml5BMl5BanBnXkFtZTcwODY0ODIyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(689, 6, 'episode', 'Our Town', 3, 11, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Although Caroline is in no mood to celebrate her 18th birthday, Elena, Bonnie and Matt surprise her with a small party in an unusual location. Damon and Stefan disagree on the best way to handle Klaus, and a reckless Stefan decides to test his theory by taking things to dangerous extremes. Bonnie is concerned when Elena tells her about Jeremy''s new plans. At a Founder''s meeting, Alaric once again runs into Dr. Fell, who is in the middle of an argument with her ex-boyfriend, the medical examiner. Tyler refuses to go along with Klaus'' latest demand, and is surprised ...', '\n      Jan. 12, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgzNTE0ODExM15BMl5BanBnXkFtZTcwNTA5ODUyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(690, 6, 'episode', 'The Ties That Bind', 3, 12, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Prophetic dreams about the mysterious fourth coffin lead Bonnie and Elena to a surprising source, while Tyler seeks help to break free from Klaus'' bond so he can be with Caroline. Alaric''s new friend Dr. Fell has a secret no one sees coming, and Stefan''s interference in Elena''s life reveals something that surprises even him.', '\n      Jan. 19, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU3MTQ4MzUzMF5BMl5BanBnXkFtZTcwMjU2NzgyNw@@._V1_SY180_CR60,0,120,180_.jpg'),
(691, 6, 'episode', 'Bringing Out the Dead', 3, 13, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Sheriff Forbes delivers some disturbing news to Alaric and Elena about the weapon used in a recent murder. In the Salvatore brothers'' escalating quest to kill Klaus, Stefan turns to Bonnie and Abby, while Damon reaches out to an old acquaintance for help in setting up an elaborate plan. Intent on a plan of his own, Klaus hosts a strange dinner party, where he reveals another story from his family''s violent past until an unexpected guest brings the party to an end. Meanwhile, Caroline is heartbroken when she is unable to stop a tragedy from unfolding.', '\n      Feb. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgxMjk5MDM5N15BMl5BanBnXkFtZTcwMDg2MDUzNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(692, 6, 'episode', 'Dangerous Liaisons', 3, 14, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'Elena is surprised to receive an invitation to a formal ball, and when Damon and Stefan hear the party is being hosted at Klaus''s newly renovated mansion, they both insist on attending the event with her. Caroline and Matt also receive invitations to the ball from unexpected admirers. At the elegant party, Elena learns of a horrifying plan that could lead to numerous deaths and she must decide who she can trust wither her new information. Caroline discovers a side of Klaus no one would have suspected. Finally, after an evening of violence and dashed hopes, Damon finds...', '\n      Feb. 9, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc2NDk4MjA1MF5BMl5BanBnXkFtZTcwMDM1MTgzNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(693, 6, 'episode', 'All My Children', 3, 15, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'After starting her day with a startling discovery of Damons'' latest indiscretion, Elena is frustrated to find that none of her friends agree with her on how they should react to the Original family''s internal power struggle. Once again caught up in the destiny of the Bennett witches, Bonnie and Abby find themselves playing a part in a ritual to appease the spirits of nature. When Elijah gives Damon and Stefan a dangerous ultimatum that puts Elena in danger, they turn to Alaric and Meredith for help with a plan that leads them to a terrible choice.', '\n      Feb. 16, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4ODY5ODQ5NV5BMl5BanBnXkFtZTcwMDYyNzE0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(694, 6, 'episode', '1912', 3, 16, 'http://www.imdb.com/title/tt1405406/episodes?season=3&ref_=tt_eps_sn_3', 'The present-day murders in Mystic Falls remind Damon of a similar crime spree a century earlier. In flashbacks to 1912, Damon recalls a beautiful vampire, Sage, who showed him a whole new way to exist. Sheriff Forbes warns Damon not to get involved in her investigation, but Damon is convinced she''s going after the wrong suspect. Elena and Matt resort to breaking and entering in their search for evidence to prove Dr. Fell is a murderer. For reasons known only to her, Rebekah, becomes interested in locating one of the town''s oldest landmarks. Finally, Elena comes to a ...', '\n      Mar. 15, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ3MTIyNTc2OF5BMl5BanBnXkFtZTcwNzkzNTQ1Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
