(701, 6, 'episode', 'Pilot', 1, 1, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'In the small town of Mystic Falls, teenager Elena Gilbert and her younger brother, Jeremy, struggle to come to terms with the recent death of their parents. Elena is popular amongst her peers and the perfect straight-A student. However, she has difficulties hiding her grief from the world. Meanwhile, Jeremy treads on a dangerous path of using drugs to ease his pain. The arrival of new student Stefan Salvatore, makes Elena think about romantic possibilities. Elena is unaware about Stefan''s mysterious origins as well as his brother Damon.', '\n      Sep. 10, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY3NjQwMzE5NF5BMl5BanBnXkFtZTcwNTgzODU3Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(702, 6, 'episode', 'The Night of the Comet', 1, 2, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'As Mystic Falls prepares for a festival to celebrate the passing of a comet, Vicki is in the hospital recovering from the attack she can barely remember. Stefan goes to the hospital and tries to use his abilities to make sure Vicki doesn''t remember what really happened, but his attempt is cut short when Vicki''s brother Matt arrives. Jeremy continues to struggle at school and with his feelings for Vicki. At a parent/teacher conference, Mr. Tanner makes Aunt Jenna feel that she is failing as a surrogate parent, especially when it comes to the self-destructive Jeremy. ...', '\n      Sep. 17, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIyNDczNDYzNV5BMl5BanBnXkFtZTcwNDk1MDQ4Mg@@._V1_SY180_CR69,0,120,180_.jpg'),
(703, 6, 'episode', 'Friday Night Bites', 1, 3, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Tyler tries to embarrass Stefan by throwing a football at him during practice. However, Stefan''s super-skills of catching a football impresses Mr. Tanner who tries to persuade Stefan to join the school''s football team. Meanwhile, Elena continues to ignore the semi-psychic Bonnie''s warnings that Stefan is not who he claims to be. So, Elena invites Stefan and Bonnie over for dinner at her house. She hopes that they will get know each other better, but her plan ends up backfiring. Damon crashes the dinner with Caroline whom he has now been feeding off in order to further...', '\n      Sep. 24, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg1OTc3ODEyOV5BMl5BanBnXkFtZTcwMDE2MDY4Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(704, 6, 'episode', 'Family Ties', 1, 4, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Elena asks a reluctant Stefan to go with her to the annual Founder''s Park dance. Vicki gets Tyler to ask her, but later accuses him of hiding their drug-induced relationship from his aunt Jenna. Meanwhile, Zach reveals a family secret to Stefan. Damon finally tells Elena the secret history about the Salvatore family and how she is the dead-splitting image of Stefan''s lost love. Stefan tries to get Damon out of his life for good without giving away Damon''s (or his) secret. Also, Elena thinks that Caroline is being abused by Damon when she sees the bite marks on her ...', '\n      Oct. 1, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(705, 6, 'episode', 'You''re Undead to Me', 1, 5, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'With Damon still locked up and growing physically weaker, Jeremy and Vicki have gotten back together. Meanwhile, the school decides to hold a car wash to raise funds after the death of Mr. Tanner. At the car wash, Bonnie starts a fire using her special powers. She is horrified and confused so she goes to her grandmother for help. Elena and Stefan continue to have trust issues as he is still unwilling to tell Elena his secret. But later, Elena hears a shocking story about Stefan and Damon from a stranger who recognizes Stefan... from a vampire attack that happened ...', '\n      Oct. 8, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(706, 6, 'episode', 'Lost Girls', 1, 6, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Elena demands that Stefan explain the frightening events that have been happening in Mystic Falls. In a string of flashbacks, Stefan explains how his rivalry with Damon began back in the Civil War when they met the love of their lives Katherine, the vampire who was the one that sired both of them. In the present, Damon impulsively takes control of Vicki''s future, and a confused and frightened Vicki runs away. Also, Sheriff Forbes, Mayor Lockwood, Logan and the others take drastic steps to protect their town.', '\n      Oct. 15, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUyMzMwNjgyNV5BMl5BanBnXkFtZTcwNzg2NjI5Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(707, 6, 'episode', 'Haunted', 1, 7, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'As Halloween draws near, Vicki''s behavior becomes more dangerous which leads Stefan to try to help her control her blood-lust. Elena tries to convince Jeremy to stay away from Vicki, but Jeremy naturally refuses to listen. Meanwhile, Caroline gives Bonnie a necklace she took from Damon to wear with her Halloween costume for the annual costume party, and when Damon tries to take it back, he is surprised by Bonnie''s abilities to repel him. Bonnie discusses the incident with her grandmother and learns more about her family''s past as voodoo witches. Elsewhere, Matt tries ...', '\n      Oct. 29, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(708, 6, 'episode', '162 Candles', 1, 8, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'On his birthday, Stefan is surprised by a visit from Lexi, one of his oldest vampire friends. Still upset by the way events ended at the Halloween haunted house, Elena does her best to stay away from Stefan, but Lexi gives her some unsolicited relationship advice. Meanwhile, both Elena and Jenna are surprised by a change in Jeremy''s behavior in the wake of Vicki''s "disapearance". But only Elena knows that Damon''s mind-wipe powers did something to her brother. At Damon''s insistence, Caroline tries to get his medallion back from Bonnie who continues to study her wican ...', '\n      Nov. 5, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(709, 6, 'episode', 'History Repeating', 1, 9, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'A new history teacher, named Alaric Saltzman, arrives and requests to Jeremy that he write an after-hours paper to keep his grades up. Jeremy takes a liking to his new teacher and introduces him to Jenna. Meanwhile, Bonnie continues to have terrifying dreams involving the ghost of her great-grandmother Emily Bennett who is trying to send her a message. Bonnie then decides to hold a séance with Eleana and Caroline to try to contact Emily to find out what she wants. Despite Elena''s efforts, Bonnie and Caroline argue over the medallion when Damon continues to pressure ...', '\n      Nov. 12, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI2Nzg3MjIzMl5BMl5BanBnXkFtZTcwMjkwMTc5Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(710, 6, 'episode', 'The Turning Point', 1, 10, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'After reading a journal kept by a Gilbert ancestor, Jeremy begins to sketch again, a hobby he quit when his parents died. Meanwhile, Sheriff Forbes notifies Damon of another vampire attack and Damon offers to try to track down the killer. Alaric helps Jeremy, Tyler, and Mayor Lockwood in different ways with Jeremy''s grades, Tyler''s football practice, and the mayor with information about the vampire attacks and of his obsession with tracking the one who killed his fiancée down. Also, Elena makes a shocking discovery about Stefan and of his intentions.', '\n      Nov. 19, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIxMTc2MzQ2Ml5BMl5BanBnXkFtZTcwODgzOTg5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(711, 6, 'episode', 'Bloodlines', 1, 11, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'After surviving the horrific car crash, Elena, still shaken by her resemblance to Katherine Pierce, is rescued by Damon who takes on her on a road trip to Georgia where he meets with an old friend of his, a witch/barmaid named Bree, to ask for her help on a spell that could free Katherine from her tomb. Back in Mystic Falls, Stefan tries to help Bonnie understand her wiccan powers. Meanwhile, Jeremy meets a new local girl, named Anna, who give him insight on the vampire legends about the town as he continues to research his heritage. Also, Alaric Saltzman is revealed ...', '\n      Jan. 21, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI5NDUyMDYxMV5BMl5BanBnXkFtZTcwNzMwODMxMw@@._V1_SY180_CR75,0,120,180_.jpg'),
(712, 6, 'episode', 'Unpleasantville', 1, 12, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Damon, Elena and Stefan attend a school dance with a 1950s'' theme, where Alaric introduces himself to Damon whom he suspects is the vampire that killed his wife. Stefan and Damon try to figure out the identity of the new vampire in town who is now stalking Elena in which Stefan gives Elena jewelry filled with Vervain to protect her family and friends while she continues to investigate her true origins. Meanwhile, Matt takes a job at the Mystic Grill as a busboy to make amends meet where he has a run-in with Caroline who becomes more smitten with him. The bartender of ...', '\n      Jan. 28, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwNjA0MTE2M15BMl5BanBnXkFtZTcwMjAxODMxMw@@._V1_SY180_CR3,0,120,180_.jpg'),
(713, 6, 'episode', 'Children of the Damned', 1, 13, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Stefan and Damon recall the incidents that led to the rift in their relationship.', '\n      Feb. 4, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1OTczNzI5Nl5BMl5BanBnXkFtZTcwNjAwNzYxMw@@._V1_SY180_CR1,0,120,180_.jpg'),
(714, 6, 'episode', 'Fool Me Once', 1, 14, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Stefan helps Elena and Bonnie out of a dangerous situation when they are both kidnapped by Ben and Anna. Meanwhile, Jeremy asks Anna to a party in the woods, unaware that she has her own reasons for wanting to meet him there. When Stefan, Damon, and Elena work together with Bonnie and Grams to open the tomb of Katherine Pierce, everyone is shocked by what they discover.', '\n      Feb. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI4MDY0OTM3Nl5BMl5BanBnXkFtZTcwODI4MTgxMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(715, 6, 'episode', 'A Few Good Men', 1, 15, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Matt and Caroline are surprised by the sudden reappearance of Matt''s estranged mother Kelly who arrives back in Mystic Falls with an agenda. Stefan and Elena are worried about Damon''s new attitude, while one vampire from the crypt is loose and killing. Meanwhile, Damon is asked by Sheriff Forbes to take part in a fund-raising bachelor auction. Elsewhere, Alaric discovers shocking secrets from his own past over his late wife. With help from Jenna and Stefan, Elena is determined to find out everything she can about her birth mother, but the truth may be more than she ...', '\n      Mar. 25, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc5MTExNzQ0N15BMl5BanBnXkFtZTcwNjMwODMxMw@@._V1_SY180_CR50,0,120,180_.jpg'),
(716, 6, 'episode', 'There Goes the Neighborhood', 1, 16, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Anna brings a surprising guest along when she pays a visit to Damon. Elena and Stefan go on an awkward double date with Caroline and Matt, but Stefan and Matt find they have some common ground. Jenna reunites with her old friend Kelly, and Jeremy''s relationship with Anna takes an unexpected direction.', '\n      Apr. 1, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(717, 6, 'episode', 'Let the Right One In', 1, 17, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'When Stefan and Damon make a dangerous new enemy, Stefan suddenly finds himself in a perilous situation when a handful of the vampires from the tomb abduct him and hold him hostage in their farmhouse to torture him. Damon and Elena try to convince Alaric to work with them to help rescue Stefan. Meanwhile, Matt is hopeful that his mother, Kelly, may be back to stay. Jeremy tries to convince Anna to turn him into a vampire. Anna refuses, but she soon learns that Jeremy''s reason is not what she thought. After her car breaks down in a storm, Caroline makes a horrific ...', '\n      Apr. 8, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(718, 6, 'episode', 'Under Control', 1, 18, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'While Stefan struggles to control his new situation of blood lust after feeding off Elena''s blood to heal, she and Jeremy are surprised by a visit from their uncle, John Gilbert, who arrives in Mystic Falls with an agenda. Meanwhile, Alaric has an awkward talk with Elena about his wife Isobel. At a Founder''s Day event, Stefan displays a rare party attitude and Damon''s attempt to find out why Uncle John has returned to town takes an ugly turn. An incident at the party causes trouble between Matt and Tyler, and the relationship between Matt and his immature and ...', '\n      Apr. 15, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDk5MzAzNTY0Ml5BMl5BanBnXkFtZTcwNzIxNzUzMw@@._V1_SY180_CR2,0,120,180_.jpg'),
(719, 6, 'episode', 'Miss Mystic Falls', 1, 19, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'At the annual Founder''s Day Gala, Elena and Caroline compete with each other for the title of "Miss Mystic Falls" against other girls from town, whom include Tina Fell and Amber Bradley. Elena is happy to have Bonnie back in town, but Bonnie still has issues to work through over the death of her grandmother and her own developing powers. Meanwhile, John Gilbert attempts to intimidate Damon into revealing what he knows about the vamps, but his plan doesn''t have the desired effect. Also, Damon discovers that Stefan is hiding a dangerous secret that could impact everyone...', '\n      Apr. 22, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(720, 6, 'episode', 'Blood Brothers', 1, 20, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'While Stefan struggles to come to terms with his past, both he and Damon reveal parts of their history to Elena, until she finally learns the truth about how they became vampires. Pearl has an ugly confrontation with Johnathan Gilbert. Damon and Alaric try to find a mysterious invention before Johnathan does. The friendship and flirtation between Jeremy and Anna continues to grow.', '\n      Apr. 29, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjczNDYzNDU4M15BMl5BanBnXkFtZTcwODUyNDI0Mw@@._V1_SY180_CR3,0,120,180_.jpg'),
(721, 6, 'episode', 'Isobel', 1, 21, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Isobel returns to town and stuns Alaric with her attitude and her demands that he arrange a meeting with Elena. When mother and daughter finally meet, Isobel refuses to answer most of Elena''s questions, but reveals that she will stop at nothing to find the mysterious invention Johnathan Gilbert has been searching for. Isobel''s dangerous actions lead Stefan, Damon and Bonnie to step in and help Elena deal with the situation.', '\n      May 6, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkzMDAzMTk1NV5BMl5BanBnXkFtZTcwNTYyNDI0Mw@@._V1_SY180_CR69,0,120,180_.jpg'),
(722, 6, 'episode', 'Founder''s Day', 1, 22, 'http://www.imdb.com/title/tt1405406/episodes?season=1&ref_=tt_eps_sn_1', 'Founder''s Day has finally arrived, and everyone is busy with last-minute preparations for floats and fireworks. Stefan is uncomfortable with Damon''s new attitude toward Elena, but Elena is more concerned about repairing her relationship with Jeremy. Jeremy is worried about Anna, but not sure he''s on board with her latest plan for the future. While Caroline is enjoying her day as Queen of the celebration, she also tries to help Matt and Tyler get their friendship back on track. Finally, although Damon and Alaric do their best to stop him, Johnathan Gilbert sets a plan ...', '\n      May 13, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjgzNzU1ODU4N15BMl5BanBnXkFtZTcwNjg2OTU0Mw@@._V1_SY180_CR63,0,120,180_.jpg'),
