(733, 6, 'episode', 'Catch Me If You Can', 4, 11, 'http://www.imdb.com/title/tt1405406/episodes?season=4&ref_=tt_eps_sn_4', 'Jeremy is furious when Klaus tries to control him by putting Matt''s life in danger. Damon coaches Jeremy as he prepares to take on Klaus'' new vampires, but they find that Kol has beaten them to it. Kol makes it clear that he will stop at nothing to convince everyone to give up the search for the cure. Looking for a new ally, Rebekah reminds Stefan that they were once close friends. When Sheriff Forbes and Mayor Hopkins question Shane about his involvement in the Founders'' Council deaths, Bonnie steps in with questions of her own, and Shane''s responses push Bonnie to ...', '\n      Jan. 24, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEzNTY1MjgyNl5BMl5BanBnXkFtZTcwMDEwNjc5OA@@._V1_SY180_CR75,0,120,180_.jpg'),
