(746, 11, 'episode', 'Slip of the Tongue', 2, 1, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank and Karen are planning to move back to New York and Hank undergoes a vasectomy.', '\n      Sep. 28, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(747, 11, 'episode', 'The Great Ashby', 2, 2, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'After Hank is arrested by the police and sent to prison, he meets record producer Lew Ashby, who asks Hank to write his biography, in the meantime, Charlie is fired after videos of him masturbating in the office are shown to his boss.', '\n      Oct. 5, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(748, 11, 'episode', 'No Way to Treat a Lady', 2, 3, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank starts as Lew Ashby''s biographer, Becca starts at Mia''s all-girl school and Charlie starts (well, tries to start actually) as porn actress Daisy''s agent.', '\n      Oct. 12, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(749, 11, 'episode', 'The Raw & the Cooked', 2, 4, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Right before they throw a big dinner party for all their friends, Hank proposes to Karen.', '\n      Oct. 19, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(750, 11, 'episode', 'Vaginatown', 2, 5, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank now lives with Lew Ashby, who arranges a surprise for him when Hank tells him he likes TV cook Chloe Metz. Charlie helps Daisy get a part in a porn film.', '\n      Oct. 26, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(751, 11, 'episode', 'Coke Dick & First Kick', 2, 6, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank tries to talk to Lew''s long lost love. Later on, he runs into Julian, who''s having sex with someone who''s definitely not Sonja.', '\n      Nov. 2, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE5MDk0NzY3M15BMl5BanBnXkFtZTcwMDE5NzEwMg@@._V1_SX120_CR0,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(752, 11, 'episode', 'In a Lonely Place', 2, 7, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank and Karen go to a parent evening and Hank ends up sleeping with the teacher. Charlie and Marcy take a desperate Daisy into their home.', '\n      Nov. 9, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(753, 11, 'episode', 'Going Down and Out in Beverly Hills', 2, 8, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Marcy goes to her mother for a detox, Hank goes to Lew''s former love to find out more about their relationship and Karen goes to Lew because he''s dating Mia.', '\n      Nov. 16, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(754, 11, 'episode', 'La Ronde', 2, 9, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank goes on a date with Janie Jones, Lew''s long lost love. Lew invites Karen on a date.', '\n      Nov. 23, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(755, 11, 'episode', 'In Utero', 2, 10, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Hank awaits test results and reflects on his early days with Karen. Charlie begs Daisy to move out.', '\n      Nov. 30, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(756, 11, 'episode', 'Blues from Laurel Canyon', 2, 11, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'Mia''s - that is, originally Hank''s - book gets rave reviews, ironically better than any of the books published in Hank''s name. Lew is having a party to which pretty much everyone is invited. Marce has just come back from rehab and Charlie is planning to give her some time before announcing that he wants a divorce in order to be with Daisy. Annika, a Rolling Stone book critic has a scandalous theory about the true story behind Mia''s book... And there''s still more problems arising.', '\n      Dec. 7, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(757, 11, 'episode', 'La Petite Mort', 2, 12, 'http://www.imdb.com/title/tt0904208/episodes?season=2&ref_=tt_eps_sn_2', 'The "joyous arrival" happens at a new age birthing center.', '\n      Dec. 14, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(758, 11, 'episode', 'Wish You Were Here', 3, 1, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Following Karen''s move to New York, Hank Moody does his best to raise his daughter Becca by himself. But being a single dad isn''t easy, especially with Becca starting to question his authority more than ever. To make matters worse, Becca''s new best friend Chelsea has a fondness for sex, drugs, and trouble. After a run-in with Chelsea''s straight-laced mother Felicia, a teacher at the local university, Hank reluctantly accepts a dinner invitation. Hank does his best to tolerate the various academics at the party, but things get out of hand when Hank insists on having ...', '\n      Sep. 27, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjg1NDU3OTM3MF5BMl5BanBnXkFtZTcwODI4Nzk3Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(759, 11, 'episode', 'The Land of Rape and Honey', 3, 2, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Hank makes a poor start to teaching when one of his crushing students attempts suicide after Hank criticizes his writing, and also learns an unwelcome fact about another one.', '\n      Oct. 4, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDA0MTc5OTgzOV5BMl5BanBnXkFtZTcwMzkyODQ1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(760, 11, 'episode', 'Verities & Balderdash', 3, 3, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Hank and Becca attend the annual English Department Fall Mixer hosted by Dean Koons and wife Felicia. After flirtatious exchanges with student Jackie and Felicia, Hank finds himself consoling his jilted teacher''s aide Jill, the best way he knows how. Meanwhile, Becca and Chelsea sneak away to discuss life, love, and psychedelic mushrooms. Charlie tries to coax Marcy into celebrating the first signing at the new agency, teen idol Rick Springfield.', '\n      Oct. 11, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI2MzM4NjkwNV5BMl5BanBnXkFtZTcwMzAzODQ1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(761, 11, 'episode', 'Zoso', 3, 4, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Becca drags Hank to a trendy shopping boutique to pick out some more grown-up attire. But Hank isn''t so sure he likes the "new" Becca''s makeover. At work, Hank juggles sexual encounters with teacher''s aide Jill and boss Felicia. And finally, in an attempt to figure out why talented writer Jackie is missing class, Hank drags Charlie to the strip club where she works. Unfortunately, temptation gets the better of Hank.', '\n      Oct. 18, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA1NjkyMDU5NTVeQTJeQWpwZ15BbWU3MDg5Mjg0NTQ@._V1_SY180_CR75,0,120,180_.jpg'),
(762, 11, 'episode', 'Slow Happy Boys', 3, 5, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Becca flies to N.Y. to her mom while Hank''s old best friend ''Zloz'' comes to L.A. for the first time. His mission: to indulge in all kinds of depravity. Hank takes him to Sue''s party, but that is just the beginning.', '\n      Oct. 25, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUzMzcwODAzNl5BMl5BanBnXkFtZTcwMjAzODQ1NA@@._V1_SY180_CR76,0,120,180_.jpg'),
(763, 11, 'episode', 'Glass Houses', 3, 6, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Karen is quickly onto what (or whom) Hank''s been doing, but the actual problem is Becca, who isn''t happy to hear that she is to move to N.Y. to live with her mother. A client of Charlie''s turns out to be Marcy''s fantasy. Runkle''s Luck.', '\n      Nov. 1, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYxMDI0MDYwOV5BMl5BanBnXkFtZTcwNjkyODQ1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(764, 11, 'episode', 'So Here''s the Thing...', 3, 7, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Hank has decided that he needs to get rid of the extraneous women in his life, and he intends to achieve it in one day. Unfortunately, the women might want to keep him. Meanwhile, Sue needs Charlie''s help with her first client.', '\n      Nov. 8, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQxMDg0NjM5MF5BMl5BanBnXkFtZTcwNzkyODQ1NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(765, 11, 'episode', 'The Apartment', 3, 8, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Jackie and two of her friends arrive to party. The next day, one of the girls is unconscious, and then Runkle & Rick Springfield arrive. They all have to hide when Jill suddenly arrives. And the knocks on the door just don''t stop.', '\n      Nov. 15, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg0NzExODk3M15BMl5BanBnXkFtZTcwMjEzODQ1NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(766, 11, 'episode', 'Mr. Bad Example', 3, 9, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'There''s a call from the principal of the girls'' school to Hank... and Stacy. Felicia has a revelation for Karen. Marcy is completely smitten by Rick and on top of that, Charlie has to provide him cocaine.', '\n      Nov. 22, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4NDE0MzEwMV5BMl5BanBnXkFtZTcwNjQzODQ1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(767, 11, 'episode', 'Dogtown', 3, 10, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Karen, Becca and Marcy have a girls'' night out. Since Charlie just got fired by Sue, Hank decides to have a boys'' night out. The girls'' night - uneventful. The boys'' night - not so much. Then there''s the morning after.', '\n      Nov. 29, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQzODU1NjkzMF5BMl5BanBnXkFtZTcwNzAzODQ1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(768, 11, 'episode', 'Comings and Goings', 3, 11, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', 'Felicia invites Hank and Karen for a lunch. When they arrive, they find Jill and Jackie there too - awkward. But it''s the surprise guest who causes Hank to wail, "The worst day of my life!" And the worst is still to come.', '\n      Dec. 6, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BNzMxMDAzODA0M15BMl5BanBnXkFtZTcwMDEzODQ1NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(769, 11, 'episode', 'Mia Culpa', 3, 12, 'http://www.imdb.com/title/tt0904208/episodes?season=3&ref_=tt_eps_sn_3', '', '\n      Dec. 13, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3NzI3OTE3OV5BMl5BanBnXkFtZTcwNDkyODQ1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(770, 11, 'episode', 'Pilot', 1, 1, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Meet Hank Moody, a depressed writer with a writer''s block who has a daughter, an ex he wants back and lots of casual sex.', '\n      Aug. 13, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(771, 11, 'episode', 'Hell-A Woman', 1, 2, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Hank accepts a blogger position and attends a dinner party as he continues to try to salvage his life.', '\n      Aug. 20, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(772, 11, 'episode', 'The Whore of Babylon', 1, 3, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Hank fights with Todd Carr, director of the film based on his book, and ends up in jail. Bill bails him out.', '\n      Aug. 27, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(773, 11, 'episode', 'Fear and Loathing at the Fundraiser', 1, 4, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Meredith talks Hank into going to a fund-raiser. Karen and Bill are there as well. And so is the married guy Meredith has an affair with.', '\n      Sep. 3, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(774, 11, 'episode', 'LOL', 1, 5, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Bill asks Hank to replace him as a guest speaker at Mia''s creative writing class. Becca has a crush on her guitar teacher.', '\n      Sep. 10, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(775, 11, 'episode', 'Absinthe Makes the Heart Grow Fonder', 1, 6, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Hank has a one-night stand with a sexy surfer girl who steals his records and guitar.', '\n      Sep. 17, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(776, 11, 'episode', 'Girls, Interrupted', 1, 7, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'While Charlie and his wife Marcy are considering a ménage à trois, Hank tries to win Karen over by arranging a dream job for her.', '\n      Sep. 24, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(777, 11, 'episode', 'California Son', 1, 8, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Hank''s father dies. Despite the memories of his father floating to the surface, he doesn''t want to go to the funeral. Meanwhile, he goes to bed with a hooker named Trixie, despite the fact he doesn''t have enough money to pay her.', '\n      Oct. 1, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(778, 11, 'episode', 'Filthy Lucre', 1, 9, 'http://www.imdb.com/title/tt0904208/episodes?season=1&ref_=tt_eps_sn_1', 'Things seem to be looking up for Hank. He has finally written something and he receives a fat bonus check.', '\n      Oct. 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
