(820, 8, 'episode', 'Manhunt', 2, 1, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'It is the morning after their escape from Fox River, and the inmates narrowly avoid being caught by Bellick as they jump onto a freight train. FBI Special Agent Alex Mahone has been assigned to their case and calls a press conference urging the public to turn in the "Fox River 8." Michael, Lincoln, Abruzzi, C-Note, and Sucre encounter a hunter and his daughter. He holds them at gunpoint until Abruzzi grabs the daughter and forces the hunter to give them his SUV and let them go. The escapees head for a location where Michael has things stored. Agent Mahone tracks ...', '\n      Aug. 21, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(821, 8, 'episode', 'Otis', 2, 2, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'The F.B.I agent Mahone decides to use L.J to get to Michael and Lincoln by cutting a deal with him and making him trick the two fugitives into revealing their location. Michael and Lincoln decide there''s only one thing they can do, rescue L.J in a daring raid at the county jail. Only one problem though, Mahone is personally guarding L.J and won''t let him out of his sight.', '\n      Aug. 28, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(822, 8, 'episode', 'Scan', 2, 3, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'With hospitals and clinics under surveillance, Michael brings Lincoln to Nika''s home to heal his wounded leg. Then he returns to the place where he parked his Accord and finds that the car has been towed. Meanwhile agent Mahone retrieves Michael''s backpack with his passport from a vagrant that broke the rear window of Michael''s car to steal the backpack. Michael goes to Brewster Towing yard to recover his car. Meanwhile Sucre finds that Maricruz will marry Hector in a couple of days and he heads to New York in a stolen car. Sara is arrested and her father visits her, ...', '\n      Sep. 4, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(823, 8, 'episode', 'First Down', 2, 4, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Michael, Linc, and Nika are captured by Bellick and Geary, who intend to retrieve Westmoreland''s money in Utah. Tweener continues his drive with Debra Jean. Abruzzi is reunited with his wife and children and is set to flee the country with them, but decides to take care of Fibonacci first. T-Bag has a close call with the police at a Nebraska gas station, and then poses as a Marine who lost his hand in Iraq. Mahone waits for confirmation of the deaths of Michael and Linc in the car explosion, and meanwhile gets a lead on one of the other fugitives. Kellerman (posing as...', '\n      Sep. 11, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(824, 8, 'episode', 'Map 1213', 2, 5, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Michael and Linc arrive in Tooele, but the map they need to locate the double-K ranch is missing. They run into T-Bag and Tweener, who have also come to Tooele for Westmoreland''s money. Meanwhile, C-Note makes his way by train toward Tooele. Sucre reaches Las Vegas and attempts to halt the wedding of Maricruz and Hector. Sara invites Kellerman to her apartment, believing he is harmless. At the FBI office in Chicago, Mahone reviews files recovered from Michael''s hard drive, and begins to piece things together.', '\n      Sep. 18, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(825, 8, 'episode', 'Subdivision', 2, 6, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Mahone arrives in Salt Lake City, trying to locate exactly where in Utah the escapees are. Michael and Linc hatch a plan with T-Bag and Tweener that will enable them to dig in the right place. C-Note and Sucre meet on the highway and head toward Tooele. Kellerman, in Washington, D.C., briefs Kim. Governor Tancredi phones Sara with a warning.', '\n      Sep. 25, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(826, 8, 'episode', 'Buried', 2, 7, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Michael''s plan has hit a snag when the home owner''s daughter, a cop, arrives. Mahone argues with Lyle Sands about how to proceed, but ultimately hopes that Tweener, in FBI custody, will reveal the location of the other escapees. Sara is now suspicious of Kellerman, so he tries something different to find Lincoln Burrows. In an Arizona detention facility, L.J. finds out he''s to be released the next day; Linc drives to get him. Haywire, in Wisconsin, steals supplies from a camping shop.', '\n      Oct. 2, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(827, 8, 'episode', 'Dead Fall', 2, 8, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'In his efforts to try to get hold of all of the money Sucre runs into some unexpected difficulties. And Captain Bellick and his partner have not given up on finding their old inmates.', '\n      Oct. 23, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(828, 8, 'episode', 'Unearthed', 2, 9, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Michael tries to retrieve an item from Blanding Botanical Garden in Utah, but Mahone''s people got to it first. Mahone believes that someone on his team is leaking information to the press; meanwhile Michael does some research on Mahone at an Internet café, then makes a trip to Durango, Colorado, to see a woman there. Linc and L.J. are on the road in Arizona. C-Note is in Chicago, and Agent Lang tries to use his wife to capture him. Bellick and Geary phone C.O. Patterson, at Fox River, to get information on where they should look for T-Bag. Sara is at a motel in Elgin,...', '\n      Oct. 30, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(829, 8, 'episode', 'Rendezvous', 2, 10, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Captain Bellick tortures T-Bag for the money during which T-Bag swallows the key and Bellick uses dirty tricks to get the key out.Bellick and Mac leave T-Bag on the boundary of the police.Sarah and Michael Scofield meet,but they are constantly chased by Alexander Mahone.Michael gets close to Mahone''s helplessness.Meanwhile Lincoln Burrows and LJ are rescued by Lincon''s dad but they are still not shielded from the dirty political games. Sucre tries to contact Maricruz but that plan fails because of the state police doing rounds.', '\n      Nov. 6, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(830, 8, 'episode', 'Bolshoi Booze', 2, 11, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'In Maljamar, New Mexico, Michael takes what he needs from a sporting-goods store, then has a crisis of conscience. In Tribune, Kansas, T-Bag narrowly escapes the police but has to leave his hand behind. In Trinidad, Colorado, the three Burrowses discuss politics, but face an unexpected threat. In Gila, New Mexico, Kellerman ties up Sara and resolves to get what he needs from her. Mahone meets Kim for the first time. Bellick receives treatment for the blow to his forehead, and interacts with a local police detective.', '\n      Nov. 13, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(831, 8, 'episode', 'Disconnect', 2, 12, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Picking up from where we left off, Sucre, Michael, Linc, and Aldo are together, with Mahone on their trail. Sara is face-down in the bathtub as Kellerman prepares to dispose of her body. C-Note is in Harvey, North Dakota with Kacee and Dede, who needs her medication. In Tribune, Kansas, Detective Slattery questions Bellick.', '\n      Nov. 20, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(832, 8, 'episode', 'The Killing Box', 2, 13, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'In Kansas T-Bag assaults and presumably kills a veteran and steals his prosthetic hand. He singles out an employee of the post office named Denise and romances her. In order to locate his ex-girlfriend (Susan Hollander) who turned him into the authorities, T-Bag lies and convinces the post officer worker to give him Susan''s address. Just as she provides him with the information, Denise spots his wanted poster on the post office wall, and T-Bag kills her. In Kansas, Susan opens her door and finds T-Bag standing there. Faced with a potential death penalty sentence, ...', '\n      Nov. 27, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(833, 8, 'episode', 'John Doe', 2, 14, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Linc and Michael have decided to take the keys and escape, figuring at least they''ll go down fighting. FBI Special Agent Alexander Mahone chased them while staying in contact with Secret Service Special Agent Paul Kellerman who suddenly shot Mahone and gave the brothers a ride because he wants revenge on the White House; Linc wants his instead, but is offered the location of Terence Steadman. T-bag visits his wife, who tells him the children think he''s their Uncle Teddy on an oil rig, but he moves in; when his wife gets the gun, he attacks her and son Zach him, so he ...', '\n      Jan. 22, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(834, 8, 'episode', 'The Message', 2, 15, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'In Cutback, Montana, Kellerman lures the police and Michael and Lincoln abduct the cameraman Greg of Fox News and succeed in escaping from the siege. Michael and Lincoln decide to tape a message to be released in the Breaking News. Mahone is back in Chicago and analyzing the message; he interrogates Greg and he tells that he had overheard Michael tell that they should cover 460 miles in six hours. Mahone deducts that they intend to meet President Caroline in Denver. Wheeler discusses with Mahone and yells that the internal affair asked him to follow all moves of ...', '\n      Jan. 29, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(835, 8, 'episode', 'Chicago', 2, 16, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Sara meets Michael and Lincoln in a train station in Evansville, Indiana; when she sees Kellerman with them, she becomes disturbed and upset. Kellerman tells that she has a key of a private cigar club in Chicago. Caroline calls Kellerman and he tells that he is heading to Chicago by train, and she promises his life back, inclusive the chief of staff position. T-Bag tells Susan that they are passing through an "adjustment period" in their lives; when she tells him that she will have a guest called Patty Wallace, T-Bag welcomes Patty with a magnificent family brunch and...', '\n      Feb. 5, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(836, 8, 'episode', 'Bad Blood', 2, 17, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Michael Schofield and Sara Tancredi fail to get the tape from the Corona de Oro cigar club in Chicago, where security was at the ready, and turn to former warden Henry Pope, a club member, but he wants to call the police, so Michael draws his gun and hands it over to prove his veracity; Sarah convinces him to go in with her late fathers humidor key- he finds a computer memory stick. In Mexico, Fernando Sucre has car trouble and gets a ride- from an Ixtapa airport security employee, who sees his wanted-poster just after they parted at the airport, so he must run with ...', '\n      Feb. 19, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(837, 8, 'episode', 'Wash', 2, 18, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Captain Brad Bellick walks in the FBI office demanding Mahone pays him. Michael and his companions are impressed with the recordings on the stick, but it only helps if Kellerman''s contacts in Washington use it right, notably high Justice official Cooper Green, who accepts to meet and cooperates, but is tailed by Kim''s men. Linc calls his boy L.J., who refuses to give up his relatively normal life till further notice. Sarah meets Bruce Bennett. Bellick tries to bribe Sucre''s incarcerated cousin into betraying his Mexican whereabouts. T-Bag finds therapist Dr. Stammel ...', '\n      Feb. 26, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(838, 8, 'episode', 'Sweet Caroline', 2, 19, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'C-note has jumped with the noose around his neck, but is saved by jailers; he has Malone told he''ll still do it. At a Chicago hotel, president Caroline Reynolds is expected for a speech. Michael sends the real Cooper Green away and agrees a meeting point with Linc and Sarah. Malone enters Sarah''s room and only pretends to fail looking under the bed to trap her, she pretends the brothers left her. In Mexico T-bag finds Bellick is waiting at the luggage conveyor and must get his from the service side, but the laborer he knocks down falls onto it, so he must run. Lincoln...', '\n      Mar. 5, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(839, 8, 'episode', 'Panama', 2, 20, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Now Caroline Reynolds has stepped down as president, she can no longer sign a pardon, so the brothers must immediately disappear, forever. At the pier, Sarah realizes she''s being tailed and pretends on the phone already to be on board, so they sail without her while she is arrested; Lincoln stops Michael from returning for her. A week later, an FBI big-whig offers C-note a lesser sentence for testimony against Mahone, even freedom and witness protection for his family- bingo. Fernando grabs Bellick''s gun while looking for T-bag, but he shows a crucifix to prove he has...', '\n      Mar. 19, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(840, 8, 'episode', 'Fin del camino', 2, 21, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Linc finds Michael is gone from their Christina Rose yacht after receiving Sucre''s message (also intercepted by Mahone, who thinks to have found his way out) scary scumbag T-bag is in Panama City''s Fin del Camino hotel with the money. A fire-cracker he pays a local boy to plant shows Michael Mahone''s two plants on the plaza, but Bellick pulls his gun at him, accompanied by Fernando who denies sending the message- Schofield smells a trap and states their goals: money for Bellick, Maricruz for Sucre, T-bag for him, then reminds Fernando in private Maricruz is his ...', '\n      Mar. 26, 2007\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU3NzIzMzI3M15BMl5BanBnXkFtZTYwMTIzNzY3._V1_SY180_CR75,0,120,180_.jpg'),
(841, 8, 'episode', 'Sona', 2, 22, 'http://www.imdb.com/title/tt0455275/episodes?season=2&ref_=tt_eps_sn_2', 'Only back at the yacht, Michael notices Lincoln is gone and calls him- Alex Mahone tells him Linc is no cold-blooded killer, so he was overpowered and hand-cuffed, and the ransom is the yacht and the fortune he assumes to be in it, to be agreed in five minutes, now Mahone is even more wanted then the brothers. Kellerman''s self-incriminating testimony and documents he brings get all charges against Sarah and Lincoln dropped, him arrested. Mahone calls Kim to fly over immediately. Alex calls his wife, to make her bring the kids for a holiday in her native Colombia, at ...', '\n      Apr. 2, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(842, 8, 'episode', 'Orientación', 3, 1, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Michael is once again imprisoned, but now in SONA (Panama), together with T-Bag, Mahone and Bellick. The prison is solely rules by inmates, whose local prison-lord Lechero feels threatened by Scofield''s ''fame''. Lincoln tries legal means to get Michael transferred, and gets a call from a relative. Both receive the same message, through different canals, presumably from Bill Kim''s organization.', '\n      Sep. 17, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(843, 8, 'episode', 'Fire/Water', 3, 2, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'After Michael gets bad news from Linc, he sets out to find a prisoner named James Whistler, who holds the key to his freedom. That''s easier said than done: James Whistler is hiding in Sona because there''s a price on his head, and Lechero is not about to help Michael find him. In addition, both Mahone and Bellick want to get to Whistler too. Meanwhile, T-Bag won''t allow a little humiliation stop him from insinuating himself into Lechero''s good graces.', '\n      Sep. 24, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(844, 8, 'episode', 'Call Waiting', 3, 3, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Lincoln tries to save LJ and Sara. But he can''t. Meanwhile, Michael has a phone conversation with Sara. And Lincoln gets a call from Susan B. saying that she put something in the garage for him.', '\n      Oct. 1, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(845, 8, 'episode', 'Good Fences', 3, 4, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Aftermath of Sara''s death, Lincoln decides not to tell about it to Michael. Susan B. told Lincoln that if he does something wrong again, she''s going to send pieces from LJ to him. Meanwhile, Sucre got a job in Sona. And Sofia starts to help Linc.', '\n      Oct. 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(846, 8, 'episode', 'Interference', 3, 5, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'A test with a rat proves the tower snipers are very good, so Michael figures breaking out with Whistler within 24 hours has to be at 3 PM, during a distracting soccer game. Sucre accepts $5,000 from a limousine man to smuggle a package into Sona. Linc is to arrange transport outside, but gets turned away roughly by an army patrol at two miles with Marisol in her car, then tells her Sara has already been killed, he keeps it from Michael as L.J. is his ultimate priority. New prisoner Andrew Tyge is robbed to his boxers at arrival, and warned off by Alexander Mahone ...', '\n      Oct. 22, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(847, 8, 'episode', 'Photo Finish', 3, 6, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Tyge tells Michael he and ''Mcfadden'' where co-employees in a Nice hotel, Mahone worries he keeps observing Whistler. Having to re-plan hastily, Michael tells Linc to drug the second guard''s coffee wherever he goes for lunch, and demands pictures of L.J. and Sara before he escapes. Malone refuses a term reduction to 8 years for testimony against the government and Burrow''s conspiracy: now he faces life. Tyge is stabbed dead, Lechero questions Menudo ''McGrady'' and has Whistler dragged away for confession. Michael believes Mahone and Bellick''s denials; T-bag offers ...', '\n      Nov. 5, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(848, 8, 'episode', 'Vamonos', 3, 7, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Alexander Mahone is assured all he has to do is tell the truth, enjoying full immunity. Michael tells Whistler their row is part of a diversion, the escape is now or never, before the guard''s coffee drug wears off. Just when the critical sun reflexion blinds the other tower guard, they must wait and hide till Sammy has passed, but get trough the cut bars. Lechero sees them climb down and back in -time ran out- but refuses to allow them to cancel their duel to the death in the courtyard, meant as a diversion fake announcement. Sofia draws a gun at Linc to prevent him ...', '\n      Nov. 5, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(849, 8, 'episode', 'Bang and Burn', 3, 8, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Lincoln tells Michael that they have four more days to rescue Whistler, but Michael is upset with his brother that used him. Gretchen has a meeting with General and they decide to use power to release Whistler in an operation called "Bang and Burn"; later she asks Whistler to kill Michael. In Sona, the guards reinforce the bars in the windows, and Michael tells Lechero that this way it will be difficult to break-out. Sammy requests more men to Lechero to keep Sona under control. Sofia receives a call from Whistler''s mysterious landlord telling that he has some "...', '\n      Nov. 12, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(850, 8, 'episode', 'Boxed In', 3, 9, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'After the helicopter failed to break out Whistler, Sona''s new commander, Panamanian general Zavala, decides to make Michael talk by putting him into the sun-exposed isolation hot-box, promises to help in exchange for the truth, verifies the L.J-situation and is told it''s about Whistler, who already realized the tunnel is a no-go without engineer Schofield but denies blatantly to Zavala- and is threatened with torture until he admits to collaborating with Michael, who convinces him next to give up Gretchen Morgen''s name. Linc was meanwhile shown L.J., alive, as ...', '\n      Jan. 14, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(851, 8, 'episode', 'Dirt Nap', 3, 10, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Papa is dead and Sammy presses Lechero to kill Michael; Lechero replies that he also wants Michael dead, but he does not want an uprising in Sona. Mahone receives a mail with a picture of his son. Lechero, Michael, Mahone, Whistler and T-Bag inspect the hole in the tunnel and Michael requests a saw and hammer to support the tunnel. Sammy takes the power of Sona with the pistol delivered by Augusto and other three gangsters and promises a box of bottles of rum for the inmate that kills Michael. T-Bag convinces Bellick to give the chicken foot to Sammy promising him to ...', '\n      Jan. 21, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(852, 8, 'episode', 'Under & Out', 3, 11, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Michael concludes that they are behind schedule and they have twenty-four hours to dig a tunnel. However, when it begins to rain, he tells them that they must change the plans and break-out during the night since the tunnel will collapse. McGrady asks Michael to go with him, but he is in doubt whether he should escape with criminals like Lechero, T-Bag, Bellick and the mysterious Whistler. Michael believes he is paying for his sins in Sona. Later he confesses that he is tired of causes and consequences and invites McGrady to join the break-out team. Gretchen delivers ...', '\n      Feb. 4, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(853, 8, 'episode', 'Hell or High Water', 3, 12, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'When Lechero, T-Bag and Bellick run to the fence, they are captured by the guards. However, this was the real plan of Michael that waits with Whistler, Mahone and McGrady the exact moment to leave the hideout. When Bellick shows the tunnel, the quartet breaks-out Sona, meeting with Lincoln on the beach, where Whistler notes that he lost the book with the coordinates. They use breathing apparatuses and swim underwater to a buoy, waiting for Sucre. However their fellow is cuffed to a file drawer in Sona. But McGrady''s father finds the boat 312 moored in the marina and ...', '\n      Feb. 11, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(854, 8, 'episode', 'The Art of the Deal', 3, 13, 'http://www.imdb.com/title/tt0455275/episodes?season=3&ref_=tt_eps_sn_3', 'Michael and Lincoln chase Whistler (who calls Gretchen) in the warehouse. However the brothers capture him and Michael schedules the exchange meeting in the public space Plaza de Francia. Gretchen invites him to join The Company, and he changes the spot to the lobby of the Museum of Antiques. Meanwhile, McGrady''s truck is stopped for inspection in a police barrier and the policemen sees that the cargo is fertilizer; however, McGrady is hidden in a hideout in the cabin. Then his father drives to Acandi, Colombia, where he is welcomed by his family and friends with a ...', '\n      Feb. 18, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(855, 8, 'episode', 'Pilot', 1, 1, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael Scofield is imprisoned in Fox River State Penitentiary. He finds his brother, Lincoln Burrows, who is a death row prisoner, and tells him that he is going to break them both out of the prison.', '\n      Aug. 29, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(856, 8, 'episode', 'Allen', 1, 2, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Trouble is inevitable in the prison, with a race riot imminent. Michael has problems retrieving a screw from the bleachers. Veronica receives a security tape that shows Lincoln shooting Terrence Steadman.', '\n      Aug. 29, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(857, 8, 'episode', 'Cell Test', 1, 3, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Two steps forward and one step back. Michael gets Abruzzi on his side and proves Sucre''s trustworthiness, but then loses a valuable piece of his plan.', '\n      Sep. 5, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(858, 8, 'episode', 'Cute Poison', 1, 4, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael gets more of the tools and people he needs, but someone very high up has taken notice and started wondering what he''s up to.', '\n      Sep. 12, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(859, 8, 'episode', 'English, Fitz or Percy', 1, 5, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael gains a necessary piece of information to effect his escape, but can he keep the Warden from kicking him out?', '\n      Sep. 19, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(860, 8, 'episode', 'Riots, Drills and the Devil: Part 1', 1, 6, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael''s idea to get more drilling time by provoking a lock-down backfires horribly.', '\n      Sep. 26, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(861, 8, 'episode', 'Riots, Drills and the Devil: Part 2', 1, 7, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael saves Dr. Tancredi from the rioting prisoners, but Lincoln and Veronica are in need of their own rescue.', '\n      Oct. 3, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(862, 8, 'episode', 'The Old Head', 1, 8, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Veronica and LJ must go into hiding, while Michael unwittingly provides Westmoreland''s motivation to aid the escape.', '\n      Oct. 24, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(863, 8, 'episode', 'Tweener', 1, 9, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'With Abruzzi becoming more desperate to regain authority within the prison, it seems that Fibonacci''s number is up.', '\n      Oct. 31, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(864, 8, 'episode', 'Sleight of Hand', 1, 10, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael hands over an address to Falzone, allowing work to resume on the tunnel. Meanwhile, the VP enlists the help of a dangerous specialist.', '\n      Nov. 7, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(865, 8, 'episode', 'And Then There Were 7', 1, 11, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael gets a visit from his wife, while Veronica and Nick get a visit from Quinn.', '\n      Nov. 14, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(866, 8, 'episode', 'Odd Man Out', 1, 12, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'C-Note overhears Michael and Lincoln discussing that there are too many fugitives for available time and they share the information with the group telling that one shall be left behind. T-Bag feels threatened and calls his cousin James Bagwell, disclosing the escape plan and asking James to call the Warden Pope in case T-Bag does not contact him later. Abruzzi asks his outside man to kidnap James, but things go wrong and the mobster kills James and his five years old son Jimmy. Abruzzi feels guilty for the death of the child and feels the need of God''s forgiveness, ...', '\n      Nov. 21, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(867, 8, 'episode', 'End of the Tunnel', 1, 13, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'The escape is about to go through when the team hits a stainless steel snag, while Veronica is just a moment too late to get all the information she needs to prove Lincoln''s innocence.', '\n      Nov. 28, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(868, 8, 'episode', 'The Rat', 1, 14, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'With the pipe to the infirmary replaced and Lincoln''s life hanging in the balance, Michael must rethink his plan to escape and save his brother''s life. A fellow inmate may hold the key to preventing Lincoln''s execution.', '\n      Mar. 20, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(869, 8, 'episode', 'By the Skin and the Teeth', 1, 15, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Michael''s plan to escape has failed. While Lincoln is strapped to the electric chair, he sees an oddly familiar face in the crowd. Is there one last hope to save Lincoln''s life, or has his journey reached an end?', '\n      Mar. 27, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(870, 8, 'episode', 'Brother''s Keeper', 1, 16, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Flashbacks provide exposition on how the inmates arrived at Fox River Penitentiary from The Company''s framing of Lincoln to the creation of Michael''s plan to save his brother''s life.', '\n      Apr. 3, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(871, 8, 'episode', 'J-Cat', 1, 17, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Having burned his shoulder, Michael''s tattoo that showed the path through psych ward is now incomplete. With another inmate intimidated into snitching about the escape plans, Michael Scofield must use his wits to find a new way out of Fox River.', '\n      Apr. 10, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(872, 8, 'episode', 'Bluff', 1, 18, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Improvising a new plan, Michael seeks out an acquaintance who may hold the key to his escape plan. In gen pop, the other members of the P.I. crew learn that the guards are auctioning Michael''s cell to the highest bidder. Lincoln and Sucre devise a scheme to get Michael returned to gen pop. Veronica informs Lincoln that L.J will be tried for his mother''s murder, and Lincoln desires to see his son.', '\n      Apr. 17, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(873, 8, 'episode', 'The Key', 1, 19, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'After the crash, Kellerman tries to suffocate Lincoln, but he is saved in the last moment by a stranger. Sucre leaves the solitary confinement and Michael tells to his partners that he has completed the map, but he needs the key of the infirmary. Abruzzi is back to Fox River, apparently converted in a religious man. Warden Pope sends Captain Bellick to find Lincoln before notifying the authorities. Nick tries to convince Veronica that they are losing time checking the calls of Quinn''s cell phone. Michael kisses Sara and asks her to wait for him. Tweener is in trouble ...', '\n      Apr. 24, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(874, 8, 'episode', 'Tonight', 1, 20, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Westmoreland uses Bellick to plug a hole in the escape plan, which forces Michael to move up the breakout timetable. A fearful Tweener pledges his loyalty to Michael and in return may get out of jail for free; Michael feels that he has no choice but to involve Sara in the plan and must betray his father figure; and Veronica finds her life in jeopardy from her closest ally, who has a surprising connection to a Fox River inmate.', '\n      May 1, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(875, 8, 'episode', 'Go', 1, 21, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'Dr. Sarah questions if she should leave a light on and the door open for Michael, who must betray the Pope in order to carry out his escape plan. Veronica finds evidence that points her to Montana, but realizes that her closest ally may actually be her greatest enemy. Michael, Lincoln and the other inmates make a break for it, but after the alarm is sounded, find out who will make it over the wall, who will be left behind and who will leave the prison in a body bag.', '\n      May 8, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(876, 8, 'episode', 'Flight', 1, 22, 'http://www.imdb.com/title/tt0455275/episodes?season=1&ref_=tt_eps_sn_1', 'As the escape continues, lives are lost and Pope and Bellick do everything in their power to capture the convicts.', '\n      May 15, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(877, 8, 'episode', 'Scylla', 4, 1, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'In Los Angeles, Michael is tracking Whistler and Gretchen seeking revenge for the death of Sara. They go to the Roosevelt Hotel to buy a fifty million dollars card called Scylla. Whistler kills the sellers, copies the card but he is surprised by Michael. When Gretchen arrives, she discloses that Sara is alive. Later Gretchen meets General Jonathan Krantz in the Mojave Desert in California and he tells her that she has failed and asks his black agent Wyatt to kill her. Michael calls Lincoln in Panama and he reveals that Sofia and LJ are all right, Sona has burns and ...', '\n      Sep. 1, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE3NTI3MjkyN15BMl5BanBnXkFtZTcwMDUyODY4MQ@@._V1_SY180_CR24,0,120,180_.jpg'),
(878, 8, 'episode', 'Breaking and Entering', 4, 2, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'In LA, General Krantz tells Wyatt that he wants Michael, Lincoln and Mahone dead. Agent Self forces Michael and his crew to wear monitor around their ankles, and their first assignment is to find the Scylla card. Mahone recalls that Whistler delivered the card to a card holder, and he noted that the driver probably would be a retired military. Using the information from the IRS, they find the identity of the driver. Meanwhile, T-Bag and Sancho head to San Diego in the desert. The hungry Sancho attacks T-Bag, who kills the Mexican while defending himself, and survives ...', '\n      Sep. 1, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgyNDk5NTk1M15BMl5BanBnXkFtZTcwMjUyODY4MQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(879, 8, 'episode', 'Shut Down', 4, 3, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'In Los Angeles, Michael argues with Agent Self since there are six cards and not only one. The agent gives the rest of the day to find a second card holder; otherwise the project would be shutdown by The Powers That Be and the group would be sent to prison. Mahone calls Agent Lang in Gainesville, Florida, and asks her information about the death of his son. Lincoln overhears the conversation. Wyatt tortures Bruce with drugs; when he gets the information that Sara is in LA, he kills his victim. Agent Self meets Director Herb and ask him to call Senator Dalo to give ...', '\n      Sep. 8, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA2NDM0OTEwOTleQTJeQWpwZ15BbWU3MDA2NzAzOTE@._V1_SX120_CR0,0,120,180_.jpg'),
(880, 8, 'episode', 'Eagles and Angels', 4, 4, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'The boys now know who the five other Scylla-holders are, and trace one to Turkish consul Tabak''s wife Lisa, who is about the leave on mission for the General but first attends a fallen LAPD men benefit, ''Eagles and Angels''. The team first accidentally spots and corners T-bag must let him go as a cop passes, so ''Mr. Cole Pfeiffer'' can take the corner office as sales record breaker according to the bird book plan. Team Scofield steals police badges and he gets close enough to Lisa to scan her card, while Linc is recognized and held at gunpoint but kills her Company ...', '\n      Sep. 15, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4ODg2MTA2NF5BMl5BanBnXkFtZTcwNjMxMjQ5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(881, 8, 'episode', 'Safe and Sound', 4, 5, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Sara notes that Bruce''s credit card is missing from her purse and she sees Wyatt on her tail; she runs and succeeds in escaping from the hit-man. Agent Self recognizes the Treasure Department Director, Griffin Oren, in one of the pictures took by Michael in the card holders gathering. Mahone meets Pam in a dinning and she recognizes Wyatt in one of the pictures. Sucre and Bellick chases T-Bag telling to the receptionist Trishanne that he has an award to receive from an insurance policy; Trishanne recognizes his picture, but she decides to negotiate with T-Bag a better...', '\n      Sep. 22, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk3MjU5MTE3Ml5BMl5BanBnXkFtZTcwNTc4MzU5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(882, 8, 'episode', 'Blow Out', 4, 6, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Michael and his group are in the jockey chasing card number five. Michael and Mahone plant the device in the office of the operation manager; Bellick argues with the clerk in the counter and Lincoln plants a device in the horse''s gate, provoking a delay in the opening of one of the gates. When Nataniel Edison goes to the office to complain with the manager, the fourth card is copied. However Mahone is arrested while retrieving the device and sent to the precinct. Meanwhile the disturbed Gretchen arrives at her sister''s house in Riverside, California, and gets a pistol...', '\n      Sep. 29, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTIzOTQwOTcwNF5BMl5BanBnXkFtZTcwOTU4MTY5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(883, 8, 'episode', 'Five the Hard Way', 4, 7, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Gretchen tortures T-Bag and asks about the Bird''s Guide and Scylla. Meanwhile, the Agrishow executive Howard Scuderi travels with his wife and the fifth card to Las Vegas. General Krantz calls Wyatt and tells him that Don Self is the head of the snake that is threatening The Company, and he asks the killer to eliminate Self, simulating an accident. Trishanne calls Bellick and says that she has information about T-Bag, and requests the promised reward. Michael stays with Bellick and Mahone to chase T-Bag while the rest of the group travels to Las Vegas. Bellick calls ...', '\n      Oct. 6, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjMzNTU5ODU0N15BMl5BanBnXkFtZTcwNjU1Njc5MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(884, 8, 'episode', 'The Price', 4, 8, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Lincoln proposes to crash the General''s car to copy the last card using the trick he did in 2001, in Chicago, to rob a wallet. Michael tells Sara that Gretchen is alive and dealing with Agent Self a partnership together with T-Bag. Sara is disturbed with the new partner and recalls the torture she was submitted to. Roland sends an untraceable message to Wyatt asking how much he would pay for Michael and Lincoln. Mr. Feng visits T-Bag in his office in Gate, but Gretchen negotiates Scylla for US$ 125 million, offering US$ 25 million to T-Bag. Lincoln plans the accident ...', '\n      Oct. 20, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(885, 8, 'episode', 'Greatness Achieved', 4, 9, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Lincoln unsuccessfully beats up Wyatt, trying to force him to call General Krantz and tell him that he killed the brothers. Then Self arrives with a wallet and says that he needs to talk with Wyatt - Sara goes to the cell under the surveillance of Mahone. Lisa tells Krantz that she needs three days to move Scylla, and he orders the distribution of the pictures of Michael and his group to the press. Michael, Lincoln, Bellick and Sucre go to T-Bag''s office in Gate, find the pipe conducting the water supply of LA and conclude that it is impossible to dig the concrete ...', '\n      Nov. 3, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BNjAwMDk3MDg1NF5BMl5BanBnXkFtZTcwMjcyMTIwMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(886, 8, 'episode', 'The Legend', 4, 10, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Michael''s group is sad with the death of Bellick, and they demand that Self sends his body to his mother. Michael asks for the missing pages from Self and Gretchen returns and tells that The Company is moving Scylla to a bunker in Pennsylvania. Michael tells that the map does not make sense, but he deciphers the message "CME David Baker" meaning "See me David Baker". Trishanne commits a serious mistake, mentioning the name of Frank Whistler to T-Bag while giving Gretchen''s file to him. The smart criminal investigates and finds that the receptionist is actually a ...', '\n      Nov. 10, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI2MzE0NDUxOV5BMl5BanBnXkFtZTcwODcxMjMwMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(887, 8, 'episode', 'Quiet Riot', 4, 11, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'The team is finally ready to break into the Company''s Scylla facility. After his diagnosis, Michael considers taking Sara''s advice to have his urgent surgery immediately, but still presides over the job. Gretchen meets her lover, the General, to get his sixth and last card, but he finally sees through her. Client Feng cuts her and Bagwell a deal, nonetheless, to take on Self.', '\n      Nov. 17, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2ODc5Njk4Nl5BMl5BanBnXkFtZTcwODYwNDQwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(888, 8, 'episode', 'Selfless', 4, 12, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Despite his headaches, Schofield successfully breaks in. The General rushes a security team down, and thus provides the last missing element: his sixth card! He''s still confident to bribe the team or just keep them locked in, but Sara provides leverage: Lisa, his daughter. Bagwell and Gretchen are found out and shoot their way out. Scylla is delivered to Self, who promises the boys their freedom in half an hour, but doesn''t deliver, and... worse.', '\n      Nov. 24, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI4NjQ4MzAyMV5BMl5BanBnXkFtZTcwODMyOTUwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(889, 8, 'episode', 'Deal or No Deal', 4, 13, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Self calls Herb and says that Lincoln has killed Miriam and pretends that he was also shot by Lincoln. The disturbed General Krantz recalls Michael''s words; during a meeting with the board of The Company, he is questioned by Howard Scuderi and he unexpectedly kills him and asks if there were any further questions from the other participants. Lisa is shocked with the attitude of her father. Herb calls Michael believing that Lincoln has killed two federal agents. Self brings T-Bag seeking out Gretchen. Michael faints in the toilet, Lincoln helps him and Sara injects a ...', '\n      Dec. 1, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYyMDk1MTc4OF5BMl5BanBnXkFtZTcwMDY3MjcwMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(890, 8, 'episode', 'Just Business', 4, 14, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Sara gives Michael another injection tells him he needs a doctor. The lookout Lincoln keeps watching on the outside of the warehouse; when Self throws gas bombs trying to force Michael and his group to leave the place, Lincoln surprises Self, hits him on his back and brings him into the warehouse. Self justifies that his motivation was not personal, just business, and proposes to sell Scylla and share the amount among the whole group; however Gretchen appears out of the blue and balances the situation and they leave the warehouse without a shootout. Meanwhile, Mahone ...', '\n      Dec. 8, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk0Nzc2NTQxMF5BMl5BanBnXkFtZTcwNzk1OTUxMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(891, 8, 'episode', 'Going Under', 4, 15, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'General Krantz tells Lincoln that the price of Michael''s surgery is the safe return of Scylla. Lincoln tortures T-Bag to find the location where Self and Gretchen will deal with the buyer; after losing two teeth, T-Bag says that the meeting place will be at Arlington Pier at 3:00 PM. Lincoln and Sucre head off to the Pier, but Rita calls Gretchen and says that the Company abducted T-Bag. When they arrive, Self and Gretchen have already gone. Sara stays with Michael and she does not recognize the equipment and the procedure in the surgery room, but the doctor informs ...', '\n      Dec. 15, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1MjkwMjg4MF5BMl5BanBnXkFtZTcwNTY5MDAyMg@@._V1_SY180_CR75,0,120,180_.jpg'),
(892, 8, 'episode', 'The Sunshine State', 4, 16, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Lincoln calls Sara from Miami asking for news about Michael and tells that he is trying to retrieve the Scylla for The Company with Gretchen, T-Bag and Self. They find a lead in the Grafton Club, and Lincoln goes to the place where he abducts Tia Hayden trying to find the representative of the owner of Scylla. Meanwhile Michael awakes locked in a house in the woods under the surveillance of bodyguards of The Company. The psychiatrist, Dr. Roger Knowlton, tells him that his mother is alive and is working for ''The Company'' in the Madagascar Rainforest. He wants to ...', '\n      Dec. 22, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcyMDI2MzM2NF5BMl5BanBnXkFtZTcwNTM3MjEyMg@@._V1_SX120_CR0,0,120,180_.jpg'),
(893, 8, 'episode', 'The Mother Lode', 4, 17, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Lincoln and his men (Self, T-Bag, Mahone) are trying to find Scylla. They try to find a clue for the key from the fake buyer who killed Gretchen. They find a Church and an Estate that matches with key. When Lincoln and Mahone investigate the Estate, Lincoln finds a picture of him with his mother. Mahone finds out that, picture was edited and some clue about meeting place. Lincoln takes the meeting and finds his mother. Christina wants 2 days from Lincoln for eliminating Krantz. By the way Company''s men finds Michael and Sara, they run away with truck and escape again....', '\n      Apr. 17, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgxNjc1Nzg5OV5BMl5BanBnXkFtZTcwNjQyOTc0Mg@@._V1_SY180_CR70,0,120,180_.jpg'),
(894, 8, 'episode', 'VS.', 4, 18, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Realizing Linc isn''t going to stay out for days as she asked ''to give the Company a maternal head'', Christina orders her own son sniper-shot, but the team saves him. They follow her to the Indian embassy, where she offers the Skylla virus data. Michael and Sara have escaped and agree to collaborate with Mahone. The general and Vincent Sandinsky, the man that Michael discovers is hunting him, rival with Christina.', '\n      Apr. 24, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI2ODQ4Nzk3Nl5BMl5BanBnXkFtZTcwMDk5NTk0Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(895, 8, 'episode', 'S.O.B.', 4, 19, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Michael warns Linc that scientist Vincent Sandinsky is somehow in league with their mother Christina. The general takes torturous charge, and traitor Vincent, Company expert. Michael and Sara fail to reason with captive Christina, who says Lincoln is adopted. Bagwell wants Company tenure, his ''exam'' being an execution. Christina escapes. Everyone heads for the Miami global energy technology congress. Malone smells a set-up.', '\n      May 1, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(896, 8, 'episode', 'Cowboys and Indians', 4, 20, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Michael and Lincoln are trapped in the Panda Bay Hotel and seek a means of escape. Self tries to help them while General Krantz sends a man to capture the brothers. Meanwhile Christina sells Scylla to the grieving president of India for ¾ of billion dollars; then she decides to contact the China government to sell Scylla also for them. However, Michael, Lincoln, Mahone and Self steal Scylla from Christina and her henchman in a bank, while she is checking the deposit but In the runaway, Lincoln is captured by Christina''s men. T-Bag abducts Sara and General Krantz calls...', '\n      May 8, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(897, 8, 'episode', 'Rates of Exchange', 4, 21, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'Krantz holds Sara captive, Christina even shot Linc in a lung for urgency, each demands Scylla as ransom. Michael tries to cheat his mother, but only a driver is hurt in his tripwire explosion. FBI Agent Chris Franco finds and tortures Self in hospital with a splintered leg, who gets an immunity deal. Linc tells Michael Sara is pregnant. He now offers Scylla for her to Krantz, who still plans him killed and leaves her to Bagwall. PM Naveen Banerjee looses his patience with Christina. Malone promises her Scylla, yet lets Michael take the box. Downey poisons Self. ...', '\n      May 15, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzgzODgyMTQ4NF5BMl5BanBnXkFtZTcwODU0ODU1Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(898, 8, 'episode', 'Killing Your Number', 4, 22, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', 'According to Michael''s plan, Malone hands a fake Scylla to Christina. It''s booby-trapped but ends up in the hands of FBI Agent, Chris Franco. Bagwell meets Sucre and C-note, but is caught while they hope that an offer of help is real. The General catches the brothers and raises the stakes with more kidnapped relatives. Michael manages to escape with Scylla. The gang must decide whether to believe an offer from Paul Kellerman, and hand it to UN representatives in exchange for full pardons.', '\n      May 15, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(899, 8, 'episode', 'The Old Ball and Chain', 4, 23, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', '', '\n      May 24, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(900, 8, 'episode', 'Free', 4, 24, 'http://www.imdb.com/title/tt0455275/episodes?season=4&ref_=tt_eps_sn_4', '', '\n      May 24, 2009\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(901, 9, 'episode', 'A Scandal in Belgravia', 2, 1, 'http://www.imdb.com/title/tt1475582/episodes?season=2&ref_=tt_eps_sn_2', 'The government hires Sherlock and John to confiscate something of importance from a mysterious woman, named Irene Adler. But she may be more than Sherlock can handle.', '\n      Jan. 1, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY2MjU3NTYwMV5BMl5BanBnXkFtZTcwNjYzMzU3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(902, 9, 'episode', 'The Hounds of Baskerville', 2, 2, 'http://www.imdb.com/title/tt1475582/episodes?season=2&ref_=tt_eps_sn_2', 'Sherlock and John investigate the ghosts of a young man who has been seeing monstrous hounds out in the woods where his father died.', '\n      Jan. 8, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTY5NTQ0MDM5MF5BMl5BanBnXkFtZTcwNDYzMzU3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(903, 9, 'episode', 'The Reichenbach Fall', 2, 3, 'http://www.imdb.com/title/tt1475582/episodes?season=2&ref_=tt_eps_sn_2', 'Moriarty turns the whole city against Sherlock.', '\n      Jan. 15, 2012\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(904, 9, 'episode', 'The Empty Hearse', 3, 1, 'http://www.imdb.com/title/tt1475582/episodes?season=3&ref_=tt_eps_sn_3', '', '\n      Sep. 15, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(905, 9, 'episode', 'The Sign of Three', 3, 2, 'http://www.imdb.com/title/tt1475582/episodes?season=3&ref_=tt_eps_sn_3', '', '\n      Sep. 22, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(906, 9, 'episode', 'Episode #3.3', 3, 3, 'http://www.imdb.com/title/tt1475582/episodes?season=3&ref_=tt_eps_sn_3', '', '\n      Sep. 29, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(907, 9, 'episode', 'Unaired Pilot', 1, 0, 'http://www.imdb.com/title/tt1475582/episodes?season=1&ref_=tt_eps_sn_1', 'Invalided home from the war in Afghanistan, Dr. John Watson becomes roommates with the world''s only "consulting detective," Sherlock Holmes. Within a day their friendship is forged and several murders are solved.', '\n      Aug. 30, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(908, 9, 'episode', 'A Study in Pink', 1, 1, 'http://www.imdb.com/title/tt1475582/episodes?season=1&ref_=tt_eps_sn_1', 'Dr. John Watson returns to London and is in need of a place to stay. A friend introduces him to Sherlock Holmes, a consulting detective. The two find themselves teaming up to solve a series of murders that are made to look like suicides.', '\n      Jul. 25, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(909, 9, 'episode', 'The Blind Banker', 1, 2, 'http://www.imdb.com/title/tt1475582/episodes?season=1&ref_=tt_eps_sn_1', 'Mysterious symbols and murders are showing up all over London, leading Sherlock and John to a secret Chinese crime syndicate called, Black Lotus.', '\n      Aug. 1, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(910, 9, 'episode', 'The Great Game', 1, 3, 'http://www.imdb.com/title/tt1475582/episodes?season=1&ref_=tt_eps_sn_1', 'The mysterious Moriarty tests Sherlock''s wits by making him solve case after case around the city.', '\n      Aug. 8, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(911, 10, 'episode', 'Twenty Vicodin', 8, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A year has passed since House crashed his car into Cuddy''s home, and we find House spending time behind bars at the East New Jersey Correctional Facility under the close watch of the prison warden. When an antagonistic prison gang leader makes a serious threat, House solicits the help of a fellow inmate, but when another inmate''s unusual medical symptoms spark his curiosity, House must come up with creative ways to treat the patient while navigating prison rules. House meets Dr. Jessica Adams, a young, intelligent and bright-eyed clinic doctor, but when they are faced...', '\n      Oct. 3, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwNjAyNTYzMV5BMl5BanBnXkFtZTcwODUwMTc4Ng@@._V1_SY180_CR37,0,120,180_.jpg'),
(912, 10, 'episode', 'Transplant', 8, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A surprising visitor makes House an offer he can''t refuse by giving him the opportunity to help the Princeton Plainsboro team treat a unique patient in order to save the life of an organ recipient being treated by Wilson. Although House finds himself back on familiar ground, he quickly realizes that much has changed since he left, and he is forced to work on the case with smart yet timid resident Dr. Chi Park. After several inconclusive treatments and with time running out, House and Dr. Park are left with one last option to examine the patient''s medical history that ...', '\n      Oct. 10, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwNzMxMzc4Ml5BMl5BanBnXkFtZTcwNTkxODk4Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(913, 10, 'episode', 'Charity Case', 8, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'When Benjamin suddenly collapses after making a rare and generous donation, House and Dr. Chi Park are convinced that his extreme altruistic behavior may indicate a deeper medical disorder. With no definitive explanation for Benjamin''s loss of consciousness and unresponsiveness to treatment, House pushes just the right buttons to recruit former prison doctor Jessica Adams to volunteer her time and expertise to the case. Benjamin then makes a bold but life-threatening offer that could save another life, and the team must diagnose his disorder before he puts his own ...', '\n      Oct. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAxNDg2NzYzOF5BMl5BanBnXkFtZTcwNzA1NzI5Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(914, 10, 'episode', 'Risky Business', 8, 4, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A CEO falls mysteriously ill just days before he signs a contract that would relocate his company''s entire labor force to China. House attempts to make an underhanded business transaction with his wealthy patient, but when the patient''s condition worsens, the team must work around the clock to save his life. Meanwhile, Park prepares for her hearing with the Princeton Plainsboro Disciplinary Committee chaired by Foreman, and Adams'' outlook on her patient''s business venture reveals her deeper feelings about loyalty.', '\n      Oct. 31, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTg4Mzg5OTg4MF5BMl5BanBnXkFtZTcwODUxMjk5Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(915, 10, 'episode', 'The Confession', 8, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A man who is well-respected in his community suddenly collapses, and in the process of diagnosing his symptoms, the team discovers that the patient has been hiding dark and dishonest secrets about his personal and professional life. But when the patient openly confesses his wrongdoings to his family and community, he compromises his chances of receiving the proper medical treatment. Meanwhile, House will stop at nothing to manipulate Taub into taking a DNA test to prove he is the father of his two six-month-old daughters.', '\n      Nov. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwNzA1OTk0N15BMl5BanBnXkFtZTcwMTM1MjIwNw@@._V1_SX120_CR0,0,120,180_.jpg'),
(916, 10, 'episode', 'Parents', 8, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A teenage boy attempting to follow in his late father''s footsteps as an entertainer is admitted to Princeton Plainsboro with partial paralysis. As the team searches for a bone marrow match, they uncover a disturbing family secret. Meanwhile, House looks for creative ways to remove his ankle monitor so that he can attend a boxing match in Atlantic City, and he treats a patient who is convinced he is suffering from diabetes. Also, Taub faces a tough decision when his ex-wife Rachel tells him that she wants to move across the country with their infant daughter.', '\n      Nov. 14, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk1NDYwNTQzMl5BMl5BanBnXkFtZTcwOTk2MDUwNw@@._V1_SY180_CR56,0,120,180_.jpg'),
(917, 10, 'episode', 'Dead & Buried', 8, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'The team learns that their 14-year-old patient is suffering from more than teen angst when her physical symptoms worsen. Despite Foreman''s firm opposition, House becomes obsessed with solving a peculiar case of a deceased four-year-old patient, which gets him into serious trouble. Meanwhile, Park tries to get Chase to admit the reason behind his recent obsession with grooming.', '\n      Nov. 21, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU4NDc5NTMzMV5BMl5BanBnXkFtZTcwMDAwMDYwNw@@._V1_SY180_CR59,0,120,180_.jpg'),
(918, 10, 'episode', 'Perils of Paranoia', 8, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A prosecutor suffers from what he believes to be cardiac arrest during an interrogation at the witness stand. The team''s preliminary diagnosis is hyper-anxiety, but when Adams and Park investigate the patient''s home and find a hidden arsenal of firearms, they uncover a more alarming and deep-seated psychological disorder. Also, Wilson becomes obsessed with proving that House is hiding something in his home, Park slowly comes out of her social shell and Foreman''s lack of romantic relationships piques the interest of Taub and Chase.', '\n      Nov. 28, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQxODAzMDc0MF5BMl5BanBnXkFtZTcwMzk5OTUwNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(919, 10, 'episode', 'Better Half', 8, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'An Alzheimer''s patient visits Princeton Plainsboro as part of a hospital sanctioned drug trial, but when he inexplicably suffers from violent vomiting and an increasingly explosive temper, the team begins to unravel a deeper marriage conflict between the patient and his dutiful wife. Meanwhile, House and Foreman butt heads, and Wilson treats a patient who claims to be in a chaste marriage.', '\n      Jan. 23, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTYxNjEyODQyMV5BMl5BanBnXkFtZTcwMzQ2OTgyNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(920, 10, 'episode', 'Runaways', 8, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'The team treats an underage and homeless female patient, but when her symptoms worsen and call for an invasive surgery requiring adult consent, House and Adams argue over whether they should contact social services. The patient confesses that she ran away from home after struggling to take care of her mother, a recovering drug addict. But when her mother appears at her bedside, a more complicated relationship is revealed and the patient''s mother must put the past aside and make the best decision for her daughter. Meanwhile, Taub has a difficult time connecting with ...', '\n      Jan. 30, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTgzNTM4MjI1MF5BMl5BanBnXkFtZTcwNTE2OTIzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(921, 10, 'episode', 'Nobody''s Fault', 8, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'When a violent incident involving a patient has serious consequences for one staff member, House and the team are placed under review by Dr. Walter Cofield, Foreman''s former mentor and current Chief of Neurology. As House and each member of his team recount the details of the dramatic and life-threatening incident, Cofield must weigh the team''s unconventional brand of collaboration against their ability to save lives.', '\n      Feb. 6, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4NzgzNzExM15BMl5BanBnXkFtZTcwMTI2MDYzNw@@._V1_SY180_CR75,0,120,180_.jpg'),
(922, 10, 'episode', 'Chase', 8, 12, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'Chase takes on a patient, Moira, who is a cloistered nun on the verge of making her life-changing vows, and through the treatment process, he and Moira form a unique connection that tests their faith and reason. But when Moira''s condition worsens and requires a risky surgery, Chase''s judgment is compromised. Meanwhile, House and Taub try to remain one step ahead of each other''s pranks.', '\n      Feb. 13, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkzMjk2NjUxNl5BMl5BanBnXkFtZTcwMDc4MTA0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(923, 10, 'episode', 'Man of the House', 8, 13, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'A marriage counselor collapses during a speaking engagement, but when he is put under close evaluation, the team notice changes in his behavior that conflict with his motivational message on the roles of men and women. Meanwhile, House and his Ukrainian "wife" Dominika make a deal to convince Immigration that they are a happily married couple. Also, House decides to name a team leader.', '\n      Feb. 20, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEzMTMwNTMzNV5BMl5BanBnXkFtZTcwNDI4MjM0Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(924, 10, 'episode', 'Love is Blind', 8, 14, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'House and the team battle to save a successful, independent blind man who is struck down by a mysterious illness, just prior to him asking for his girlfriend''s hand in marriage. Meanwhile, House''s mother unexpectedly arrives at Princeton Plainsboro to inform him of her new beau.', '\n      Feb. 27, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU0Mjc5MzY1OV5BMl5BanBnXkFtZTcwNTA4MjM0Nw@@._V1_SY180_CR46,0,120,180_.jpg'),
(925, 10, 'episode', 'Blowing the Whistle', 8, 15, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      Apr. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcxODMwMDE2NF5BMl5BanBnXkFtZTcwNzg3MDE2Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(926, 10, 'episode', 'Gut Check', 8, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      Apr. 9, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTE1MzM3MzQ2Ml5BMl5BanBnXkFtZTcwMjc3MDE2Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(927, 10, 'episode', 'We Need the Eggs', 8, 17, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'House and the team take on the case of a man who starts tearing blood. Meanwhile, House is interviewing for a new favorite hooker, since his current favorite, Emily, has decided to get married and leave the business. Desperate for Emily "companionship," House teams up with his "wife" Dominika to sabotage Emily''s budding relationship.', '\n      Apr. 16, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3Nzk4NDI2NV5BMl5BanBnXkFtZTcwNzI2Mzc2Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(928, 10, 'episode', 'Body and Soul', 8, 18, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      Apr. 23, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDA5MjgwNDYzOV5BMl5BanBnXkFtZTcwNzQ2Mzc2Nw@@._V1_SY180_CR41,0,120,180_.jpg'),
(929, 10, 'episode', 'The C Word', 8, 19, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', 'When the team takes on the case of Emily, a six-year-old girl who has numerous preexisting health problems, they must work with her mother Elizabeth, who happens to be doctor herself, specializing in her daughter''s condition. The team must also deal with the battles raging between Emily''s mother and father who have conflicting views on how to handle her health issues. When searching the family''s home for clues to Emily''s illness, the team realizes that Elizabeth''s determination to cure her daughter could be the very thing that is killing her.', '\n      Apr. 30, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjUyNzcwMjk0M15BMl5BanBnXkFtZTcwMTAzMjM3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(930, 10, 'episode', 'Post Mortem', 8, 20, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      May 7, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4MjAwMTk4Ml5BMl5BanBnXkFtZTcwNTkyMjM3Nw@@._V1_SY180_CR79,0,120,180_.jpg'),
(931, 10, 'episode', 'Holding On', 8, 21, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      May 14, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM4Nzc2Nzg4Nl5BMl5BanBnXkFtZTcwNjc1MDk3Nw@@._V1_SX120_CR0,0,120,180_.jpg'),
(932, 10, 'episode', 'Everybody Dies', 8, 22, 'http://www.imdb.com/title/tt0412142/episodes?season=8&ref_=tt_eps_sn_8', '', '\n      May 21, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYwNzIxNDY1MF5BMl5BanBnXkFtZTcwNTU1MDk3Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(933, 10, 'episode', 'Acceptance', 2, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'House treats a patient on death row while Dr. Cameron avoids telling a patient she has a terminal illness.', '\n      Sep. 13, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(934, 10, 'episode', 'Autopsy', 2, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A very brave and mature 9-year-old girl has terminal cancer, but that is not what the problem seems to be.', '\n      Sep. 20, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(935, 10, 'episode', 'Humpty Dumpty', 2, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'Cuddy joins the team after her handyman falls off of her roof and begins to develop bizarre symptoms. Clinic Cases: African American man who objects to "minority meds."', '\n      Sep. 27, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(936, 10, 'episode', 'TB or Not TB', 2, 4, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A doctor champions against the epidemic of TB in Africa, possibly at the risk of his own life.', '\n      Nov. 1, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(937, 10, 'episode', 'Daddy''s Boy', 2, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'The team takes care of a student with inexplicable electrical shocks, and House''s parents visit.', '\n      Nov. 8, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(938, 10, 'episode', 'Spin', 2, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'Star bicycle racer collapses, and the team must come up with a diagnosis after the patient admits to blood doping. House and Stacy continue sparring with each other. Clinic Case: Flight attendant poisons himself with gum.', '\n      Nov. 15, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(939, 10, 'episode', 'Hunting', 2, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'After being accused of assaulting a sick man, House is forced to take on his case. However, despite the fact that he has AIDS, it''s clearly not what''s killing him.', '\n      Nov. 22, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(940, 10, 'episode', 'The Mistake', 2, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'Chaos ensues after Chase''s negligence leads to the death of a female patient. Now, after an inquiry from the hospital board, and a subpoena from the patient''s brother, it''s up to Stacey to protect Chase''s career, as well as House''s.', '\n      Nov. 29, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(941, 10, 'episode', 'Deception', 2, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A woman collapses at an off-track betting parlor in front of House, and he must battle his new boss to find her diagnosis.', '\n      Dec. 13, 2005\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(942, 10, 'episode', 'Failure to Communicate', 2, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'When a famous writer is brought in with language difficulties, House must assist via phone while waiting for a delayed plane.', '\n      Jan. 10, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(943, 10, 'episode', 'Need to Know', 2, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'House and the team must determine what is causing an increasingly deceitful patient''s muscle flailing. Stacy makes a decision, and Cameron avoids a test.', '\n      Feb. 7, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
