(948, 10, 'episode', 'Safe', 2, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', '6 months after a teenage girl crushes her chest in a car accident and receives a heart transplant she goes into anaphylactic shock in her clean room bedroom after her boyfriend almost kisses her and discovers something on her arm.', '\n      Apr. 4, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(949, 10, 'episode', 'All In', 2, 17, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'On a class field trip, a teacher discovers that her six-year-old student, Ian, is bleeding profusely. Dr. House thinks Ian has the same unknown disease that killed an elderly patient of his years ago.', '\n      Apr. 11, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(950, 10, 'episode', 'Sleeping Dogs Lie', 2, 18, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A young woman swallows a bottle of sleeping pills - not to kill herself but to go to sleep, something she says she hasn''t done in 10 days. Then her case deteriorates, but her partner is in a perfect position to help her. Meanwhile, House keeps falling asleep because living with Wilson has disrupted his sleep pattern. Cameron''s mad at Foreman for swiping her ideas for a medical-journal article, and at House for letting him do it.', '\n      Apr. 18, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(951, 10, 'episode', 'House vs. God', 2, 19, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'House takes on a teenage faith healer, Wilson desperately wants into a poker game, and tensions escalate between Cameron and Foreman.', '\n      Apr. 25, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(952, 10, 'episode', 'Euphoria: Part 1', 2, 20, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A police officer in critical condition has bizarre symptoms, and Dr. Foreman finds himself in an unpleasant situation.', '\n      May 2, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
