(954, 10, 'episode', 'Forever', 2, 22, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A young mother suffers a seizure in the bathtub with her newborn son, nearly drowning him, and although the baby survives the near-drowning, his problems are far from over. Foreman returns to work with some minor brain dysfunction, and a personality change that drives House up the wall.', '\n      May 9, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(955, 10, 'episode', 'Who''s Your Daddy?', 2, 23, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'A Katrina survivor, presumably the granddaughter of a famous blues singer, convinces House''s friend Dylan Crandall that he is her father. When the girl is brought in with a deadly illness, House is sure the girl is faking, but Crandall wants her as his daughter and Crandall won''t agree to a paternity test. As House and team try to save the girl''s life, House and his conscience fight over the truth vs. his friend''s real desire to take the girl in.', '\n      May 16, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(956, 10, 'episode', 'No Reason', 2, 24, 'http://www.imdb.com/title/tt0412142/episodes?season=2&ref_=tt_eps_sn_2', 'An old patient of House comes back and seeks revenge upon him in the form of gunshot.', '\n      May 23, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(957, 10, 'episode', 'Meaning', 3, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'Richard, a husband and father living with brain cancer, drives his wheelchair into a pool at a family BBQ. Everyone but his son think that it was suicide from the pain but House will stop at nothing to figure out his true ailment.', '\n      Sep. 5, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(958, 10, 'episode', 'Cane and Able', 3, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'House is affected by the fact that he thinks he didn''t solve the last case while a young boy, who believes aliens tortured him, is brought in.', '\n      Sep. 12, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(959, 10, 'episode', 'Informed Consent', 3, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'House and his team face a lot of moral dilemmas when a patient wants them to help him end his life.', '\n      Sep. 19, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
