(961, 10, 'episode', 'Fools for Love', 3, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A husband and wife being treated cause Foreman to ponder the strength of true love, and House abuses one too many patients with potentially devastating repercussions.', '\n      Oct. 31, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(962, 10, 'episode', 'Que Será Será', 3, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A "suicidally" obese man in a coma presents treatment challenges, but finding out what''s wrong with him may be the most challenging test of all. Elsewhere, Tritter ramps up his vendetta against House.', '\n      Nov. 7, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(963, 10, 'episode', 'Son of Coma Guy', 3, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'When the son of a man in a vegetative state starts going into a coma, the vegetative man is reawakened chemically by House, who hopes to get some clues to the son''s problems.', '\n      Nov. 14, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(964, 10, 'episode', 'Whac-A-Mole', 3, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A young man collapses at his job, and House makes a game of establishing the diagnosis until things turn critical, and Tritter increases the pressure on Wilson.', '\n      Nov. 21, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(965, 10, 'episode', 'Finding Judas', 3, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'While a little girl''s life and limbs are in jeopardy, Tritter becomes more manipulative and House suffers withdrawal.', '\n      Nov. 28, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(966, 10, 'episode', 'Merry Little Christmas', 3, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'Wilson presents the deal to House and then convinces Cuddy to back him up, meanwhile the team is flummoxed by a patient''s condition and various members keep seeking out House for his opinion even though he may not be prepared to assist.', '\n      Dec. 12, 2006\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(967, 10, 'episode', 'Words and Deeds', 3, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'House checks himself into rehab just before his trial, but a different game entirely may be afoot. Elsewhere, the team attempts to treat a firefighter who can''t stop shivering.', '\n      Jan. 9, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(968, 10, 'episode', 'One Day, One Room', 3, 12, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'Stuck with clinic duty, House almost wishes he had the boring patients back after he encounters a young woman with an STD and the need to talk.', '\n      Jan. 30, 2007\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM4OTY0MDcxOF5BMl5BanBnXkFtZTcwOTc5OTkyMg@@._V1_SY180_CR100,0,120,180_.jpg'),
(969, 10, 'episode', 'Needle in a Haystack', 3, 13, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A young man is stricken during sex with his girlfriend, and House must determine why his organs are suddenly shutting down. Finding the cause is like looking for a needle in a haystack.', '\n      Feb. 6, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(970, 10, 'episode', 'Insensitive', 3, 14, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'On Valentine''s Day, House meddles in relationships as he works to diagnose a teenager who has a genetic inability to feel pain.', '\n      Feb. 13, 2007\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYxNzM2NzkwNl5BMl5BanBnXkFtZTYwODA5NzE3._V1_SY180_CR74,0,120,180_.jpg'),
(971, 10, 'episode', 'Half-Wit', 3, 15, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'House struggles to find out why a pianist savant is losing his ability to play. Ultimately, a decision must be made as to how much brain is necessary for a normal quality of life.', '\n      Mar. 6, 2007\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4NDM3NjQ1MF5BMl5BanBnXkFtZTYwOTY5NzE3._V1_SY180_CR0,0,120,180_.jpg'),
(972, 10, 'episode', 'Top Secret', 3, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A patient whose relative has called in a favor with Cuddy presents with nonspecific minor symptoms that turn life-threatening, but House is distracted by a dream and an inability to urinate.', '\n      Mar. 27, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(973, 10, 'episode', 'Fetal Position', 3, 17, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'When a pregnant woman has a stroke, the team is at a loss after all tests reveal nothing, but when her organs start shutting down Cuddy takes over the case.', '\n      Apr. 3, 2007\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTYzNjcxNTQ1N15BMl5BanBnXkFtZTYwMzM5NzE3._V1_SY180_CR74,0,120,180_.jpg'),
(974, 10, 'episode', 'Airborne', 3, 18, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'House and Cuddy are flying back to the US from an international conference in Singapore. While en route a mysterious disease strikes one passenger and an epidemic unfolds, causing House to diagnose in midair since they have missed the halfway mark by passing the north pole. Back in Princeton, Wilson and House''s lackeys have a confusing case of what is ailing a woman who came into the clinic and proceeded to have a seizure.', '\n      Apr. 10, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(975, 10, 'episode', 'Act Your Age', 3, 19, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A young girl is ailed with diseases that usually strike people much older than her 6 years of age. But before House can diagnose her, her brother starts exhibiting the same symptoms she was admitted with. During all of this House gives Wilson tickets that a patient had given to him for a play. Ensuing a discussion on why men take women to plays. Wilson decides to take Cuddy and the tug of war with House for her affections begins, although Cuddy insists that she only went with Wilson as a friend.', '\n      Apr. 17, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(976, 10, 'episode', 'House Training', 3, 20, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'The cause of a woman''s TIA stumps the team, and Foreman''s family visits.', '\n      Apr. 24, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(977, 10, 'episode', 'Family', 3, 21, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'Wilson is preparing his 14-year-old patient, Nick, for a bone marrow transplant when the donor, Nick''s younger brother Matty, suddenly starts sneezing. Since Nick''s immune system has been destroyed by the chemotherapy for his cancer, he cannot risk a marrow donation from Matty while Matty is ill. House decides that the fastest way to find out what''s wrong with Matty is to make him worse. As the boys get sicker and sicker, House and his team race to cure Matty before both brothers die. Meanwhile, House battles Hector (his newly adopted dog) for supremacy and Foreman ...', '\n      May 1, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(978, 10, 'episode', 'Resignation', 3, 22, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A 19-year-old college student, Addie, starts coughing up blood during karate class and ends up one of House''s cases. Foreman hands in his resignation before treating the woman and refuses to explain why. Although her symptoms show no signs of it, House is convinced that an infection is causing Addie''s bleeding. Her lungs start filling with fluid and House''s team believes a toxin or cancer is to blame for Addie''s illness but are unable to change House''s mind. Addie continues to get worse and House wants to do an extremely risky life-or-death treatment in order to ...', '\n      May 8, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(979, 10, 'episode', 'The Jerk', 3, 23, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'When a teenage chess-player assaults his opponent, the team struggles to determine whether the problem is organic or psychological. Clinic Cases: Spotted sunburn.', '\n      May 15, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(980, 10, 'episode', 'Human Error', 3, 24, 'http://www.imdb.com/title/tt0412142/episodes?season=3&ref_=tt_eps_sn_3', 'A couple risk their lives getting from Cuba to see House, but his preoccupation with staff issues may cost the woman her life.', '\n      May 29, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(981, 10, 'episode', 'Pilot', 1, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'Young kindergarten teacher Rebecca Adler collapses in her classroom after uncontrolled gibberish slips out of her mouth while she is about to teach students.', '\n      Nov. 16, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(982, 10, 'episode', 'Paternity', 1, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'The team help a high school boy (16) who has double vision and night terrors. (Clinic Cases: Unvaccinated baby, man with boil on leg.)', '\n      Nov. 23, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(983, 10, 'episode', 'Occam''s Razor', 1, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A college boy whose low blood pressure does not respond with IV fluids piques House''s curiosity. Clinic Cases: A woman who had a cold last week, man with a sore throat, woman whose leg hurts after running 6 miles, a boy and his MP3 Player.', '\n      Nov. 30, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(984, 10, 'episode', 'Maternity', 1, 4, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A nightmare scenario hits Princeton Plainsboro when babies in the maternity ward are hit by a potentially fatal epidemic. Clinic Cases: Woman with a parasite!', '\n      Dec. 7, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(985, 10, 'episode', 'Damned If You Do', 1, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A nun suffering from acute dermatitis and asthma treated by House with possibly the wrong medication comes dangerously close to death.', '\n      Dec. 14, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(986, 10, 'episode', 'The Socratic Method', 1, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A 38 year-old mother apparently suffering from thrombosis, alcoholism, and schizophrenia has only her underage 15 year-old son as caregiver.', '\n      Dec. 21, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(987, 10, 'episode', 'Fidelity', 1, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A woman comes down with symptoms of African sleeping sickness, but there seems to be no way she could have contracted it. House and his aides must ask a few tough questions and make some tough decisions in order to try to save her.', '\n      Dec. 28, 2004\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(988, 10, 'episode', 'Poison', 1, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A high school boy has hallucinations and collapses during an exam. When he does not respond to treatments, and the normal tests are negative Foreman presents the case to House. Clinic Cases: A happy old lady.', '\n      Jan. 25, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(989, 10, 'episode', 'DNR', 1, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A famous jazz trumpeter, diagnosed with ALS, signs a DNR form, but because House believes the diagnosis wrong, he breaks the law by resuscitating him.', '\n      Feb. 1, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(990, 10, 'episode', 'Histories', 1, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A delusional homeless woman is found unconscious in an acid house exhibiting a variety of symptoms which Foreman thinks she''s faking.', '\n      Feb. 8, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(991, 10, 'episode', 'Detox', 1, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A girl crashes a Porsche after her boyfriend starts coughing up blood and continues to have unexplained bleeds. Clinic Cases: Cuddy give House a month off clinic duties if he can spend a week off his pain meds.', '\n      Feb. 15, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(992, 10, 'episode', 'Sports Medicine', 1, 12, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A detoxed sports star about to make his comeback breaks his arm due to brittle bones. Clinic Cases: Woman with leg pain; man trying to remove his contact lenses; a dentist with various issues and a hung over teenager; all in 70 seconds.', '\n      Feb. 22, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(993, 10, 'episode', 'Cursed', 1, 13, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A young boy has a fever for over a week after a Ouija board predicts he will die. Clinic Cases: Chase''s case of a man with numb fingers.', '\n      Mar. 1, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(994, 10, 'episode', 'Control', 1, 14, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'Can House save a high powered female executive from the same problem that has left him in constant pain? A new head of the hospital board could cause problems. Clinic cases: A boy and his mute dad.', '\n      Mar. 15, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(995, 10, 'episode', 'Mob Rules', 1, 15, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A Mob informer collapses before trial. Is he faking or is he really in a coma? Clinic Cases: A pair of brothers come in when the youngster gets toys stuck up his nose.', '\n      Mar. 22, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(996, 10, 'episode', 'Heavy', 1, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'A morbidly obese ten-year-old girl has a heart attack, and her mother insists that House and his team look past her weight to find the diagnosis. Meanwhile, Vogler pressures House to fire a member of his staff. Clinic Patients: Unidentified man with an infected pierced scrotum; overweight woman with a 30-pound tumor on her ovaries who refuses to have it removed, because she worries she will be unattractive.', '\n      Mar. 29, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(997, 10, 'episode', 'Role Model', 1, 17, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'An ambitious, charismatic black senator becomes ill while campaigning for the Presidency suffering from a mysterious malady, possibly AIDS.', '\n      Apr. 12, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(998, 10, 'episode', 'Babies & Bathwater', 1, 18, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'While House and his team scramble to discover what''s causing brain and kidney dysfunction in a pregnant woman, Vogler is on the warpath to get House fired.', '\n      Apr. 19, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(999, 10, 'episode', 'Kids', 1, 19, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'During a meningitis outbreak which overwhelms the clinic, House is drawn to a single patient: a 12-year-old competitive diver whose symptoms don''t quite match everyone else''s.', '\n      May 3, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(1000, 10, 'episode', 'Love Hurts', 1, 20, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'House has to deal with his promised dinner date with Cameron, a mysterious stroke in a clinic patient and a libidinous senior citizen.', '\n      May 10, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(1001, 10, 'episode', 'Three Stories', 1, 21, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'House''s ex Stacy Warner asks him to treat her husband. House takes over a diagnostics class for a day and presents the class with three case studies of leg pain. As House tells his story and the class gradually fills up with listeners, the class learns a lot about how to be better doctors, and Chase, Foreman and Cameron learn some important details of House''s past.', '\n      May 17, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(1002, 10, 'episode', 'Honeymoon', 1, 22, 'http://www.imdb.com/title/tt0412142/episodes?season=1&ref_=tt_eps_sn_1', 'House doses his ex-girlfriend''s husband in order to get him into hospital after she begs House to treat him. Is House treating Mark differently in order to get back at Stacy for his leg?', '\n      May 24, 2005\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MzA3NjE2NV5BMl5BanBnXkFtZTcwMTk1NDAzMQ@@._V1_SY180_CR6,0,120,180_.jpg'),
(1003, 10, 'episode', 'Broken', 6, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House fights his doctors, the staff and his fellow patients when he''s forced to stay in the psychiatric hospital under threat of permanently losing his medical license.', '\n      Sep. 21, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM4Njc2NjI4M15BMl5BanBnXkFtZTcwMDg3MTA4Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1004, 10, 'episode', 'Epic Fail', 6, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House returns home to Princeton where he continues to focus on his recovery, but surprises Cuddy with the news that he''s making a big change in his life. Meanwhile, the team is unable to diagnose a loud-mouthed video game creator who posts each new symptom on the Internet and opts for treatments suggested by the online community rather than by the doctors, and Foreman angles for House''s job, but the pressure to solve the case creates tension in his relationship with Thirteen.', '\n      Sep. 28, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk3ODUxMjAwNV5BMl5BanBnXkFtZTcwNTg2ODY4Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1005, 10, 'episode', 'The Tyrant', 6, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'When a controversial African politician falls ill, he is brought to Princeton Plainsboro for treatment. The team struggles with whether to help a merciless dictator being subpoenaed for crimes against humanity in his country. Meanwhile, Wilson tries to make peace with a feuding neighbor, but House''s prying exacerbates the problem.', '\n      Oct. 5, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA0ODY1NTY2MV5BMl5BanBnXkFtZTcwOTE2Mjg4Mg@@._V1_SY180_CR75,0,120,180_.jpg'),
(1006, 10, 'episode', 'Instant Karma', 6, 4, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'A wealthy businessman brings his teenage son, who is suffering from inexplicable stomach pains, to Princeton Plainsboro and insists on having Dr. House handle the case. The father of the patient believes the karmic penalty of his financial success is that he is victim to personal tragedy, and that the answer to his son''s medical mystery lies in a reverse of fate rather than medical treatment. Meanwhile, Foreman and Chase prepare to present information on the Dibala case.', '\n      Oct. 12, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1MjIxMzk0NF5BMl5BanBnXkFtZTcwMjM3MjA5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1007, 10, 'episode', 'Brave Heart', 6, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'The team takes on the case of a reckless police detective who has a family history of sudden heart failure that killed his father, grandfather and great-grandfather all at age 40. Though House is not keen on diagnosing the patient without any detectable symptoms, the team, urged by Cameron, attempts to identify his condition so the detective can live without fear of dying young. Meanwhile, Chase is haunted by his actions in the Dibala case, and House confronts some ghosts of his own.', '\n      Oct. 19, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMyNTIyNjc3OV5BMl5BanBnXkFtZTcwOTQ4MDI5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1008, 10, 'episode', 'Known Unknowns', 6, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'A teenage girl is brought to the hospital with severely swollen appendages after a wild night out.', '\n      Nov. 9, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MTg4NTgyMl5BMl5BanBnXkFtZTcwMjI1MDg5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1009, 10, 'episode', 'Teamwork', 6, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'After House''s medical license is reinstated, he reclaims his role as Head of Diagnostics in time to treat Hank Hardwick, an adult film star admitted to Princeton Plainsboro for pulsating eye pain. Meanwhile, Cuddy is reminded that the hospial is not conducive to healthy personal relationships, and House angles to form a dream team.', '\n      Nov. 16, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTI4Nzc2NDU5NV5BMl5BanBnXkFtZTcwMTQwNzk5Mg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1010, 10, 'episode', 'Ignorance Is Bliss', 6, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House and the team take on the case of James Sidas, an exceptionally brilliant physicist and author who traded his successful career for a job as a courier. For the ailing patient, intelligence is a miserable burden that has prompted depression and addiction, and this, coupled with his myriad unusual symptoms, nearly stumps the team. Meanwhile, the doctors at Princeton Plainboro wrestle with strained personal relationships.', '\n      Nov. 23, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE0NDc4OTAxMl5BMl5BanBnXkFtZTcwNDg2MzEwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1011, 10, 'episode', 'Wilson', 6, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'When an old friend and former patient of Wilson''s exhibits paralysis in his right arm, Wilson puts himself on the case. House wagers Wilson that the patient''s symptoms are attributed to new cancer cells. Wilson accepts even though he is reluctant to believe the cancer has returned. With the help of the team, Wilson works to diagnose the patient more optimistic results, but when things take a turn for the worse, Wilson must address his inability to separate patient from friend. Meanwhile, Cuddy seeks advice in her search for real estate.', '\n      Nov. 30, 2009\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ2MjM5NjQyN15BMl5BanBnXkFtZTcwNjg1NzIwMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1012, 10, 'episode', 'The Down Low', 6, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'When drug dealer Mickey mysteriously collapses while negotiating a sale, his partner-in-crime, Eddie, accompanies him to Princeton Plainsboro for treatment. But with a major deal pending, Mickey is not forthcoming with the necessary personal information the team needs to treat him. As Mickey''s condition worsens, the team resorts to old-fashioned detective work to solve the case. Meanwhile, House and Wilson compete for the affection of a new neighbor, and Chase, Thirteen and Taub attempt to play a practical joke on Foreman.', '\n      Jan. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwNjkyMzUyMl5BMl5BanBnXkFtZTcwMDE0MzExMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1013, 10, 'episode', 'Remorse', 6, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'The team takes on the case of Valerie, an attractive female executive experiencing random episodes of excruciating pain. House agrees to take the case based on Valerie''s looks, and while treating her, the men on the team are charmed by Valerie''s beauty and personality, with Thirteen looking beyond the superficial to try to discover a link to her illness. Meanwhile, House uncharacteristically attempts to alleviate his conscience by reaching out to a former medical school colleague he wronged.', '\n      Jan. 25, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE2OTY0MTA0NV5BMl5BanBnXkFtZTcwNDcxNzQxMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1014, 10, 'episode', 'Moving the Chains', 6, 12, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House and the team rush to treat an ailing college football star in time for the patient to compete in NFL tryouts. But when the patient experiences an onslaught of varied and unusual symptoms, the team has trouble reaching a consensus on how to effectively treat him in time. Meanwhile, Foreman''s brother Marcus makes a surprise visit to the hospital.', '\n      Feb. 1, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQwMDk3NzkyMl5BMl5BanBnXkFtZTcwNTk4MDYxMw@@._V1_SY180_CR10,0,120,180_.jpg'),
(1015, 10, 'episode', '5 to 9', 6, 13, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'During a day in the life of Princeton Plainsboro''s Dean of Medicine, Dr. Lisa Cuddy, the inner workings of the hospital are seen through her eyes. This day proves to be especially trying as Cuddy wrestles with myriad hospital issues and staff disputes that test her perseverance and skills as an administrator, all while juggling issues in her personal life.', '\n      Feb. 8, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTE0MzIyMjMwMF5BMl5BanBnXkFtZTcwMjEwNDcxMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1016, 10, 'episode', 'Private Lives', 6, 14, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House and the team take on the case of an avid blogger admitted with sudden bruising and bleeding. From her hospital bed, the patient blogs about her symptoms, doctors and prospective diagnoses to her dedicated band of followers and solicits their advice on a course of treatment. Such openness leads the team to contemplate the value of privacy, especially after House and Wilson uncover secrets from one another''s past. Meanwhile, Chase is coaxed into testing out the dating scene .', '\n      Mar. 8, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1NTIyMjA3MV5BMl5BanBnXkFtZTcwMzY2NDMyMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1017, 10, 'episode', 'Black Hole', 6, 15, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'Physics student and his father, Artie, bring in the kid''s lover Abby Nash, who nearly suffocated in foam during a planetarium lecture. The team eliminates everything except an allergy to something in her body. House presses Wilson to buy furniture as a way to express his personality.', '\n      Mar. 15, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk1OTgwMjg4Nl5BMl5BanBnXkFtZTcwMTcyMTUyMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1018, 10, 'episode', 'Lockdown', 6, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'When a newborn disappears from the nursery, Princeton Plainsboro goes on lockdown, preventing anyone from entering, leaving or moving within the hospital. While House and his team members are trapped in various parts of the building, new insights about the team''s personal histories, relationships and regrets surface.', '\n      Apr. 12, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcyMDg5ODE2MF5BMl5BanBnXkFtZTcwNzkzNjQzMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1019, 10, 'episode', 'Knight Fall', 6, 17, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House and the team take on the case of Sir William, a "knight" in a closed-off community of men and women living according to the ideals of the High Renaissance. As the team searches the medieval village for environmental factors contributing to Sir William''s rapidly deteriorating health, Thirteen and Sir William debate the acts that define honor and loyalty, especially in regard to the "queen" of the community, one of Sir William''s most frequent visitors. Meanwhile, Wilson starts over with an ex.', '\n      Apr. 19, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkwMjk3ODgzN15BMl5BanBnXkFtZTcwMTc5NzUzMw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1020, 10, 'episode', 'Open and Shut', 6, 18, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'House and the team take on the case of a woman Julia, who is in an open marriage and becomes ill during a date with her on-the-side boyfriend. As perplexing as the case is, Julia''s happy and healthy, yet polygamous relationship is equally baffling to the team. Meanwhile, House tests Wilson''s relationship with Sam.', '\n      Apr. 26, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUwNTcxNTQ3Nl5BMl5BanBnXkFtZTcwNzc5NzUzMw@@._V1_SY180_CR75,0,120,180_.jpg'),
(1021, 10, 'episode', 'The Choice', 6, 19, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'The team takes on the case of an ailing groom-to-be who harbors undisclosed secrets from a previous relationship. As his fiancée tries to get answers to her many questions, a frustrated team winnows down the possibilities. Meanwhile, House spends extra-curricular time with his Princeton Plainsboro colleagues, performing a karaoke rendition of a Gladys Knight & The Pips classic with Foreman and Chase.', '\n      May 3, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTcxOTYwODE2NV5BMl5BanBnXkFtZTcwOTY1MjM0Mw@@._V1_SY180_CR75,0,120,180_.jpg'),
(1022, 10, 'episode', 'Baggage', 6, 20, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'During a session with Dr. Nolan, House recounts the case of a woman who arrives at the Princeton Plainsboro emergency room with an unexplained illness and no recollection of who she is. While trying to solve the mystery of the woman''s illness, House must also help her piece together her identity.', '\n      May 10, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEyMTg5MDkyOF5BMl5BanBnXkFtZTcwMTE4OTM0Mw@@._V1_SY180_CR77,0,120,180_.jpg'),
(1023, 10, 'episode', 'Help Me', 6, 21, 'http://www.imdb.com/title/tt0412142/episodes?season=6&ref_=tt_eps_sn_6', 'Cuddy, House and members of the team join forces with a search-and-rescue team to provide much-needed medical attention at the scene of an emergency.', '\n      May 17, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk1NTc2NjYxNF5BMl5BanBnXkFtZTcwNzA0Njg0Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1024, 10, 'episode', 'Now What?', 7, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'House and Cuddy are exploring the ramifications of those feelings and attempting to make a real relationship work. Meanwhile, due to a colleague''s illness, Princeton Plainsboro is left without a neurosurgeon on site, threatening the hospital''s accreditation as a Level 1 Trauma Center. As the team attempts treatment to get their sick colleague back to work, they discover there is more to the illness than they originally suspected and turn to House for direction. Instead, House remains elusive, leaving the team on its own.', '\n      Sep. 20, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjAzMjk4MTc2OV5BMl5BanBnXkFtZTcwNTI2MTQ4Mw@@._V1_SY180_CR2,0,120,180_.jpg'),
(1025, 10, 'episode', 'Selfish', 7, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'When Della, a seemingly healthy and active 14-year-old, suddenly collapses during a skateboarding exhibition, House and his team struggle to diagnose her condition and reassure her parents who already have to cope with their son''s terminal illness. After her body rejects a donor lung, and with time running out to save her life, Della''s family is left with little hope of securing a new donor and faced with a seemingly impossible decision regarding the fate of both children. Meanwhile, House tries to appease an elderly father and his son at the clinic, and House and ...', '\n      Sep. 27, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc4Njc4NDAzMl5BMl5BanBnXkFtZTcwNzY5NzM5Mw@@._V1_SY180_CR4,0,120,180_.jpg'),
(1026, 10, 'episode', 'Unwritten', 7, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'When Alice, the author of a popular children''s book series, inexplicably suffers from a seizure moments before an attempt to take her own life, the Princeton Plansboro team faces the challenges of evaluating both her underlying medical conditions, as well as her unstable psychological state. Unable to diagnose Alice, House becomes particularly motivated, as he''s a fan of her books, and is convinced that the key to unlocking the mysteries of Alice''s condition lies in the pages of her most recent novel. Meanwhile, House takes Cuddy on a double date with Wilson and his ...', '\n      Oct. 4, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ0NjI0NjQ0OV5BMl5BanBnXkFtZTcwNjU2NzU5Mw@@._V1_SY180_CR0,0,120,180_.jpg'),
(1027, 10, 'episode', 'Massage Therapy', 7, 4, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'When a patient named Margaret McPherson is admitted to Princeton Plainsboro after suffering severe and uncontrollable vomiting, House and the team make unexpected discoveries about her identity as they assess her symptoms. When the symptoms don''t improve, the team looks to the patient''s medical history to unearth more about her past. Meanwhile, House gives Chase''s new hire a cold welcome, and a visit from House''s massage therapist forces House and Cuddy to confront the reservations in their relationship.', '\n      Oct. 11, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA4NjE1MDgwN15BMl5BanBnXkFtZTcwMDY0Njc5Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1028, 10, 'episode', 'Unplanned Parenthood', 7, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'After a newborn experiences inexplicable breathing problems and liver failure, House and the team look at the baby''s mother, Abbey''s, own medical history for possible clues. When the team makes a discovery about her newborn''s health, Abbey is presented with a difficult decision that could potentially affect both her baby''s health and her own. Meanwhile, following Cuddy''s directive, House challenges Foreman and Taub to hire a female doctor to join the team. When Cuddy asks House to babysit her daughter, both House and Wilson learn a few hard lessons in parenting.', '\n      Oct. 18, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTk3MzA4MTQ2N15BMl5BanBnXkFtZTcwMTIwOTAwNA@@._V1_SY180_CR62,0,120,180_.jpg'),
(1029, 10, 'episode', 'Office Politics', 7, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'It''s election season, and in the midst of a tight campaign, an incumbent New Jersey senator''s campaign manager falls ill with liver failure and temporary paralysis. Cuddy pushes House to add a female doctor to his team by hiring brilliant third-year medical student Martha Masters in Thirteen''s absence. House and the team are wary of the young doctor''s lack of experience and medical perspective, but are forced to give their new by-the-book teammate a chance to prove herself. After the campaigning senator makes a surprising announcement, House and the team look to the ...', '\n      Nov. 8, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcwMTI1NTAyMl5BMl5BanBnXkFtZTcwODAzODcwNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(1030, 10, 'episode', 'A Pox on Our House', 7, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'After a 200-year-old medicine jar found on an off-shore shipwreck shatters in a teenage girl''s palm, she is admitted to Princeton Plainsboro for symptoms closely linked to smallpox. When the Center for Disease Control''s Dr. Dave Broda institutes a lockdown on the hospital and suspends House''s team''s ability to diagnose, Masters grows suspicious of Broda''s motives and becomes convinced that the patient is suffering from a different disease. The girl''s father soon experiences similar symptoms, and House is forced to make a precarious decision that puts his own life in ...', '\n      Nov. 15, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA2Mzg3Nzg5M15BMl5BanBnXkFtZTcwOTcxMDAxNA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1031, 10, 'episode', 'Small Sacrifices', 7, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Science and faith are called into question when a patient is admitted to the hospital following his reenactment of the Crucifixion. The patient, Ramon Silva, refuses to undergo the prescribed treatment, and the team learns that after his daughter''s cancer was cured, he pledged an oath of self-sacrifice to God. With little time to save Ramon''s life, the team struggles to understand his reasoning and seemingly extreme religious convictions, but eventually learn that faith is not an argument. Meanwhile, Taub questions his wife Rachel about her relationship with an ...', '\n      Nov. 22, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTUyNDQ3NTU0OV5BMl5BanBnXkFtZTcwNTE3NDIxNA@@._V1_SX120_CR0,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(1032, 10, 'episode', 'Larger Than Life', 7, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'When a man puts his life on the line to save a stranger who fell onto the subway tracks, he emerges from the dramatic scene miraculously unscathed but then suddenly collapses. Both the hospital and the town become captivated by the man''s selfless deed, but as the team works to diagnose his symptoms, they discover that the hero''s seemingly life-changing deed failed to break old habits. Meanwhile, House tries to avoid Cuddy''s birthday dinner with her opinionated mother Arlene, and Taub draws unexpected attention when his face graces billboards advertising the hospital. ...', '\n      Jan. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjEzMTE0MDM3N15BMl5BanBnXkFtZTcwMTcwODQzNA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1033, 10, 'episode', 'Carrot or Stick', 7, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'A teenage military trainee at a juvenile offender training camp suffers peculiar symptoms after enduring an intense training course, and mysteriously, his drill sergeant is soon admitted for similar symptoms. Unable to track down the cause of the shared illness, the team searches for clues in the trainee''s family medical history, and Masters and House reveal a unique bond between the sergeant and trainee. Meanwhile, when an indecent photo of Chase is posted on a social-networking site following three different romantic encounters, Chase is determined to find out which...', '\n      Jan. 24, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjExMjQ5MTYwNl5BMl5BanBnXkFtZTcwMDA4NzczNA@@._V1_SX120_CR0,0,120,180_.jpg'),
(1034, 10, 'episode', 'Family Practice', 7, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Cuddy''s mother, Arlene, is admitted to Princeton Plansboro after complaining about unusual symptoms, but stubborn Arlene insists that House be removed from the case, forcing House to come up with non-conventional - and illegal - means to treat his patient. House instructs his team to follow his lead, and they discover details in Arlene''s personal life that she kept secret from Cuddy and her sister Lucinda. Later, Cuddy places her trust in House to ensure that her mother receives the proper medical treatment, leading "by the book" medical student Masters to reevaluate ...', '\n      Feb. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ2NjA5MDcwMV5BMl5BanBnXkFtZTcwNTg5MDQ0NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1035, 10, 'episode', 'You Must Remember This', 7, 12, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'When a waitress with a perfect memory suffers temporary paralysis, her older sister visits her in the hospital, which triggers high stress levels and even more health complications. The patient''s sharp memory proves detrimental when a grudge she''s been holding against her sibling gets in the way of receiving proper medical treatment, and Masters discovers that patching a broken sisterhood may prove to be more complex than diagnosing the patient. Meanwhile, Foreman volunteers to help Taub prepare for a medical examination, and House, determined to help Wilson get back ...', '\n      Feb. 14, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcyOTIyMjg5N15BMl5BanBnXkFtZTcwNDc1Nzc0NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1036, 10, 'episode', 'Two Stories', 7, 13, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'House participates in a school''s Career Day and breaks a few rules by sharing explicit medical stories. Waiting outside the principal''s office, he meets two fifth-grade students who assess House''s relationship woes and try to help him understand how his selfish antics get in the way of showing Cuddy how he really feels.', '\n      Feb. 21, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI0OTIwODE3Ml5BMl5BanBnXkFtZTcwNTAyOTE1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1037, 10, 'episode', 'Recession Proof', 7, 14, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'A patient is admitted after breaking out in a severe rash triggered by caustic chemical exposure at his blue-collar job. As the team treats him, they discover that he has led his wife to believe that he is still maintaining his once-lucrative real estate career. Meanwhile, Cuddy is honored with an award and needs House to be at the charity event for support, but his attendance is threatened when his patient''s battle to survive forces him to question his practice and his own happiness. Also, Chase and Masters teach each other a lesson in forging meaningful personal and...', '\n      Feb. 28, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTc1MDc1NzIyMF5BMl5BanBnXkFtZTcwNDQ2ODc1NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(1038, 10, 'episode', 'Bombshells', 7, 15, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Tension reaches new heights when Cuddy faces sobering news that propels her to reevaluate her priorities. While House is distracted by his concern for Cuddy''s well-being, the team treats a teenage patient whose worsening symptoms and suspicious body scars indicate more than just physical illness. Sensing the teen''s troubled emotional and mental state, Taub turns to the patient''s personal life for clues and uncovers disturbing home videos that could put the lives of his peers in danger. Meanwhile, Cuddy remains hopeful that House will be fully present when she needs ...', '\n      Mar. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTcxMTM3NTI5NV5BMl5BanBnXkFtZTcwMTU2ODc1NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1039, 10, 'episode', 'Out of the Chute', 7, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'A young professional champion bull rider is admitted for treatment after being attacked by a bull. After conducting multiple inconclusive tests, the team enlists House''s advice outside of the hospital while he attends to a few issues away from the case. Back in the hospital, the bull rider''s condition continues to worsen, but with disappearing symptoms and the patient''s more frequent mini-seizures, the team''s last option is risky open-heart surgery. Meanwhile, Masters develops a crush on their bull rider patient much to Taub''s surprise.', '\n      Mar. 14, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM4NjE5ODA5OV5BMl5BanBnXkFtZTcwNTA4NDA3NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1040, 10, 'episode', 'Fall from Grace', 7, 17, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'A young homeless man who is a former drug addict is found in a park showing signs of olfactory impairment and horrific scars and burn marks on his chest. With an uncertain identity and the patient''s severely worsening conditions, the team looks to the patient''s personal records and family history in order to understand his detachment. Meanwhile, Cuddy confides in Wilson and expresses her guilt for ending her relationship with House, and just as the team warms up to the patient, they discover a disturbing secret about the man whose life they saved.', '\n      Mar. 21, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMwNjkzOTYxNV5BMl5BanBnXkFtZTcwMjQ0NTY3NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1041, 10, 'episode', 'The Dig', 7, 18, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'The team treats a patient with a secret home life. Thirteen is released from prison. House enlists Thirteen to participate in a spud gun competition.', '\n      Apr. 11, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU2MDQ4NzU1Ml5BMl5BanBnXkFtZTcwNDI3NzE5NA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1042, 10, 'episode', 'Last Temptation', 7, 19, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Masters faces a career crossroads on her last day as a medical student and struggles with the choice to continue on the path to become a surgeon or to accept the rare opportunity to join House''s team officially. Meanwhile, the team treats a 16-year-old girl who inexplicably collapsed days before embarking on an ambitious sailing tour around the globe. Despite the patient''s life-changing diagnosis, the patient''s family insists on getting her back on the seas in time for her potentially record-breaking launch. But to the team''s surprise, including House, Masters makes a...', '\n      Apr. 18, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDE5ODQwODY2MV5BMl5BanBnXkFtZTcwODc4OTg5NA@@._V1_SX120_CR0,0,120,180_.jpg'),
(1043, 10, 'episode', 'Changes', 7, 20, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Arlene Cuddy returns and House and Cuddy''s jobs are in danger when Arlene tries to sue the hospital.', '\n      May 2, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BODEzNjEyNTM2OF5BMl5BanBnXkFtZTcwNDU0MDQxNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(1044, 10, 'episode', 'The Fix', 7, 21, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'When House and Wilson bet on a boxing match and disagree over the outcome, Wilson gives him exactly one day to pay up or prove him wrong.', '\n      May 9, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI4MzE3NjE5MV5BMl5BanBnXkFtZTcwOTYzNTEyNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(1045, 10, 'episode', 'After Hours', 7, 22, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Thirteen''s ex-con friend, Darrien, arrives at Thirteen''s apartment unannounced and in need of urgent medical attention. When she finds out that her friend has relapsed into drug use, Thirteen promises not to take her to the hospital where the cops could find her and instead turns to Chase in desperation. Meanwhile, House deals with devastating information, and Taub begins to come to terms with surprising news.', '\n      May 16, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM3MjUyNzU5NF5BMl5BanBnXkFtZTcwMjM5MTkyNQ@@._V1_SY180_CR75,0,120,180_.jpg'),
(1046, 10, 'episode', 'Moving On', 7, 23, 'http://www.imdb.com/title/tt0412142/episodes?season=7&ref_=tt_eps_sn_7', 'Well-known performance artist Afsoun Hamidi is admitted to the hospital, but when the team learns that her symptoms may have been self-inflicted as part of a documentary for her latest performance piece, they begin to question whether treatments are necessary and if they are unwittingly participating in the creation of a piece of her art. Meanwhile, a situation prompts House to do something that could change his relationship with Cuddy and Wilson permanently.', '\n      May 23, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM0MDkxNjQ3OF5BMl5BanBnXkFtZTcwMTUyODczNQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(1047, 10, 'episode', 'Alone', 4, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House is off his game without the team, and Wilson uses an extreme tactic to force him into interviews.', '\n      Sep. 25, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1048, 10, 'episode', 'The Right Stuff', 4, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House is forced to choose a new staff... and gathers 40 applicants to start narrowing down the field. Meanwhile, an Air Force pilot wants House to treat her secretly so she doesn''t ruin her chances of becoming an astronaut.', '\n      Oct. 2, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1049, 10, 'episode', '97 Seconds', 4, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'Down to 10 candidates for his team, House splits them into 2 groups to diagnose a patient whose short lifespan has been made even shorter. Foreman leads his own team to diagnose a patient at his new workplace.', '\n      Oct. 9, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1050, 10, 'episode', 'Guardian Angels', 4, 4, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'A woman seeing her dead mother stumps the recruits, especially once she begins seeing a recent victim.', '\n      Oct. 23, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1051, 10, 'episode', 'Mirror Mirror', 4, 5, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'A victim of a mugging presents with neurological symptoms and begins to mirror the behaviors of his doctors. Foreman joins the new fellows in seeking a diagnosis; Cameron and Chase takes bets on whom House will fire next.', '\n      Oct. 30, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1052, 10, 'episode', 'Whatever It Takes', 4, 6, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House is taken by black helicopter to help diagnose a dying CIA agent, leaving Foreman in charge of the team trying to find out why a young woman passed out after a drag car race.', '\n      Nov. 6, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1053, 10, 'episode', 'Ugly', 4, 7, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House and his team are hampered by a reality television crew whilst battling over possible diagnoses for a craniofacial surgery patient.', '\n      Nov. 13, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1054, 10, 'episode', 'You Don''t Want to Know', 4, 8, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'A magician''s heart stops during a performance. At first House dismisses the case, but later changes his mind when complications arise. House has a contest to determine the next one to leave the team.', '\n      Nov. 20, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1055, 10, 'episode', 'Games', 4, 9, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House treats a rock musician, and some of the candidates have to get past their personal biases, Wilson misdiagnoses a patient, and the winners are named.', '\n      Nov. 27, 2007\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1056, 10, 'episode', 'It''s a Wonderful Lie', 4, 10, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House is equally obsessed with a mother and daughter who don''t lie, and using Christmas to create discord among the team members.', '\n      Jan. 29, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1057, 10, 'episode', 'Frozen', 4, 11, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'When a researcher at a South Pole base becomes ill, House must diagnose the case at a distance. Meanwhile, House tries to find out who Wilson is dating, and his new staff tries to get him cable.', '\n      Feb. 3, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1058, 10, 'episode', 'Don''t Ever Change', 4, 12, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'A woman collapses at her wedding. She led a different life style before her marriage, House insists she hasn''t changed. Wilson starts dating Amber.', '\n      Feb. 5, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1059, 10, 'episode', 'No More Mr. Nice Guy', 4, 13, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House encounters a patient who is too nice for his own good, which is a bigger problem than his emergency room diagnosis; and House competes with Amber for Wilson''s attention.', '\n      Apr. 28, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1060, 10, 'episode', 'Living the Dream', 4, 14, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'House finds himself at odds with his team when he becomes convinced that an actor on his favorite soap, "Prescription Passion," has a serious medical condition.', '\n      May 5, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BNDg2NjI4NjI4NV5BMl5BanBnXkFtZTcwNDc4MDE3MQ@@._V1_SX120_CR0,0,120,180_.jpg'),
(1061, 10, 'episode', 'House''s Head', 4, 15, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'A bus that House was riding crashes. House claims there''s a victim on the bus that''s dying, but not from the bus accident. He stops at nothing to figure out who the patient is and what is ailing them.', '\n      May 12, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1062, 10, 'episode', 'Wilson''s Heart', 4, 16, 'http://www.imdb.com/title/tt0412142/episodes?season=4&ref_=tt_eps_sn_4', 'The team works to save someone close to a central character''s heart. The key is inside House''s head, but he is in a bad way himself.', '\n      May 19, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1063, 10, 'episode', 'Dying Changes Everything', 5, 1, 'http://www.imdb.com/title/tt0412142/episodes?season=5&ref_=tt_eps_sn_5', 'House''s preoccupation with Wilson leaves his team without direction and endangers the patient, a female whose exhaustive work schedule and demanding boss may have caused her condition.', '\n      Sep. 16, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIwMTk5MTkzNl5BMl5BanBnXkFtZTcwMjMwNTI5MQ@@._V1_SY180_CR55,0,120,180_.jpg'),
(1064, 10, 'episode', 'Not Cancer', 5, 2, 'http://www.imdb.com/title/tt0412142/episodes?season=5&ref_=tt_eps_sn_5', 'Years after receiving body parts from an organ donor, five out of six recipients die within a few months, but not from organ rejection. House and the team race against time to figure out why before the final surviving recipient, a young woman who received the donor''s cornea, mysteriously dies as well. House retains a comical private investigator to investigate patients, doctors, and his estranged friend, Wilson.', '\n      Sep. 23, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAxNzE5NTc4NTdeQTJeQWpwZ15BbWU3MDE5NjU1OTE@._V1_SY180_CR75,0,120,180_.jpg'),
(1065, 10, 'episode', 'Adverse Events', 5, 3, 'http://www.imdb.com/title/tt0412142/episodes?season=5&ref_=tt_eps_sn_5', 'House''s investigator gets information on everyone, which House uses to stir the pot of their lives while the team tries to cure a portraitist whose artistic view now looks like Picasso.', '\n      Sep. 30, 2008\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU5MjY4MTM2MF5BMl5BanBnXkFtZTcwNDg3ODY5MQ@@._V1_SY180_CR14,0,120,180_.jpg'),
