(1109, 7, 'episode', 'Fly', 3, 10, 'http://www.imdb.com/title/tt0903747/episodes?season=3&ref_=tt_eps_sn_3', 'There is a fly loose in the lab. Walt and Jesse must do whatever they can to kill it before it contaminates the meth.', '\n      May 23, 2010\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1110, 7, 'episode', 'Abiquiu', 3, 11, 'http://www.imdb.com/title/tt0903747/episodes?season=3&ref_=tt_eps_sn_3', 'Skyler gets more involved in Walt''s business, much to his chagrin as Hank struggles with his recovery. Meanwhile, Jesse takes an active role in his new enterprise, leading him to a startling discovery.', '\n      May 30, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMyMTQ2NzU5Ml5BMl5BanBnXkFtZTcwMjI0NzI1Mw@@._V1_SX120_CR0,0,120,180_.jpg'),
(1111, 7, 'episode', 'Half Measures', 3, 12, 'http://www.imdb.com/title/tt0903747/episodes?season=3&ref_=tt_eps_sn_3', 'Against Walt''s advice, Jesse lashes out. Fearing for Jesse''s safety, Walt takes drastic action to intervene. Meanwhile a tragic event leads to a shocking confrontation.', '\n      Jun. 6, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM2NzA0MTExMV5BMl5BanBnXkFtZTcwMjczOTQ1Mw@@._V1_SY180_CR75,0,120,180_.jpg'),
(1112, 7, 'episode', 'Full Measure', 3, 13, 'http://www.imdb.com/title/tt0903747/episodes?season=3&ref_=tt_eps_sn_3', 'Jesse has disappeared and Walt is in big trouble with Gus. So Gus rehires Gale to learn from Walt''s cooking so that they can dispose of Walt once and for all.', '\n      Jun. 13, 2010\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1Njc3OTkwOV5BMl5BanBnXkFtZTcwOTkyMDY1Mw@@._V1_SY180_CR60,0,120,180_.jpg'),
(1113, 7, 'episode', 'Pilot', 1, 1, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'A high school chemistry teacher is diagnosed with terminal lung cancer and resorts to selling methamphetamine to provide for his family when he is dead.', '\n      Jan. 20, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1114, 7, 'episode', 'Cat''s in the Bag...', 1, 2, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'Walt and Jesse try to decide what to do with the body of Emilio and their prisoner, Krazy 8.', '\n      Jan. 27, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1115, 7, 'episode', '...And the Bag''s in the River', 1, 3, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'Walt is struggling to decide if it''s best to kill Krazy 8 or let him go.', '\n      Feb. 10, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1116, 7, 'episode', 'Cancer Man', 1, 4, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'Walt tells the rest of his family about his cancer. Jesse tries to make amends with his own parents.', '\n      Feb. 17, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1117, 7, 'episode', 'Gray Matter', 1, 5, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'Walt rejects everyone who tries to help him with the cancer. Jesse tries his best to create Walt''s meth, with the help of an old friend.', '\n      Feb. 24, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1118, 7, 'episode', 'Crazy Handful of Nothin''', 1, 6, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'Walt and Jesse sell their product to a new distributor, named Tuco.', '\n      Mar. 2, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1119, 7, 'episode', 'A No-Rough-Stuff-Type Deal', 1, 7, 'http://www.imdb.com/title/tt0903747/episodes?season=1&ref_=tt_eps_sn_1', 'Walt and Jesse try to up their game by making more of the crystal every week for Tuco. Unfortunately, some of the ingredients they need is not easy to find. Meanwhile, Skyler realizes that her sister is a shoplifter.', '\n      Mar. 9, 2008\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1120, 7, 'episode', 'Box Cutter', 4, 1, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Walt and Jesse are held captive for Gus, after Gale''s death. Meanwhile, Skyler tries to find out what happened to Walt.', '\n      Jul. 17, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA2NzQzODA3OTdeQTJeQWpwZ15BbWU3MDY3NjU2NzU@._V1_SY180_CR75,0,120,180_.jpg'),
(1121, 7, 'episode', 'Thirty-Eight Snub', 4, 2, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Shaken by Gus''s calm violence, Jesse cokes up; bleary-eyed and jittery, he throws a party. Walter, believing it''s kill or be killed, buys a snub-nosed .38 on the black market, intent on shooting Gus and Mike. Skyler looks to launder money at a car wash, and, to Hank''s increasing irritation, Marie insists on cheering his every step. Men deliver boxes of minerals and pick up boxes of crystal.', '\n      Jul. 24, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI3MjM4NjgyOV5BMl5BanBnXkFtZTcwMDU3ODQwNg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1122, 7, 'episode', 'Open House', 4, 3, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Skyler finds a way to pressure the car-wash owner into selling, while Marie goes on a series of visits to realtors'' open houses. Her antics get her in trouble, and Hank has to pull a few strings. One of his cop friends helps Marie out and, in turn, asks Hank to look at a notebook found at the scene of a murder. Meanwhile, Jesse''s round-the-clock open houseparty brings no mirth.', '\n      Jul. 31, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BNzg1MTcxMDI2NV5BMl5BanBnXkFtZTcwMjE1MDMxNg@@._V1_SY180_CR83,0,120,180_.jpg'),
(1123, 7, 'episode', 'Bullet Points', 4, 4, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Walt and Skyler have decided to use gambling to explain how Walt has made all of his money. It''s not to be a happy story and Skyler insists that Walt admit to a gambling addiction and express deep shame for what he has done. At dinner with Marie and Hank Schrader, they tell their rehearsed story. Hank has a story for Walt however, one of a dead wannabee singer who had lab notes describing a super-processing meth lab. Hank is convinced the dead man is Heisenberg, the drug manufacturer he has been looking for for over a year. Walt tries to warn Jesse and is appalled at ...', '\n      Aug. 7, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjA0NDA2NjM2M15BMl5BanBnXkFtZTcwMzY0NDgxNg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1124, 7, 'episode', 'Shotgun', 4, 5, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'In his attempt to save Jesse, Walt visits Gus'' fast food restaurant but isn''t quite prepared for what he learns. Nor is Jesse for that matter. In fact, he proves to be quite useful though not everything is as it seems. Hank is convinced that Gale Boetticher was Heisenberg and tells the local police detective that he really has no further interest in the case. He mentions that Jesse Pinkman could have been involved but is not likely the shooter. Walt and Skyler close the deal on the car wash and take a major step in repairing their relationship but at dinner with Hank ...', '\n      Aug. 14, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4NDM3MzkzMl5BMl5BanBnXkFtZTcwNjEzODcyNg@@._V1_SY180_CR75,0,120,180_.jpg'),
(1125, 7, 'episode', 'Cornered', 4, 6, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'It''s the morning after the night before and Walt has a major hangover. Skyler is now convinced that Walt is in danger but he makes sure she understands exactly how important he is to the criminal organization. He''s a little too blunt as Skyler''s reaction is to take the baby and disappear for a few days. One of Gus'' trucks has been hijacked so Mike and Jesse are tasked to get the blue meth back. Once again, Jesse proves to be unexpectedly useful. In the lab, Walt is fed up with Jesse going off on errands with Mike and so comes up with his own solution to cleaning up. ...', '\n      Aug. 21, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkxODE3ODgxMV5BMl5BanBnXkFtZTcwNDcyOTYzNg@@._V1_SX120_CR0,0,120,180_.jpg'),
(1126, 7, 'episode', 'Problem Dog', 4, 7, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'The car wash is now in operation but Skyler isn''t prepared for the amount of money Walt is bringing in. She also arranges for Walt to return the car he bought Walt Jr. but in the end decides he has other plans for it. Walt still believes his life is in danger as long as Gus is alive and speaks to Saul about how he wants to hire a hit man. He finds someone closer to home. Hank and Walter Jr. visit Gus Fring''s chicken restaurant and Hank has something very specific in mind. He''s slowly putting the facts together in his quest for Heisenberg. Facing a series of ...', '\n      Aug. 28, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTA1MjUyNDM5NjZeQTJeQWpwZ15BbWU3MDg5ODQ0NDY@._V1_SX120_CR0,0,120,180_.jpg'),
(1127, 7, 'episode', 'Hermanos', 4, 8, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Hank''s discovery of Gus Fring''s fingerprint in Gale Boetticher''s apartment is enough for DEA and Albuquerque PD to bring Gus in for an interview. He seems to have an answer for everything, including why his fingerprint was found at the crime scene. Everyone but Hank seems to be satisfied and they decide not to pursue the matter. Hank isn''t so sure. Gus realizes how close he''s come to being caught and in flashbacks, his entry into a world of crime and his work with the Mexican drug cartel is revealed. Hank involves Walt in his plan to track Gus'' movements putting Walt ...', '\n      Sep. 4, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI2Nzk2NzI2NV5BMl5BanBnXkFtZTcwNjgyNDI1Ng@@._V1_SX120_CR0,0,120,180_.jpg'),
(1128, 7, 'episode', 'Bug', 4, 9, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Hank is like a dog with a bone and keeps digging into Gus Fring''s business dealings despite Walt''s attempts to get him to stop. When Hank learns that Gus has a warehouse operation, Mike and a crew have to get rid of any trace of drugs on the premises. The Cartel however is lying in wait. When Jesse expresses concern over his future well-being Gus asks him over for dinner and asks him one question: can he cook Walt''s recipe without Walt''s assistance. Skyler meanwhile gets a visit from her old boss who reveals that he''s about to undergo an IRS audit. She has to be quick...', '\n      Sep. 11, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTQ0MTA3NTIxM15BMl5BanBnXkFtZTcwMDEwODE2Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(1129, 7, 'episode', 'Salud', 4, 10, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Jesse, Gus, and Mike fly to Mexico where Jesse will cook a batch of crystal meth for Don Eladio''s skeptical team. If Jesse succeeds, then what? Walter is recovering from a beating and misses his son''s 16th birthday; Walter Jr. comes to his dad''s place to find out what''s wrong. Skyler discovers that Ted Beneke is not using an anonymous windfall to repay the IRS; she calls on Ted. By the end, we''re back poolside at Don Eladio''s villa where they toast each other''s health with well-aged tequila.', '\n      Sep. 18, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTAwNDg2MjY5NjBeQTJeQWpwZ15BbWU3MDg2NzAwNzY@._V1_SY180_CR75,0,120,180_.jpg');
INSERT INTO `episode` (`id`, `itemId`, `itemName`, `title`, `season`, `episode`, `imdbUrl`, `summary`, `date`, `image`) VALUES
(1130, 7, 'episode', 'Crawl Space', 4, 11, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Hank has Walter drive him to the chicken ranch for regular stakeouts then suggests a detour to check out an industrial laundry. How can Walter get out of this one? Ted refuses to pay the IRS, so Skyler turns to Saul who sends his A team. Although Walter has continued to cook while getting no word on what''s happened in Mexico to Jesse, Jesse has had his own six-mile walk with Gus through the desert to the Texas border. When circumstances prevent Walter from cooking for four days, he realizes that someone has been doing the job without him; Gus confirms Walter''s ...', '\n      Sep. 25, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTMzMTgzNzY4N15BMl5BanBnXkFtZTcwOTM5Nzc3Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(1131, 7, 'episode', 'End Times', 4, 12, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'With the DEA now aware of the threat against Hank, Skyler and the children move into protective custody. Walt refuses to do so, barricading himself in his house determined to face whatever fate now awaits him. Jesse again refuses to let Gus get rid of Walt, even after the DEA visits the laundry to have a look around. When his girlfriend''s son, Brock, falls seriously ill he realizes that the poison Walt had given him is missing. He goes berserk assuming Walt is responsible but Walt has a different explanation for him. With Jesse maintaining a vigil at the hospital and ...', '\n      Oct. 2, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMzcwNzM5MDQ4NF5BMl5BanBnXkFtZTcwODc4MzU4Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(1132, 7, 'episode', 'Face Off', 4, 13, 'http://www.imdb.com/title/tt0903747/episodes?season=4&ref_=tt_eps_sn_4', 'Jesse is brought to the FBI for questioning on his knowledge of Ricin. In a last effort to kill Gus, Walt must ask for help from an old enemy.', '\n      Oct. 9, 2011\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTkzMDU5MTcxNF5BMl5BanBnXkFtZTcwOTI2NTg4Ng@@._V1_SY180_CR75,0,120,180_.jpg'),
(1133, 7, 'episode', 'Live Free or Die', 5, 1, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'Flash ahead to Walter''s 52nd birthday: he''s at a Denny''s, disheveled, hair and beard unkempt, using a false name and a New Hampshire driver''s license, paying a guy for a car with weapons in the trunk. Back to the immediate aftermath of Gus''s death: Skyler is dazed at Walt''s murderous success, Walt and Jesse make peace, and Hank visits the burned-out lab. Walt remembers the surveillance cameras Gus used at the lab, so they turn to an angry Mike for help. Can they get rid of the digital evidence in police custody? Is hubris going to trip up Walt?', '\n      Jul. 15, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjIwMzc0Mjk2N15BMl5BanBnXkFtZTcwODM5NzY5Nw@@._V1_SY180_CR75,0,120,180_.jpg'),
(1134, 7, 'episode', 'Madrigal', 5, 2, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'In Germany, the head of a multinational company''s fast food division - which includes Gus'' franchised chicken restaurants - commits suicide when the police come to question him. With Jesse fretting over what happened with the poison cigarette intended for Gus Fring, Walt plans an elaborate ruse to let him find it in his house. With that out of the way, they approach Mike to join them in starting up the business but he refuses. Mike is also approached by a woman, Lydia - obviously involved in Gus Fring''s drug business - who is worried about the number of people who ...', '\n      Jul. 22, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTc5NjQ0MTQwN15BMl5BanBnXkFtZTcwNDk2MzQxOA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1135, 7, 'episode', 'Hazard Pay', 5, 3, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'Walt, Jessie, and Mike''s business starts back up. Walt finds an ingenious solution to the problem of where to set up the lab, Jesse makes a decision about his personal life, and Mike visits each of his crew to ensure that they stay mum, even with the feds pressuring them. Hank goes back to work. Skyler remains numb, and Marie badgers her about what''s wrong. Walt is in for a surprise when Mike divides the money from the first cook.', '\n      Jul. 29, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTczMjA0ODA2NV5BMl5BanBnXkFtZTcwMjk2MzQxOA@@._V1_SX120_CR0,0,120,180_.jpg'),
(1136, 7, 'episode', 'Fifty-One', 5, 4, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'Walter, his confidence up, leases two muscle cars - one for himself and one for Junior. He''s turning 51 and would like a party, Hank and his team visit Lydia in Houston, Jesse flies there to pick up the accelerant, Mike makes a decision that Jessie wants reversed, Hank is offered a promotion, Walter explains Skyler''s behavior to Marie and Hank with references to Ted, and Skyler, coming slowly out of her funk, hatches a makeshift plan to protect her children.', '\n      Aug. 5, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BOTkwODc0MDU3NV5BMl5BanBnXkFtZTcwMzYxNTAyOA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1137, 7, 'episode', 'Dead Freight', 5, 5, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'A boy on a motorbike finds a large tarantula in the desert. Walter pays a visit to Hank in the new office; Walt''s intentions are not entirely above board. The team''s search for methylamine continues, with Michael and Lydia at odds, and Jesse wanting to obtain the chemical without resorting to murder. They hatch an elaborate plan involving buried tanks, a train trestle, and a stalled truck. The children remain with Hank and Marie to Junior''s increasing anger and frustration. Skyler lays more of her cards on the table. What price success?', '\n      Aug. 12, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BNTk2MjQ4Mzk3Nl5BMl5BanBnXkFtZTcwNDI0MTQyOA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1138, 7, 'episode', 'Buyout', 5, 6, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'With blood on their hands, the Walter, Jesse, and Mike partnership must first decide what to do about Todd. After that''s settled, Walter is ready to cook again, but Jesse and Mike have another idea. Skyler spends some time with her daughter and with Marie, and Walter''s invitation that Jesse stay for dinner adds to Skyler''s misery. Hank and his team put nearly round-the-clock surveillance on Mike, and a meth producer in Phoenix has a plan.', '\n      Aug. 19, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjE4MDM4MTc3Nl5BMl5BanBnXkFtZTcwMjcxODgyOA@@._V1_SY180_CR75,0,120,180_.jpg'),
(1139, 7, 'episode', 'Say My Name', 5, 7, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'In the desert, Walter meets with the Phoenix crystal meth distributors to set up a new partnership. Mike''s out, Jesse wants out, Skyler''s checked out, and Hank''s boss wants him to stop spending time and resources on pursuing Mike. Walt needs to get the bug out of Hank''s office, and Hank may have one more play.', '\n      Aug. 26, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTM1MjcyMzIzMl5BMl5BanBnXkFtZTcwOTk4MzAzOA@@._V1_SY180_CR74,0,120,180_.jpg'),
(1140, 7, 'episode', 'Gliding Over All', 5, 8, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', 'Hank''s team puts pressure on Mike''s crew, and at least one is ready to flip. Walter meets with Lydia, demanding the names of Mike''s crew; she''s afraid that once she lists them, Walter will dispatch her. She offers him a deal. Walter talks to Todd''s uncle, Hank has a terrible day at work, and the cooking continues. Marie pushes Skyler to let the children return home, she takes Walt on a short car trip, and Hank may have a touch of constipation.', '\n      Sep. 2, 2012\n    ', 'http://ia.media-imdb.com/images/M/MV5BMTU0NTU4NjQ5MV5BMl5BanBnXkFtZTcwOTM2MzQzOA@@._V1_SY180_CR73,0,120,180_.jpg'),
(1141, 7, 'episode', 'The Decision', 5, 9, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Aug. 11, 2013\n    ', 'http://ia.media-imdb.com/images/M/MV5BMjI2NjE3NDE2MF5BMl5BanBnXkFtZTcwNTcxOTQ0OQ@@._V1_SY180_CR74,0,120,180_.jpg'),
(1142, 7, 'episode', 'Episode #5.10', 5, 10, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Aug. 18, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1143, 7, 'episode', 'Episode #5.11', 5, 11, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Aug. 25, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1144, 7, 'episode', 'Episode #5.12', 5, 12, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Sep. 1, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1145, 7, 'episode', 'Episode #5.13', 5, 13, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Sep. 8, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1146, 7, 'episode', 'Episode #5.14', 5, 14, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Sep. 15, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1147, 7, 'episode', 'Fifty-Two', 5, 15, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Sep. 22, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png'),
(1148, 7, 'episode', 'Crystal Clear', 5, 16, 'http://www.imdb.com/title/tt0903747/episodes?season=5&ref_=tt_eps_sn_5', '', '\n      Sep. 29, 2013\n    ', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/120x90/tv-2177376202._V397576368_.png');
INSERT INTO `show` (`id`, `itemId`, `itemName`, `showId`, `title`, `rating`, `summary`, `years`, `imdbUrl`, `image`) VALUES
(1, 2, 'show', '0773262', 'Dexter', ' 9.0 ', '\nA likeable Miami police forensics expert moonlights as a serial killer of criminals who he believes have escaped justice.    ', '(2006– )', 'http://www.imdb.com/title/tt0773262/?ref_=sr_1', 'http://ia.media-imdb.com/images/M/MV5BMTM5MjkwMTI0MV5BMl5BanBnXkFtZTcwODQwMTc0OQ@@._V1_SY317_CR9,0,214,317_.jpg'),
(2, 5, 'show', '0460649', 'How I Met Your Mother', ' 8.5 ', '\nTed searches for the woman of his dreams in New York City with the help of his four best friends.    ', '(2005– )', 'http://www.imdb.com/title/tt0460649/?ref_=sr_1', 'http://ia.media-imdb.com/images/M/MV5BMTA5MzAzNTcyNjZeQTJeQWpwZ15BbWU3MDUyMzE1MTk@._V1_SY317_CR0,0,214,317_.jpg'),
(3, 4, 'show', '0898266', 'The Big Bang Theory', ' 8.6 ', '\nA woman who moves into an apartment across the hall from two brilliant but socially awkward physicists shows them how little they know about life outside of the laboratory.    ', '(2007– )', 'http://www.imdb.com/title/tt0898266/?ref_=sr_1', 'http://ia.media-imdb.com/images/M/MV5BMjQzMTYyODM4M15BMl5BanBnXkFtZTcwMTAxMDU1MQ@@._V1_SY317_CR10,0,214,317_.jpg'),
(4, 0, 'show', '0944947', 'Game of Thrones', ' 9.4 ', '\nSeven noble families fight for control of the mythical land of Westeros.    ', '(2011– )', 'http://www.imdb.com/title/tt0944947/?ref_=sr_1', 'http://ia.media-imdb.com/images/M/MV5BNTY2MzAxNzM0Ml5BMl5BanBnXkFtZTcwNDA0MDkxOQ@@._V1_SX214_.jpg'),
(5, 3, 'show', '1520211', 'The Walking Dead', ' 8.7 ', '\nPolice officer Rick Grimes leads a group of survivors in a world overrun by zombies.    ', '(2010– )', 'http://www.imdb.com/title/tt1520211/?ref_=sr_1', 'http://ia.media-imdb.com/images/M/MV5BMTc5ODQ0NDA0NV5BMl5BanBnXkFtZTcwNjkzNTM5OA@@._V1_SY317_CR0,0,214,317_.jpg'),
(6, 1, 'show', '0460681', 'Supernatural', ' 8.5 ', '\nTwo brothers follow their father''s footsteps as "hunters" fighting evil supernatural beings of many kinds including monsters, demons, and gods that roam the earth.    ', '(2005– )', 'http://www.imdb.com/title/tt0460681/?ref_=fn_al_tt_1', 'http://ia.media-imdb.com/images/M/MV5BMTI5NzAwODU4MV5BMl5BanBnXkFtZTcwODA3NTgzNA@@._V1_SY317_CR1,0,214,317_.jpg'),
(7, 6, 'show', '1405406', 'The Vampire Diaries', ' 8.0 ', '\nA high school girl is torn between two vampire brothers.    ', '(2009– )', 'http://www.imdb.com/title/tt1405406/?ref_=sr_1', 'http://ia.media-imdb.com/images/M/MV5BMjA4MjAxNTY1OV5BMl5BanBnXkFtZTcwNjk3MDIwNA@@._V1_SX214_.jpg'),
(8, 11, 'show', '0904208', 'Californication', '\n    ', '\nA writer tries to juggle his career, his relationship with his daughter and his ex-girlfriend, as well as his appetite for beautiful women.    ', '(2007– )', 'http://www.imdb.com/title/tt0904208/', 'http://ia.media-imdb.com/images/M/MV5BMTk1NTExNTE4NF5BMl5BanBnXkFtZTcwOTkzNzExNw@@._V1_SY317_CR11,0,214,317_.jpg'),
(9, 8, 'show', '0455275', 'Prison Break', ' 8.5 ', '\nDue to a political conspiracy an innocent man is sent to death row and his only hope is his brother who makes it his mission to deliberately get himself sent to the same prison in order to break the both of them out from the inside out.    ', '(2005–2009)', 'http://www.imdb.com/title/tt0455275/', 'http://ia.media-imdb.com/images/M/MV5BMTg3NTkwNzAxOF5BMl5BanBnXkFtZTcwMjM1NjI5MQ@@._V1_SY317_CR0,0,214,317_.jpg'),
(10, 9, 'show', '1475582', 'Sherlock', ' 9.2 ', '\nA modern update finds the famous sleuth and his doctor partner solving crime in 21st century London.    ', '(2010– )', 'http://www.imdb.com/title/tt1475582/', 'http://ia.media-imdb.com/images/M/MV5BNTA2MTE1NDI5OV5BMl5BanBnXkFtZTcwNzM2MzU3Nw@@._V1_SY317_CR21,0,214,317_.jpg'),
(11, 10, 'show', '0412142', 'House M.D.', ' 8.6 ', '\nAn antisocial maverick doctor who specializes in diagnostic medicine does whatever it takes to solve puzzling cases that come his way using his crack team of doctors and his wits.    ', '(2004–2012)', 'http://www.imdb.com/title/tt0412142/', 'http://ia.media-imdb.com/images/M/MV5BMjA4NTkzNjg1OF5BMl5BanBnXkFtZTcwNjg3MTI1Ng@@._V1_SX214_.jpg'),
(12, 7, 'show', '0903747', 'Breaking Bad', '\n    ', '\nInformed he has terminal cancer, an underachieving chemistry genius turned high school teacher uses his expertise to secretly provide for his family by producing the world''s highest quality crystal meth.    ', '(2008– )', 'http://www.imdb.com/title/tt0903747/', 'http://ia.media-imdb.com/images/M/MV5BMTczMTY0MTMzOV5BMl5BanBnXkFtZTcwNDQxMTk4Nw@@._V1_SY317_CR0,0,214,317_.jpg');
